abd4e62b-bcd9-477a-8061-82fef330fd94	00c94f55-e0cb-4447-8354-4053e493d230	2	7ikeFIgHsMVk3HiNotTESECLYNhyCU5LaCCaPcFORgw	6	2025년부터 달라지는 해외여행 10가지 영국 ETA , 중국 무비자, 파리 지하철, 이태리 로마 : 네이버 블로그	# 주류 면세 기준 변경\n- 2025년부터 주류 면세 기준이 1명당 400달러 이하, 2L 2병까지에서 병 개수와 상관없이 2L 이내, 400달러 이하로 변경\n# 중국 여행 무비자 입국\n- 2025년 12월 31일까지 일반 여권 소지자는 중국 방문 시 비자 발급이 필요 없음\n# 인천 다낭 직항편 신규 운항\n- 2023년 1월 23일부터 에어프레미아 인천-다낭 직항편 운행 시작, 주 4회 운항\n# **ETA** (전자 여행 허가제) 발급\n- 영국에 입국하기 위해서는 ETA 발급이 필요해짐, 모바일 앱이나 공식 홈페이지를 통해 신청 가능, 10파운드 비용 지불 필요\n# 프랑스 파리 대중교통 개편\n- 2025년 1월 1일부터 단일 요금제 도입, 1존과 5존 관계 없이 티켓 요금 통일\n# 스페인 테네리페 섬의 환경세\n- 2025년부터 여행객들에게 환경세 부과 예정, 정확한 금액 논의 중\n# 이탈리아 로마 명소 재정비\n- 희년 기간 동안 트레비 분수 보수 공사 완료, 2유로 입장료 부과 예정\n# 그리스 관광세 인상\n- 2025년부터 그리스의 관광세 대폭 인상, 겨울철 0.5유로에서 2유로, 4월부터 10월 1.5유로에서 8유로\n# 덴마크 코펜하겐 직항편 신규 취항\n- 2023년 9월부터 스칸디나비아 항공이 코펜하겐 직항편 운항 시작, 하계 시즌 주 4회, 동계 시즌 주 3회\n# 멕시코 크루즈 여행 수수료 부과\n- 2025년 7월 1일부터 멕시코에 도착하는 모든 크루즈 승객은 1인당 42달러의 수수료 지불 필요	- 주류 면세 기준이 변경되며, 병 개수와 관계없이 2L 이내, 400달러 이하가 새 기준입니다.\n- 영국 입국 시 ETA 발급이 필수로 도입되었습니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/e330e270-ce0d-4aca-8153-6ac41bcc585b.jpg	0	[0.2912523,0.15555751,0.69226193,0.16233344,0.18329224,-0.25152206,0.20071283,-0.19681963,0.037598707,-0.05110529,0.47200024,0.045942616,0.039115585,-0.014508754,-0.35061026,0.06457398,0.6295018,-0.078315176,0.3959885,0.1848853,-0.23116678,0.18741916,-0.39897588,-0.19707787,-0.1001073,-0.23968726,-0.24231406,-0.018588994,0.21585064,0.570755,0.05417284,0.13371538,-0.7804805,-0.36478052,0.18418053,0.06810833,-0.5513921,-0.35985047,0.18045738,0.84705675,-0.4948282,-0.1044427,-0.3077565,-0.08224589,0.046164814,0.15557306,-0.15346172,-0.55569375,-0.4755223,0.005876707,0.34099215,-0.375909,-0.29229698,0.3418606,-0.0765755,-0.034042932,-0.19221026,0.08445306,-0.38884652,0.013377956,-0.031520095,-0.21437222,-0.35092834,0.09780045,-0.25448978,0.23162809,-0.27109897,0.22743168,0.16659553,-0.12932712,0.16737667,-0.2130709,0.28682268,0.11710641,0.35326552,0.