c51d64dc-021e-475c-94f0-581e4521e63c	5f69e8d3-0043-4caf-bbe2-7c0a13eb4b30	1	NBpDon4PH7_sEOiType65BpJF9JmgSYJSl6QpGuFhYU	3	나혼자 하동 여행｜🍃1박 2일 뚜벅이 하동여행 🍵｜녹차 맛있다! 날씨 최고다! 하동 예쁘다! 😉｜쌍계사, 차체험, 매암제다원, 최참판댁, 독립서점｜국내여행 하는사람er	# 🍽️ 하동의 맛집 탐방\n- 하동에서는 대중교통으로 여행하기 불편하지만, 화개 터미널 근처 음식점인 동백식당에서 재첩국과 돌솥밥을 맛있게 즐길 수 있었다\n- 밤토라는 카페에서는 하동의 특산물인 밤으로 만든 밤파이를 시그니처 메뉴로 제공하며, 아이스 아메리카노와 함께 조화를 이루었다\n- 밤파이는 바삭한 페이스트리 속에 부드러운 밤과 팥이 가득해, 텍스처와 풍미가 뛰어나다, 후식으로 강력 추천할 만한 디저트이다\n# 🍃 하동의 쌍계사 및 차 체험\n- 하동은 대중교통의 **배차 간격**이 길어 여행 시 주의가 필요하지만, 시간을 잘 맞추면 이동이 어렵지 않다\n- 쌍계사는 아름다운 **자연경관**과 함께 유려한 곡선의 지붕, 화려한 단풍으로 방문객들에게 깊은 감동을 준다\n- 하동 야생차 박물관에서는 다양한 체험을 제공하며, 군에서 운영하여 합리적인 가격으로 **품질 좋은 녹차**를 즐길 수 있다\n- 차 체험은 예약제로 운영되며, **일대일 교육**을 통해 하동 차의 유래와 특징에 대해 배우는 기회를 제공한다\n- 티카페에서는 저렴한 가격에 다양한 녹차 음료를 판매하며, 매우 진한 말차 라떼가 인상적이다\n# 🍽️ 하동에서의 저녁과 숙소 경험\n- 원래 저녁 식사는 **화개장터**에서 구매할 계획이었으나, 시간이 늦어 최참판댁 근처의 숙소로 이동하기로 했다\n- 숙소 근처에는 음식점이 부족해, **목돼지국밥**이라는 프랜차이즈에서 혼자 국밥 한 그릇을 먹었다\n- 주문한 돼지국밥은 고기만 있는 형태로, 담백한 맛이었으나 만족스러운 식사는 아니었다\n- 하동에서 기대했던 특색 있는 음식이 없어, 이번 여행의 큰 아쉬움으로 남았다\n- 숙소는 추천하지도 비추천하지도 않지만, 가보고 싶었던 **'빠이 책방'**과 **'도시 고양이 생존 연구소'** 두 곳을 소개하며 관심을 가질 것을 제안했다\n# 🍵 하동 여행에서의 매암 제다원과 최참판댁 탐방\n- 하동의 매암 제다원은 인기 있는 장소로, 숙소에서 도보 40분 또는 버스 15분 거리에 위치해 있으며, 오픈런으로 방문하는 것이 추천된다\n- 매암 홍차는 향긋하고, 각각의 잔마다 다른 **향과 맛**을 경험할 수 있어 즐거움을 주지만, 방문 시 사람이 많아 여유롭게 즐기기 어려울 수 있다\n- 최참판댁은 드라마 '토지' 촬영 세트장으로, 아름다운 풍경과 함께 사진 찍기에 좋은 장소지만, 이동 시 오르막이 있어서 유모차나 휠체어 이용에는 불편할 수 있다\n- 최참판댁 근처에서 콩으로 만든 **콩국수**를 주문했으나, 특별히 먹어봐야 할 메뉴는 아니라는 평이 있었다\n- 하동에는 다양한 먹거리와 함께 기념품도 구매할 수 있는 곳이 있어, 특히 생강청과 하동 특산물을 찾는 것이 흥미롭다\n# 🏞️ 하동의 독립서점 탐방\n- 하동의 독립서점 **직방**을 방문하기 위해 파동을 선택하였고, 초지리 반택에서 도보로 약 30분 정도 걸렸다\n- **화동책방**은 폐교를 활용한 독립서점으로, 기대했던 것보다 작은 규모였고 유명 도서들이 많아 다소 실망스러웠다\n- **또 다른 독립서점**인 '이런 책방'은 하동 청년들의 취향을 반영한 큐레이션으로 채워져 있으며, 작지만 매력적인 공간이었다\n- 두 권의 책을 구매하였고, 하나는 차와 관련된 내용이며 다른 하나는 교토의 차집에 대한 이야기였다\n- 하동 여행의 기억은 주로 **녹차**와 관련된 경험으로 남아 있으며, 앞으로 더 많은 지식을 쌓을 수 있을 것으로 기대된다	하는사람 er	oNcQq8QFiqU	2	[-0.19087122,-0.08811575,-0.106049836,0.2060991,0.38506457,-0.27419645,-0.35250345,