6a864c6c-f85b-4562-89b5-002a4efa607f	7acbc363-1dbe-4aec-8a0d-5b935e0deb05	2	DqiUdiRgKyimZe1c9TqbydfZg6Ry6txj4PkOhfKpu8c	9	달리기를 시작하다 : 네이버 블로그	# 달리기 챌린지 시작\n- 다양한 운동을 즐기는 편이었지만, 달리는 것에 대한 두려움과 망설임이 있었다.\n- 싱가포르에서 러너들을 많이 보고, 달리기를 시작해보는 생각을 하게 되었다.\n- 필라테스 선생님의 권유로 달리기 챌린지를 시작했으며, 10일째를 맞이했다.\n- 매일 아침에 10분 걷고 10분 뛰고 나머지 20분은 걸었다.\n- 달리기를 통해 하루에 작은 습관을 만들어가는 과정을 경험하고 있다.\n- 작은 습관이 생기면서, 자신감과 변화를 느끼게 되었다.\n# 습관의 힘\n- Atomic Habits에서 작은 습관 하나만 만들어도 삶에 큰 변화가 일어날 수 있다고 한다.\n- 운동을 하고 싶지만 아직 많은 운동을 할 수 없는 상황에서, 달리기에 대한 관심이 생겼다.\n- 달리기를 시작하면서 몸이 가벼워지고 자신감이 생기는 경험을 했다.\n- 습관과 습관이 쌓여가며 우리의 생활이 조금씩 더 나은 방향으로 나아질 수 있다고 생각한다.	달리기 챌린지를 시작한 필라테스 선생님의 권유로 매일 10분 달리기를 하는 중이며, 이를 통해 작은 습관이 큰 변화를 가져올 수 있다는 것을 체감하고 있다.\nAtomic Habits에서 언급된 것처럼, 운동을 통해 몸과 마음의 변화를 느끼며 생활이 나아지는 과정을 경험하고 있다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/ba686241-05dd-4578-a88a-4825842b21af.jpg	2	[-0.33167884,-0.025786256,-0.22513679,-0.65220296,0.687305,0.0757525,0.11921072,0.28372398,-0.17807725,0.16921206,-0.009331241,-0.0050015375,-0.5097393,-0.016179409,-0.5040258,-0.010468561,0.48385546,0.5068574,0.46748346,-0.040909555,-0.10743123,0.15895152,-0.49604464,-0.26738417,-0.3685155,-0.4947084,-0.34678778,-0.20086338,-0.33252135,-0.21253833,-0.061384376,-0.44430047,0.27578178,0.12695101,0.11530106,0.32292056,-0.0546486,-0.4326887,-0.5037813,0.13378435,-0.027855422,-0.005972297,-0.036477223,0.39741856,-0.114533424,0.20456366,0.20458873,0.7065243,-0.08815129,0.2600916,-0.30821386,0.03584502,-0.4193051,0.17434347,0.6954657,0.02882659,0.1564672,-0.31746578,0.25727856,-0.038280923,0.085466295,-0.3790753,0.0039575463,-0.051532343,-0.51019,0.39172047,0.27828836,0.05139394,-0.1017354,0.49211073,0.47526965,0.37528008,0.13828814,-0.33809835,-0.079254426,-0.061829235,-0.37757337,0.23828617,0.21231118,0.18935761,-0.4555608,-0.3561231,0.076665014,0.1139008,-0.02207562,-0.5132508,-0.15700498,0.015972693,-0.1095306,0.07356462,-0.14662614,-0.019424137,-0.09885611,0.23546278,0.5681915,-0.112199165,0.30489