c78b8a22-b888-4139-80cc-e3dbc7fd21f9	5f69e8d3-0043-4caf-bbe2-7c0a13eb4b30	1	-a-9qwt6uewRMFYztOUfkTYIK3qzERXvmwoihk0NUFc	3	보름동안 부산여행 ep.4｜완전 럭키먹키잖아? 해리단길 맛집탐험 (역대급 디저트 발견!😍) ｜해변열차 타고 미포에서 송정까지｜혼자 부산 여행 마지막 영상 😭 하는사람er	# 🍜 해리단길 맛집 탐방과 특별한 라면 경험\n- 해리단길에서 유명한 라면 집인 나가하마만게츠는 대기 시간이 길어 대기 도중 미술관을 방문하였다\n- 로버트 카파의 전시를 감상하며 감정적으로 울컥한 후 결과적으로 대기 시간이 길어 식사를 하는 데 어려움을 겪었다\n- 라면은 돼지뼈 베이스의 국물로 매우 맛있었고, 공깃밥은 서비스로 제공 받는 가격이 저렴해 만족스러운 식사가 되었다\n# 🍰 해리단길의 맛있는 디저트 및 카페 탐험\n- 해리단길에는 **분위기 좋고 예쁜 카페**가 많으며, 특히 루디구디는 맛으로 유명한 곳이다\n- 디저트는 **몽글몽글한 크림과 상큼한 레몬 필링**, 진한 초콜릿이 잘 조화된 조합으로 맛의 **조화가 뛰어났다**\n- 부산에서 먹었던 디저트 중에 **1등으로 평가**되며, 달콤한 맛으로 중독될 가능성이 매우 높다\n- 대파 푸가스는 쫄깃한 빵과 매콤한 대파, 고추가 들어간 **식사용으로도 추천**되는 메뉴라고 한다\n- 시니 커피 컴퍼니는 로스터리로 활용되는 큰 공간을 가지고 있으며, 커피의 **풍미는 좋으나** 단 맛은 다소 부족하다는 평가를 받았다\n# 🍽️ 맛있는 떡볶이와 김밥의 발견\n- **상국이네**는 해운대 시장에 위치한 유명한 맛집으로, 기본 떡볶이, 김말이, 오징어 튀김, 김밥을 포장해 간다\n- 떡볶이는 **찐득찐득하고 달콤한 양념**이 특징이며, 쌀떡볶이는 쫄깃한 식감을 제공한다\n- 오징어 튀김은 특별히 **쫄깃하고 맛있으며**, 김말이는 소스에 찍어 먹는 것이 좋다\n- 김밥은 **우엉**의 맛과 식감이 더해져 자꾸 손이 가게 만드는 매력을 지닌다\n- 상국이네의 떡볶이와 튀김은 가격 대비 만족도가 높아, 다음에도 다시 찾고 싶다는 생각이 생긴다\n# 🥗 채소를 사랑하는 브런치 탐방\n- 여행 중 **가장 먹고 싶은 것**은 집밥이나 국밥이 아니라 채소이다\n- **해리단길**의 인기 브런치 집에서 오픈 샌드위치를 주문하였다\n- 메뉴의 구성과 맛, 양을 확실히 이해하고 있어 비용이 다소 비쌌음에도 만족스럽다\n- 오픈 샌드위치는 **유기농 먹물 번**, 아보카도, 저염 베이컨, 스위스 치즈 등이 들어가 있어 맛이 뛰어나다\n- 모든 재료가 **신선**하고 아삭하며 조합과 소스의 어울림이 좋았고, 커피 맛도 우수하다\n# 🍦 해운대 지역의 디저트와 해변 열차 탐험\n- 해운대에서 비가 내리지 않고 맑은 날이 없어 날씨를 신경 쓰며 여행을 진행하고 있다.\n- 미포 정거장에서 **유기농 아이스크림**을 판매하는 '영원 아이스크림바'를 방문해 초콜릿과 패션후르츠 맛을 선택했다.\n- 해변 열차는 미포와 청사포, 송정 정거장이 있으며, 편도 요금은 7,000원이고 약 30분 소요된다.\n- 해변 열차는 응대가 느리지만, 바다 전망이 그리 훌륭하지 않아 두 번은 타지 않아도 될 것 같다.\n- 송정은 서핑 인파와 조용한 분위기가 공존하며, 체력 좋고 날씨가 좋은 분들에게만 추천할 만한 **걷기 여행**이다.\n# 🍜 부산의 마지막 맛집 탐험: 밀면과 돼지국밥\n- **밀면**은 해운대 가야밀면에서 주문하였으며, 온육수에서 신기한 맛의 **신맛**이 느껴졌다.\n- 부산에서 면을 자르지 않고 먹어보려 했지만, 결국 자르지 않으면 먹기 어렵다는 **수익한 경험**이 있었다.\n- 마지막 날의 일정으로 동백섬에서 야경을 찍고 싶었지만, 몸이 힘들어 포기하고 숙소에서 뷰를 감상하기로 했다.\n- 비 오는 날에는 **수변 최고 돼지국밥** 해운대점을 방문하여, 국밥의 담백하고 진한 맛에 감탄했다.\n- 마지막 국밥은 내장국으로 주문하였고, 잡내 없이 매우 맛있어서 감사한 마음을 가졌다.\n# 🎒 