3b5712ee-b979-4582-a1b7-a02e3fc68dca	01adce44-ce13-4182-8347-b20199e99907	4	\N	2	ImageTitle	이미지는 전면에 지퍼가 달린 흰색 긴 소매 셔츠를 입은 여성을 보여줍니다. 사진은 허리에서 사진의 왼쪽을 향한 그녀의 사진입니다. 그녀는 오른쪽 어깨 너머로 매달려있는 브레이드에 갈색 머리 스타일을 가지고 있습니다.\n\n그녀의 배경은 베이지 색이며 이미지에 보이는 다른 물건이나 사람들이 없습니다. 그녀가 입고있는 셔츠에 대한 광고 인 것 같습니다. \n\n이미지의 맨 아래에는 한국어로 된 텍스트가 있지만 여성의 옷이나 사진 자체와 관련이없는 것으로 보입니다.\n\n전반적 으로이 이미지의 구성은 간단하고 간단하며 광고되는 제품 (흰색 긴 소매 셔츠)을 보여주는 데 중점을 둡니다.		https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/capture/6d486401-bb4f-455c-b4fe-9bbe604cedf1.jpg	4	[0.34681654,-0.10619713,-0.2829991,0.1708084,0.08136453,-0.46933264,-0.23444423,0.042841233,0.16668415,-0.3047953,0.35761487,-0.115530275,-0.38829225,0.6192272,0.07782604,-0.103169575,-0.35501188,0.38966888,0.19811311,0.15155075,-0.06861452,-0.29312584,-0.02484249,0.4211273,0.54418236,-0.74073005,-0.08200604,0.056580946,0.47381625,0.40545377,-0.30871347,0.3863225,0.06932803,0.35880175,0.18104154,0.37915364,-0.9106309,-0.22454157,0.21789217,0.29582435,-0.026285823,0.59950864,0.3933887,-0.085350186,0.22020817,-0.10682368,-0.3245541,-0.0050132554,-0.40110382,0.055879813,0.236979,-0.32980672,0.17360407,-0.108638115,-0.09985666,0.091055155,0.50382423,-0.5072797,0.38531703,-0.31601202,0.18433744,-0.051860347,-0.445736,-0.7438644,-0.6533927,0.4839447,-0.18617246,-0.41173247,0.019708686,0.15671843,0.5640758,0.04046067,0.5396615,-0.17489013,-0.13054109,-0.18846571,-0.03880778,0.12253146,0.94407606,0.19396847,-0.4135027,-0.23151489,0.23866528,-0.5049319,-0.19882625,-0.0025135218,0.26132113,0.022392536,-0.634302,-0.39977887,-0.15825261,-0.047444806,-0.74736387,-0.2629975,0.11160451,0.26588085,-0.4241083,-0.32088643,0.25612184,0.53868896,0.119431674,-0.0062988563,0.5580174,0.86391747,0.3357768,-0.18688811,-0.09539523,0.23816945,0.10237621,0.3132573,0.341354,-0.59408,-0.069288924,0.061512943,-0.20872396,-0.2157599,-0.16976237,0.19094563,-0.07284862,-0.13917051,-0.07809068,-0.33314985,-0.47439045,-0.061877098,-0.20525119,0.5581194,-0.116673216,-0.10104383,-0.1