f5bd3e75-f93b-4e0c-952a-11470adbcbb3	f7754c6f-c831-4a8f-8e90-4943dccfafc0	2	zld3tMB7NXkfRPIhgwXnOwnZ-O86vZOycC-Ju0i2lNo	9	박명수 “나이 들고 탈모라 어쩔 수 없이 파마, 정준하는 얼큰이 더 강조”(라디오쇼)	# 박명수의 라디오쇼에서의 토크\n- 박명수가 KBS 쿨FM '박명수의 라디오쇼'에 출연하여 청취자와 소통했다.\n- 청취자는 정준하처럼 큰 체구와 머리 크기를 가진데, 파마 헤어스타일을 하면 얼굴이 작아 보이는지 물었다.\n- 박명수는 자신의 경험과 함께 머리숱이 적은 사람에게 파마를 하는 것은 오히려 얼굴이 더 커 보인다고 조언했다.\n- 또한, 정준하의 헤어스타일을 비꼬며 그의 체구가 큰 이유를 언급했다.	박명수는 라디오 채널 KBS 쿨FM '박명수의 라디오쇼'에서 청취자 질문에 답하며, 파마 헤어스타일이 머리숱 적은 사람에게 오히려 얼굴이 커 보일 수 있다고 조언했다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/6ace44c9-d734-45bb-b877-c4dbb61df0f7.jpg	3	[0.022081077,-0.1112529,0.36037928,-0.38424286,0.28296447,0.21733163,-0.13563539,0.7116924,-0.54299355,0.37225628,-0.042687826,0.49902663,-0.45852378,-0.05614184,0.0427441,-0.12676725,0.067012206,0.07261347,0.36040816,-0.0014289159,-0.00624161,0.21742836,0.70289105,0.00862076,-0.06781636,0.1204313,0.3209552,0.4381907,-0.14263365,0.11775632,0.5911575,0.9891872,-0.49877688,0.4843132,-0.22418548,0.2643232,-0.3840273,-0.43344226,-0.17137972,0.059294242,-0.13890885,0.090126805,0.19319198,0.06510893,0.028506748,0.12863524,0.0103160115,-0.40540093,-0.0003021008,-0.34034112,-0.0938766,-0.4980594,0.1304722,0.22117412,0.08111272,0.38625297,0.46718097,-0.13308969,0.30540308,0.35873342,0.23536512,-0.5371513,-0.025710126,-0.11273622,-0.18526088,0.058912504,0.320988,0.48231298,0.07043555,-0.59373266,0.23751277,0.13516517,0.3404057,-0.12831919,0.07523451,0.26989093,0.134415,-0.03971301,0.59268284,-0.42269504,-0.33163264,-0.0071724253,-0.6049946,-0.18338832,-0.052097574,0.19626458,0.48125497,-0.26126754,-0.23881075,0.61382365,-0.32421073,0.050692346,-0.029873421,0.15822053,0.25640738,-0.36228263,0.29247323,0.17568819,0.06318788,0.3266325,0.15221637,0.16875552,-0.1934062,0.5023701,0.18343174,0.11325515,-0.09772838,0.25760746,-0.13285081,0.3360065,0.28245243,-0.5915689,-0.28023177,-0.31050402,0.13933487,0.29612386,-7.4170086e-05,-0.087310284,-0.17367645,-0.20616613,0.42472932,-0.55843765,0