69656016-ecde-4956-be63-a714a05c1e66	01adce44-ce13-4182-8347-b20199e99907	4	\N	9	ImageTitle	이것은 요가 매트 용 온라인 제품 목록의 스크린 샷으로 보입니다. \n\n주요 주제는 적갈색, 회색, 황갈색 및 밝은 회색의 다양한 색상의 4 개의 롤업 요가 매트의 사진입니다. 각 매트에는 브랜드 이름 "Goolnara"가 인쇄되어 있습니다.\n\n** 주요 요소 분석 **\n\n*** 주요 주제/초점 ** : 이미지는 주로 다른 색의 요가 매트를 보여주는 데 중점을 둡니다.\n*** 지원 요소 ** :이 특정 이미지에는 주요 주제를 지원하거나 상호 작용하는 추가 요소가 없습니다. \n*** 요소 간의 관계 ** :이 요소들 사이에 많은 상호 작용이 없지만 모두 제품을 보여주기 위해 함께 협력합니다.\n\n** 텍스트 요소 **\n\n페이지에서 볼 수있는 유일한 텍스트는 다음과 같습니다.\n\n"요가매트 NBR br"\n\n이것은 한국인 인 것으로 보이며 거친 번역은 "Goolnara NBR 요가 매트"입니다.\n\n이 이미지에는 다른 텍스트 요소가 없습니다.		https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/capture/c00ece3d-6570-4132-be96-ab508acc8346.jpg	1	[0.039847896,0.108915776,0.15631385,-0.0006043082,-0.08983143,-0.43567985,-0.38263285,0.21360496,0.069643855,0.113921,0.74135745,0.020962037,-0.22194104,-0.2501408,0.23993349,0.05425092,-0.089467645,-0.009487532,-0.2808469,-0.2277009,-0.6147922,-0.025221935,0.21282575,0.14987695,0.062543705,-0.1706638,-0.24624723,-0.10445526,0.26222056,0.65603554,0.34511054,0.37764102,-0.19637538,0.44565687,0.24203582,0.35316482,-0.25984833,-0.41761917,-0.1317324,0.26197666,0.254913,0.15326154,0.24257377,-0.20310673,0.2677041,0.26817125,-0.26498717,-0.1035274,-0.09342678,0.22130671,0.109986365,-0.34982398,0.052934818,-0.05306052,-0.16694444,-0.19364655,0.027629968,-0.1259738,0.043119036,-0.3578346,0.21364516,-0.14118278,-0.5314646,-0.8443938,-0.73326385,0.22803481,0.59917724,-0.31504896,0.1821886,-0.058866188,0.41055745,-0.6818799,0.026506763,-0.35455978,0.39156955,0.19481017,0.0087732235,-0.5228348,0.21761173,0.12977004,-0.006776278,-0.46226895,-0.72717774,-0.3397621,0.20656058,-0.16912341,0.048498824,-0.15463525,-0.28121194,-0.27190763,0.028862227,0.1510093,0.11936742,0.18920547,0.18189709,0.26889735,-0.0823368,-0.5531987,0.25234848,0.08682337,-0.10916284,-0.22969995,0.17933422,0.5430174,0.027470836,-0.42124465,0.016678018,0.0018714536,-0.200373,0.18157306,-0.27012128,-0.8313409,-0.17736624,-0.29114604,