2cc3cacf-bf03-40a1-8532-faa0b7963f18	01adce44-ce13-4182-8347-b20199e99907	4	\N	2	ImageTitle	** 이미지 설명 **\n\n이것은 Melkin 브랜드 폼 롤러에 대한 광고의 스크린 샷입니다.\n\n*** 주요 주제 : ** 이미지의 주요 주제는 아마도 20 대 또는 30 대 초반에 젊은 여성으로 보입니다.\n\t+ 그녀는 포니 테일로 뒤로 묶인 검은 머리가 길고 흰색 스포츠 옷을 입고 있습니다. \n\t+ 그녀의 눈이 닫히고 그녀는 편안하고 행복해 보인다.\n\n*** 지원 요소 : **\n\t+이 이미지의 주요 부분을 구성하는 폼 롤러.\n\t+ 16 개의 다른 색 폼 롤러가 3 줄로 쌓여 있습니다. 그것들은 모두 다른 색상과 모양입니다.\n\t+ 배경은 여자의 몸에서 그림자가있는 평범한 흰색 벽입니다.\n\n*** 요소 간의 관계 : **\n\t+ 여자는 폼 롤러 앞에 앉거나 무릎을 꿇고, 마치 스트레칭이나 운동을 마치는 것처럼 손을 내밀었다.\n\t+ 그녀는 폼 롤러 주변에서 행복하고 편안해 보인다. \n\n**결론**\n\n이미지는 멜킨 브랜드 폼 롤러를 건강하고 건강하게 보이는 아름다운 젊은 여성과 함께 보여줌으로써 멜킨 브랜드 폼 롤러를 홍보하기위한 것입니다.		https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/capture/dd8044b1-dae0-4fdd-8d47-5ef915673c61.jpg	0	[-0.07674895,-0.22180477,0.10207276,0.24686463,-0.5372133,-0.26263475,0.19929832,0.35219195,-0.07291713,-0.066953555,0.29653943,0.031412162,-0.35101286,0.969321,0.3022968,0.15164642,0.21600828,0.3183072,0.4962289,0.06837879,0.21813971,0.2324639,-0.11858202,0.42879248,0.5717648,-0.4934597,-0.2739247,-0.040002856,0.34778628,0.30019712,-0.3286299,-0.15125239,-0.15279102,0.15720707,0.11996574,0.40146947,-1.1059848,-0.33652112,0.29067943,0.02626195,-0.023408184,0.45579082,0.24931869,0.2067607,0.01942103,-0.3320113,0.14468758,-0.01722173,-0.7799578,0.105856955,-0.11509112,-0.20300785,-0.015310006,-0.062652186,-0.10316934,-0.23700947,0.30227193,0.050435975,0.27207178,-0.19630805,0.07574606,-0.26920128,-0.5844969,-0.55851936,-0.58778274,0.15983531,0.16208884,-0.11583798,-0.14879344,0.085626826,0.7655139,-0.102863796,0.21390148,-0.12020314,-0.0788008,-0.07917061,-0.20089778,-0.36011052,0.90397656,0.21291924,-0.69656694,-0.25321233,-0.2265075,-0.2931759,-0.3262621,-0.22297302,0.5065966,-0.3649525,-0.3361727,-0.020748833,-0.09285721,-0.33158705,-0.45901832,-0.091211945,-0.18686344,0.12683266,-0.07038468,-0.2600888,0.43256655,0.72457373,-0.1448701,-0.041639917,-0.08205418,1.1361892,0.5271715,-0.16729826,-0.45545036,0.8339641,0.5672122,