3b238f02-a61a-45e2-9417-baa2e899ac3d	01adce44-ce13-4182-8347-b20199e99907	1	WMgpz3O0I30HaykYE80EWfp0W9rVFEvwhHs1GjN-Xzk	9	누구나 쉽게 따라할 수 있는 홈요가 | 20분 기초 요가 | 요가소년 052	# 🧘‍♂️ 기초 요가 프로그램 소개\n- 이 영상은 요가를 처음 접하는 사람도 쉽게 따라할 수 있는 20분 기초 요가 프로그램이다\n- 기초 요가는 중요하며, 아침이나 저녁 언제든지 실시할 수 있다\n- 다양한 자세를 통해 호흡과 신체의 균형을 맞추고, 몸을 풀어주는 동작들이 포함되어 있다\n# 🧘‍♂️ 기초 요가 자세 소개\n- **골반 중립 상태**에서 호흡을 하며, 무릎 사이 간격을 넓혀 엉덩이를 뒤꿈치 방향으로 내린다\n- 엉덩이를 낮춰 **차일드 포즈**를 취하고 이마를 매트 바닥 가까이 대며 5초 멈춘다\n- 상체를 들어올려 **테이블 자세**로 전환하고, 등을 곧게 펴면서 두 발끝을 세운 후 무릎을 바닥에서 띄운다\n- **플랭크 자세**에서 엉덩이를 낮추고, 다리는 곧게 펴며 5초 유지한 후 다시 테이블 자세로 돌아간다\n- **다운독** 동작을 통해 몸의 긴장을 풀고, 발뒤꿈치를 바닥으로 눌러주는 자세를 실천한다\n# 🧘‍♂️ 우타나아사나 및 런지 자세의 동작 흐름\n- **우타나아사나**는 내쉬는 호흡에 왼발을 매트 뒤로 보내고, 두 손을 머리 위로 올리면서 시작한다\n- **다운독 자세**에서는 두 손바닥을 짚고 오른발을 뒤로 보내며, 이어서 오른발을 두 손 사이로 가져와 런지 자세를 만든다\n- 런지 자세에서 왼발을 매트 앞으로 뻗고, 내쉬는 숨에 허리를 숙이며 우타나아사나로 돌아간다\n- 이어서, 척추를 곧게 펴고, 무릎을 매트 뒤로 보내며 플랭크 자세를 취하고, 상체를 올려 코브라 자세로 전환한다\n- 마지막으로, 오른발 끝과 왼발 끝의 위치를 조정하며 전사 2번 자세를 취하고, 두 손을 어깨 높이로 올린다\n# 🧘‍♂️ 워리어 자세와 코어 강화 운동\n- **발 모양**을 바꾼 후, 골반 정렬을 하며 왼 무릎을 90도로 굽힌다. 무릎은 발목을 넘지 않도록 하고, 두 손은 어깨 높이로 뻗어준다.\n- **워리어 투** 자세를 취할 때, 귀와 어깨는 멀리 떨어지며 오른발 뒤꿈치를 바닥에 꾹 눌러야 한다.\n- 왼팔을 굽혀 허벅지 위에 올리고, 오른손은 사선 방향으로 뻗어 자신이 오른쪽 측면이 **시원하게 늘어나도록** 한다.\n- 발끝과 뒤꿈치는 매트 앞쪽을 향하고, **골반과 몸을** 같은 방향으로 유지하며 양 발 뒤꿈치를 일직선으로 한다.\n- 코어 근육을 단련하기 위해 **척추를 곧게** 세워야 하며, 이 자세를 유지하는 것만으로도 큰 효과가 있다.\n# 🧘‍♂️ 기본 요가 자세 연습\n- **두 손을 뻗고 왼쪽과 오른쪽 무릎을 각각 펴며 자세를 유지하는 동작**이 있다.\n- 몸을 바닥에 대고 누운 후 **크런치 자세**에서 각각의 무릎을 펴고 다리를 뻗어 올리는 동작을 반복한다.\n- **나비 자세**로 두 발바닥을 서로 마주 보고 약 5초간 유지하며 중력이 작용해 무릎을 바닥에 가깝게 늘인다.\n- **트위스트 자세**를 통해 발목을 대고 숨 내쉬며 각각의 무릎을 오른쪽과 왼쪽으로 넘기는 동작을 수행한다.\n- 마지막으로 **사바아사나**에서 전신의 긴장을 이완하며 호흡의 흐름을 느끼고 마음의 평온함을 경험한다.\n# 🎶 마무리 인사 및 다음 영상 예고\n- 오늘의 수련을 통해 **더 많은 것들을 발견할** 수 있을 것이라는 기대감을 표현하고 있다.\n- 수련을 마친 참여자들에게 **수고했다**는 인사를 전하고 있다.\n- 다음 영상에서 다시 만날 수 있기를 **기원하는** 내용이 포함되어 있다.	요가소년	6knHMg8JQGk	1	[0.20220435,-0.07494042,0.08600466,0.3931511,0.042206407,0.46136624,-0.14451064,0.09291453,-0.09174846,0.35673136,0.16411476,-0.016723497,-0.029033