b3f9e631-e79a-4f4d-9f5c-4e88e39ee0a8	01adce44-ce13-4182-8347-b20199e99907	1	ofTP0IZxuw3esVWgl_kU2SdWYkOLADotL8K9hyBIIwY	2	내가 애정하는 30분 필라테스 루틴 Ep.02 - 관절에 무리없이 코어, 전신 강화	# 💪 필라테스 전신 루틴 소개\n- 전신 필라테스 루틴은 코어를 중심으로 다양한 움직임을 통해 shoulder(어깨)와 pelvis(골반)을 강화하는 데 초점을 맞춘다.\n- 손목과 무릎 관절에 무리를 주지 않으면서도 운동 효과를 확실히 느낄 수 있는 프로그램이다.\n- 여러 스트레칭과 동작을 통해 몸을 이완하고 관절의 유연성을 향상시키며, 특히 브릿지 동작이 포함되어 있어 엉덩이와 허벅지의 근력을 강화하는 데 효과적이다.\n# 🧘‍♀️ 필라테스 코어 및 전신 강화 운동\n- 골반을 감아주고 엉덩이 아래를 조이며 양쪽 고관절의 주름을 펴는 동작으로 시작한다\n- 호흡에 맞춰 팔을 교대로 내려주고, 힙의 높이를 유지하며 반복하는 동작이 포함되어 있다\n- **와이드 브리지**를 통해 엉덩이 측면을 타겟으로 하여 골반을 압축하고 열 번 반복하는 운동을 진행한다\n- 다리 두 개를 지그재그로 모으면서 등과 허리를 바닥에 밀착하고 척추의 **중립 상태**를 유지하도록 유도한다\n- 팔과 다리를 동시에 움직이며 팔다리가 몸에서 멀어지면서 코어를 강화하는 동작이 포함된다\n# 🧘‍♀️ 필라테스 동작에 대한 요령\n- 손과 발을 바닥에 적절히 놓는 것이 시작 동작이다.\n- **컬업** 동작을 통해 가슴을 접고 턱을 당겨 상체를 올린다. 이때 성급하게 고개만 숙이지 않도록 주의해야 한다.\n- 다리는 길게 뻗고, 상체는 높이를 유지하면서 동작을 이어간다.\n- 무릎은 골반 높이에 맞추어 조정하면서 엉덩이 측면의 긴장을 느낄 수 있다.\n- 각 동작은 숨의 리듬에 맞춰 진행되며, 반대쪽도 똑같이 반복하여 균형을 유지해야 한다.\n# 🧘‍♀️ 필라테스 루틴의 기본 동작\n- 엎드려서 **다리 움직임**을 통해 엉덩이를 강화하는 운동이 포함되어 있다. 다리를 높이 들어 올리며 중심을 잡는 것이 중요하다\n- 양손을 와자 모양으로 펼친 상태에서 오른 다리와 왼팔을 동시에 들어 올리는 동작이 강조된다. 이때 **등과 엉덩이**, 그리고 무릎을 함께 들도록 한다\n- 플랭크 동작에서는 어깨, 팔꿈치, 골반의 정렬을 맞춰 신체를 **네모난 박스** 형태로 유지해야 한다\n- 롱 플랭크를 통해 몸의 중심부에 힘을 주며, 무릎을 뒤꿈치 높이만큼 띄우는 훈련을 진행한다. 이때 척추를 늘리는 느낌이 필요하다\n- 운동 사이사이에 **아기 자세**를 통해 등과 허리를 편안하게 하는 휴식 시간이 주어진다\n# 🧘‍♀️ 롤백 동작과 스트레칭 루틴\n- **롤백 동작**은 무릎을 세워 놓은 상태에서 허벅지를 잡고, 골반을 뒤로 굴리면서 고관절을 펴고 엉덩이를 조여주어야 한다.\n- 몸을 둥글게 말면서 척추 스트레치를 하며, 마지막에 머리를 들어 올리는 것이 중요하다.\n- 트위스트 동작에서는 양손을 앞으로 나란히 하고, 골반을 뒤로 굴리면서 손을 멀리 뻗어내고 시선을 정면으로 유지해야 한다.\n- 마지막 스트레칭 과정에서는 왼쪽과 오른쪽 모두 옆구리를 늘여주고, 팔꿈치를 구부려 하늘을 바라보며 어깨를 열어주어야 한다.\n- 마무리할 때는 두 손을 깍지 끼고 기지개를 켜며 가슴을 천장으로 끌어올리고, 팔을 크게 원을 그리며 내려준다.	빵느	siXXQID3MXQ	1	[0.17241988,0.25626945,-0.5838611,0.3209129,0.071872815,0.4883962,0.383839,0.5208682,-0.44457093,0.15190446,0.5355593,-0.58511686,-0.43724144,0.18937509,-0.280854,0.5098467,0.10446489,0.52722216,-0.025848245,-0.8520665,0.15174052,0.12034226,0.30592448,0.22268364,-0.17428493,-0.42