0c1da08f-cf86-4e77-b5fa-5b2c315e5c94	7acbc363-1dbe-4aec-8a0d-5b935e0deb05	2	GxT-BZwLgThBV8ejF3zfsc33q7t23o9NyiGKlofzGAU	2	소설가 무라카미 하루키 매일 운동 습관 비결은? : 네이버 블로그	# 무라카미 하루키의 건강 습관\n- 하루키는 천재보다 규칙과 단련을 더 중요하게 생각한다.\n- 하루키의 일상: 글쓰기(5~6시간), 운동(1~2시간), 휴식(7~8시간), 수면(7시간)\n- 30대 초반까지 건강한 습관이 없었다. 활동량 줄어 체중 증가, 담배를 많이 피웠다.\n- 달리기 시작하면서 담배를 끊었고, 매년 마라톤에도 참가한다.\n- 매일 1시간은 운동으로 달리기 또는 수영을 한다. 하루를 23시간으로 생각하고, 나머지 시간을 할당한다.\n# 운동 습관 만들기\n- 절대적인 시간 확보가 필요하다.\n- 10분부터 시작해 보자. 매일 일정한 시간을 떼어보라.\n- 하루키처럼 1시간씩 만들지 않아도 괜찮다.	무라카미 하루키는 규칙적인 생활과 운동을 중요시하며, 매일 1~2시간을 운동에 할locates. 그는 절대적인 시간 확보가 필요하다고 강조한다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/f9c4deff-90a1-4961-a78c-aff843d1b174.jpg	1	[-0.40753207,0.011625817,0.041046314,-0.07290204,0.5525458,0.42647097,-0.25680882,0.26562154,-0.41957968,-0.053335153,-0.0042662323,-0.24528258,-0.09043235,-0.31337166,-0.08538954,0.28503555,0.45237082,0.117521785,0.5487361,0.12223889,-0.0709635,-0.06327465,-0.13760212,-0.4917584,0.017668404,-0.45721453,-0.24784192,-0.2706757,-0.03024873,-0.1357963,-0.23549064,-0.43900016,0.40622175,-0.14235055,0.1533706,0.323963,0.22486809,-0.6571175,0.05721309,0.44205227,-0.70928216,0.10841432,-0.16672504,-0.013746513,-0.030755706,-0.4186124,0.4719091,0.46956044,-0.080788486,0.106336884,-0.45035768,-0.36845464,-0.23574443,0.11282548,0.54297745,0.24163145,0.00052226614,-0.17514804,0.2532273,0.16433845,-0.28757116,-0.16593331,-0.17998336,-0.076472774,-0.020721957,0.030615397,-0.09044027,-0.19888075,0.0037906552,0.5819091,0.24631833,0.09331752,0.009706613,-0.35998031,0.11323139,0.22067055,-0.15417394,0.039737917,0.26525307,0.04764948,-0.5347954,-0.23803762,0.3338934,-0.45839274,0.123258896,-0.15057799,-0.03997226,-0.15230246,-0.34265673,0.3790151,0.3443502,0.16755715,-0.57646656,0.30274206,0.51584363,0.050169744,-0.050302964,0.20834555,0.12384279,-0.117305815,0.30314767,-0.2921768,-0.55060303,0.2708735,-0.60089993,-0.3694479,0.4965756,-0.09485683,0.88815904,-0.2919793,-0.23554191,-0.55402714,0.20