e94fbb59-e1e6-4392-aec8-0b7d705751cc	b987706d-3f19-42c7-be0c-6c525ce591cc	2	NBjB9PMgwIy4SqjFAJRFDX3FYc2xrmsxW-GQT8YsUNY	3	속초여행 :: [영금정, 거문고쉼터] 에메랄드빛 속초 바다를 조망할 수 있는 아이와 가볼 만한 풍경 좋은 속초 관광지, 무료 주차 안내	# 속초 여행의 주요 장소: 영금정\n- 영금정은 속초에서 가장 인기 있는 관광지 중 하나로, 많은 사람들이 방문합니다.\n- 영금정의 이름 유래는 파도가 바위에 부딪히면서 신묘한 소리가 나는 것과 거문고 소리를 비유하여 왔습니다.\n- 영금정 주변에는 거문고 쉼터와 속초 등대 전망대가 있어 다양한 관광이 가능합니다.\n# 영금정의 특징\n- 영금정은 바다를 구경하기에 최적의 장소로, 360도 속초바다를 볼 수 있습니다.\n- 영금정 주변에는 해돋이 정자가 있어 많은 관광객들이 찾습니다.\n- 영금정 일대는 조선시대 문헌들에서 비선대로 알려져 있으며, 신비로운 아름다움을 가졌지만 일제강점기에 파괴되었습니다.\n# 주차와 안전\n- 영금정 주변에는 무료 주차장이 있어 여행객들이 편하게 관광할 수 있습니다.\n- 파도가 심한 날에는 얕은 바다에 들어가지 않도록 조심해야 합니다.\n# 속초 등대 전망대와 거문고 쉼터\n- 영금정 주변에는 속초 등대 전망대와 거문고 쉼터가 있어 다양한 관광이 가능합니다.\n- 거문고 쉼터에서는 바다를 가까이에서 즐길 수 있으며, 에메랄드빛 바다가 조망됩니다.	영금정은 360도 바다 전경을 즐길 수 있는 인기 관광지로, 주변에는 거문고 쉼터와 속초 등대가 있어 다양한 활동이 가능합니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/06efa56b-a321-43cf-bf2e-a034295ae1e8.jpg	1	[0.15813962,-0.28006142,0.037142318,0.38141376,0.15272778,0.20421143,-0.07814965,0.2747734,0.2702362,0.56846166,-0.09705091,-0.4886736,-0.10444842,0.21767014,0.015608952,0.8798368,0.054952174,-0.3493907,0.31767592,-0.6196662,-0.20980701,0.41115844,0.5161376,-0.10776445,-0.1577774,0.013051823,-0.76816076,0.07758322,0.6387359,-0.38075745,0.524397,-0.33940852,-0.5862051,0.4292671,-0.3202725,-0.29009634,-0.71461636,-0.59979147,0.4475147,0.69715,-0.055665433,0.040710866,0.8179623,0.044411242,-0.18781523,-0.25372034,0.07422502,0.005086259,-0.29833254,0.13183439,0.49371225,-0.015884664,-0.50804234,-0.2776553,-0.19209763,0.20756385,0.2733252,-0.22628608,-0.1682042,-0.23029709,0.21690378,-0.4508548,0.10853915,0.10350347,-0.074184604,-0.21971992,-0.24467717,0.30925333,-0.75917494,-0.4625377,0.56248915,-0.0019624676,0.49310532,-0.30808902,-0.121046774,-0.41292143,-0.24595487,-0.14634709,0.65918034,0.21894044,-0.75719714,0.05010011,-0.37854338,-0.16834071,0.1748201,-0.34006476,-0.18011941,0.13858238,0.41473272,-0.56984687,0.093432546,-0.2648905,-0.13383624,