22d40b44-ebe5-45a0-92d1-4ba872de83ec	b987706d-3f19-42c7-be0c-6c525ce591cc	2	JUT6nbtY_0w0altAidViEy7XeGW71bKJL-_dY16kHZ4	10	레오나르도 다빈치의 생애	# 레오나르도 다빈치의 생애와 재능\n- 1452년에 태어난 레오나르도 다빈치는 이탈리아 르네상스시대를 대표하는 화가로, 다양한 학문 분야에서 뛰어난 재능을 보였다.\n- 다빈치는 안드레아 델 베로키오의 작업실에서 교육을 받았으며, 스승이 본인보다 그림을 잘 그리는 것을 발견하고 충격을 받아 조각에만 집중했다는 일화가 유명하다.\n- 피렌체와 밀라노를 오가며 다양한 분야에서 활동했고, '최후의 만찬'과 같은 대표작을 남겼다. 또한 모나리자라는 작품으로 널리 알려져 있다.\n# 모나리자의 특징\n- 레오나르도 다빈치는 모나리자를 의뢰인의 아내 엘리자베타를 모델로 그렸으며, 그림은 생동감을 표현하는 데 주력했다.\n- 모나리자의 미소는 완벽한 행복과 조화로운 균형이 결합된 결과물이며, 다빈치의 개인적인 미소를 재현하려 했다는 주장도 있다.\n# 다빈치의 학문적 연구\n- 다 빈치는 해부학, 천문학, 식물학 등 다양한 분야에서 깊이 연구했으며, 모나리자의 미소는 안면 근육구조를 이해한 결과로 보인다.\n- 30구 이상의 시체를 해부하여 세밀하게 스케치하며 본질에 접근하려 노력했다.\n# 다빈치의 죽음과 추모\n- 1519년 5월 2일 예순 일곱의 나이로 세상을 떠난 다빈치는, 그가 보다 오래 살았다면 더 많은 대작들이 남아있었을 것이라는 아쉬움이 있다.\n- 2019년 이탈리아 예솔로에서 열린 축제는 다빈치를 추모하며, 그의 죽음 500주년을 맞이했다.	레오나르도 다빈치는 다양한 분야에서 뛰어난 재능을 보인 이탈리아 르네상스시대 화가로, '최후의 만찬'과 모나리자 등 대표작을 남겼다. 그는 해부학 등을 깊이 연구하며, 모나리자의 미소는 안면 근육구조를 이해한 결과물이다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/logo/Blog.jpg	2	[-0.38048372,0.20751849,-0.4073773,-0.019245489,0.061097547,0.5558034,-0.8921803,-0.10798131,-0.30298233,0.0457424,-0.04008347,-0.54672897,0.5265012,-0.51876336,0.04901173,-0.20132494,0.020700933,0.31248483,0.6541655,-0.37439442,-0.71531856,-0.13864323,0.5927397,-0.664602,-0.06701623,0.18346046,0.45954072,-0.75441146,-0.06636157,-0.0046269195,-0.24478759,-0.83967376,0.580243,-0.02687255,0.09079148,0.25011516,0.13350005,-0.59561735,-0.0386613,0.009828187,-0.55882883,-0.53050256,-0.6882559,-0.1362181,0.09508555,-0.58115745,0.010861947,0.28105867,0.2345673,-0.33730188,-0.014098996,-0.43237767,0.5075409,0.09968376,-0.44790745,0.2221928,-0.113423444,-0.36457676,0.248151,0.52691656,0.14267394,-0.046835124,-0.15638357,-0.745269,0.14682549,-0.847271,0.32313877,-0.42263106,0.24726242,-0.48809576,0.29253352,0.019813813,-0.26169157,0.16838636,0.29352456,0.15035847,-0.03588254,0.08933121,0.34119892,0.14308628,-0.240583,-0.98501194,0.12033391,0.07088317,0