0f24a136-f157-4c41-95bb-f15f9bd6f7a7	7acbc363-1dbe-4aec-8a0d-5b935e0deb05	2	JHDhyw_GZ_lGEeL4QGA5glFRHfmOLDLpv38sRJQN_X0	9	달리기 잘하는 방법	# 달리기의 중요성과 기본\n- 달리기는 누구나 쉽게 시작할 수 있는 운동입니다.\n- 효율적인 자세와 호흡, 체계적인 훈련이 필요합니다.\n# 올바른 달리기 자세\n- 상체는 약간 앞으로 기울이고 허리는 곧게 펴야 합니다.\n- 팔은 90도로 구부린 상태에서 앞뒤로 흔들며 균형을 맞춥니다.\n- 발이 지면에 닿을 때 발뒤꿈치부터 발끝으로 밀어내는 것이 이상적입니다.\n# 효율적인 호흡법\n- 복식 호흡은 폐활량을 최대한 활용할 수 있는 방법입니다.\n- 달리기 속도에 맞춰 호흡 리듬을 조절해야 합니다.\n# 체계적인 훈련 계획\n- 주 3회 정도의 빈도로 시작하고, 점차 시간을 늘려 1시간까지 달릴 수 있도록 목표를 세웁니다.\n- 인터벌 트레이닝은 빠른 속도와 느린 속도를 번갈아가며 반복하는 훈련법입니다.\n# 달리기를 위한 몸 만들기\n- 스트레칭과 근력 강화 운동을 병행하면 달리기 자세가 더 좋아지고, 부상 위험도 줄어듭니다.\n# 적절한 러닝화 선택\n- 러닝화는 발의 모양, 달리기 스타일, 환경에 따라 다르게 선택해야 합니다.\n- 전문 매장에서 발 측정을 통해 나에게 맞는 러닝화를 찾는 것이 중요합니다.\n# 달리기의 장점과 조언\n- 달리기는 체력을 단련하고 마음의 평화를 찾는 시간이기도 합니다.\n- 올바른 자세와 훈련, 그리고 꾸준한 실천이 필요합니다.	달리기는 누구나 쉽게 시작할 수 있지만, 효율적인 자세와 호흡, 체계적인 훈련이 중요하며, 올바른 런닝화 선택과 꾸준한 실천이 필요하다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/0f4da105-e063-4a9f-a20f-d1b63d28ec75.jpg	2	[-0.28731573,0.2243577,-0.28141826,-0.20712474,0.5771821,0.175301,0.13607255,0.3404511,0.03844008,-0.080389455,0.059694618,-0.053244535,-0.27383217,0.17720747,-0.36039943,-0.2243298,0.1594063,0.26227397,0.3216651,-0.074758664,0.06183091,0.5138091,-0.5150745,0.18386179,0.23603435,-0.7688768,-0.3119919,-0.67170167,-0.2554499,0.07200895,0.31723133,-0.7459407,-0.024173062,0.34593862,-0.18417886,0.33798528,0.1951415,0.076458365,-0.3779452,0.3455177,-0.36650366,0.22265962,0.23669161,0.5520425,-0.3485815,-0.24256022,0.040344097,0.5065821,0.29052094,-0.12175556,-0.38432848,-0.7496344,-0.10887497,0.27223498,0.35345423,0.13263781,0.1505412,-0.027499005,0.32201165,0.12913775,-0.43850684,-0.12054838,-0.2916191,-0.33775693,-0.4115089,0.053486597,0.19178466,0.13067776,-0.3199574,0.55612767,0.44615662,0.007847633,-0.3177807,-0.2822268,0.124868736,-0.32349062,0.063568145,0.43070808,0.11772067,0.40471035,-0.3232644,-0.1256051,0.17356615,-0.46889755,-0.19061705,-0.43781477,-0.107412666,-0.18544957,0.039594628,0.111221