a9844d7f-41ee-47b2-944e-89bbd5e39e6d	b987706d-3f19-42c7-be0c-6c525ce591cc	2	zWWBEGzj7rG2952n9KkXTtGErd7hjH0hi4a6CiC3UY4	9	하데스2 공략 : 지상에서 생존하는 방법	# 하데스2에서 지상 생존의 방법\n- 십자로에서 경계를 해제해야 합니다.\n- 멜리노에의 저주를 해결하기 전까지는 멀리 갈 수 없습니다.\n- '운명적인 유대를 푸는 주문'을 완성해야 지상에서 생존할 수 있습니다.\n- '운명적인 유대를 푸는 주문'은 4가지 재료가 필요합니다: 오셔너스의 연꽃, 이끼, 나이트쉐이드 씨앗, 탈라무스.\n- 탈라무스는 카오스 게이트를 통해 얻을 수 있으며, 카오스에게 넥타를 선물하면 확률이 높아집니다.	십자로에서 경계를 해제하고 '운명적인 유대를 푸는 주문'을 완성해야 지상에서 생존합니다. 탈라무스는 카오스 게이트를 통해 얻을 수 있으며, 넥타를 선물하면 확률이 높아집니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/89667b87-eec8-4b02-a93c-17ccc4bc38cd.jpg	3	[-0.3643217,-0.14923382,0.33228055,-0.23662263,-0.109315336,-0.11511858,0.08072223,-0.17716053,0.40268445,-0.34450588,-0.113312334,-0.65427434,-0.10343509,-0.32465458,0.07544115,-0.38838598,0.062212516,0.0046194624,0.7120802,-0.44527078,-0.4677928,0.22624098,-0.07444969,0.10244225,-0.1277822,-0.27465156,-0.16129723,-0.2529894,0.16468255,-0.026850326,0.3266272,0.2175072,-0.060244355,-0.2035102,0.31905505,-0.12767583,-0.14503375,-0.52031845,-0.2322573,0.37430167,-0.51665246,-0.28136992,-0.50524986,0.42759869,0.042000588,-0.43818706,-0.19719343,0.36216196,-0.3780905,-0.63190395,-0.42792487,-0.48682365,0.4491987,0.37051952,0.3745467,0.06356323,-0.37699413,-0.06935884,-0.37587065,-0.66869485,0.08550496,-0.12772329,-0.10634358,-0.015291469,0.31498283,-0.2630935,0.23414448,0.29537863,-0.30668202,-0.40909946,-0.14463717,0.92032486,-0.03799069,-0.36372742,-0.15404207,0.39537203,-0.296575,-0.0047455616,0.08786246,0.30984515,-0.5524101,-0.3352706,0.5141173,-0.34574938,-0.05777294,0.0391007,0.5489703,0.010713298,-0.42555618,0.44304913,-0.49256575,0.43569565,-0.38969022,-0.14156234,0.118782066,0.19798502,0.18783441,-0.44870666,0.3045969,-0.05972365,-0.3773143,0.19304746,-0.59698546,0.23802264,0.09302828,0.6265731,0.26112428,0.42645627,0.57658714,0.01986219,0.08430798,-0.7996895,-0.13719591,0.3616909,-0.123143114,0.26895666,-0.24464312,0.32068968,0.2149947,0.23800467,0.8102844,0.11475277,0.040