d56dc3d9-7b80-40bf-b9db-d393223aca92	01adce44-ce13-4182-8347-b20199e99907	1	lpMctdVe9PTxVLp0e1C6N02OXE2_v2kgWO0JCjrABLM	2	아침 요가로 가볍고 단단한 몸 만들기 (체중감량 · 땀 많이 나는 운동 · 복근운동 · 다이어트) | 25분 모닝 요가 | 요가소년 081	# 🌅 25분 모닝 요가 프로그램 소개\n- 25분 분량의 모닝 요가는 가볍고 상쾌한 하루를 시작할 수 있는 시퀀스를 제공한다\n- 목, 어깨, 가슴, 등, 허리를 풀어주고 코어를 단련하여 신체를 견고하고 탄탄하게 만드는 동작들로 구성되어 있다\n- 자연스러운 호흡을 유지하며 불편한 지점이 있을 경우 스트레칭하여 몸을 풀어주는 것이 중요하다\n# 🧘‍♀️ 아침 요가 동작 요약\n- 매트 바닥에 엎드린 후, 두 다리를 **골반 넓이**로 벌리고 팔꿈치를 굽혀 **이마를 옆구리**에 가져간다.\n- **부장가사나 코브라 자세**로 상체를 들어올리며 호흡을 이어가고, 허벅지 안쪽 근육을 조여 다리를 하나씩 들어 올린다.\n- **판자 자세**를 만든 후, 복부와 허리의 힘을 이용해 정수리와 발뒤꿈치를 일직선으로 유지한다.\n- 오른발을 두 손 사이로 가져오고, 무릎을 굽혀 왼쪽 무릎과 발등을 매트 바닥에 내려놓으면서 상체를 들어 올린다.\n- 왼쪽 무릎을 축으로 상체를 왼쪽으로 **90도 회전**하며 스트레칭을 이어가고, 깊은 스트레칭을 원할 경우 오른손으로 오른발 안쪽 바닥을 잡는다.\n# 🧘 아침 요가 동작 소개\n- 턱을 당기고 무릎을 매트에 내려놓은 후, 발뒤꿈치 쪽으로 엉덩이를 내려가는 **아기 자세**(발라사나)로 시작하여 휴식을 취한다\n- **다운독 자세**(아도 무카 스바나아사나)로 돌아와 호흡을 조절하며 척추를 곧게 펴고 숙여서 다양한 동작을 이어간다\n- **초승달 자세**를 통해 상체를 올리면서 양 손을 머리 위로 올린 후, 내쉬는 숨에 두 손을 매트 바닥에 짚고 다시 **다운독**으로 돌아간다\n- **우티타 파르스보타아사나**(삼각 자세)로 전환하여 한 손을 정강이 또는 매트 바닥에 내려놓고, 다른 손은 천장을 향해 열린다\n- 마지막으로 양 무릎을 펴고 측면이 늘어나는 것을 감각하며 상체를 들어 올린다\n# 🧘‍♀️ 아침 요가 동작 안내\n- 두 발을 **평행하게** 만들고, 두 손은 **골반에 짚**으며 준비 자세를 취한다\n- 숨을 들이마시면서 **가슴을 활짝 열고**, 시선은 정면으로 유지한다\n- 내쉬는 숨에 **상체를 깊이 숙여** 두 손을 매트 바닥에 내려놓는다\n- 척추를 **길게 늘리고**, 무릎에 통증이 있으면 무릎을 **살짝 굽힌 채로** 운동을 진행한다\n- 상체를 **좌우로 비틀며** 각각의 손을 천장으로 향하게 하는 동작을 반복하고, 마지막으로 호흡을 유지하며 **상체를 늘린다**\n# 🧘‍♀️ 아침 요가 동작 요약\n- 매트 앞에 서서 두 다리를 모으고, **호흡을 가다듬으며** 두 손을 머리 위로 높이 들어 상체를 숙이는 동작이 포함된다.\n- '우타나아사나' 자세에서 복부와 허벅지가 먼저 만나며, 이마가 정강이 가까워지는 과정을 반복한다.\n- '나바사나(보트 자세)'에서는 복부에 힘을 주고, 허리를 곧게 펴며 양 다리를 뻗는 동작이 이루어진다.\n- 몸을 편 상태에서 상체를 뒤쪽으로 기울여 **하복부의 자극**을 느끼며, 무릎을 굽혀 부드럽게 다리를 교차하는 모습을 보인다.\n- 동작을 통해 복부에 **3번의 자극**을 확인하고, 각각의 동작을 호흡과 함께 반복하여 근력을 강화한다.\n# 🧘‍♂️ 몸과 마음의 휴식 및 준비 단계\n- **골반 넓이**만큼 두 다리를 벌리고 매트에 내려간다.\n- 발목에 힘을 빼고 손을 골반 옆으로 가져가서 손바닥을 매트에 펼친다.\n- 고개를 좌우로 부드럽게 움직인 후, 턱을 살짝 당기고 눈을 감는다.\n- 숨을 크게 들이마시고 내쉬는 호흡으로 몸의 긴장을 풀어준다.\n- **사바아사나**로 몸과 마음의 휴식을 시작한다.	요가소년	sadmlnz5ygA	3	[0.28233045,-