36b7d85f-f999-42db-9885-63449b3da35b	f7754c6f-c831-4a8f-8e90-4943dccfafc0	4	\N	2	ImageTitle	** 이미지 분석 **\n\n*** 주요 요소 ** : 주요 주제는 안경을 쓰고 검은 재킷을 입는 사람입니다.\n\t+ 그는 앉아있는 것 같습니다.\n\t+ 그의 얼굴 표정은 중립적이거나 약간 심각해 보인다.\n*** 지원 요소 ** : 다른 사람의 어깨의 일부가 이미지의 오른쪽에 보입니다.\n\t+ 그들은 파란 셔츠를 입고 있습니다.\n\t+ 배경은 초점이 맞지 않지만 흰 벽이있는 방으로 보입니다.\n*** 요소 간의 관계 ** : 전경에있는 사람은 프레임 외부의 무언가 또는 누군가를보고있는 것 같습니다.\n\t+ 그의 시선은 약간 카메라에서 오른쪽으로 향합니다.\n\t+ 다른 사람의 어깨의 존재는 현장에 여러 개인이있을 수 있음을 시사합니다.\n*** 텍스트 요소 ** : 한국 텍스트 라인이 이미지의 중심에 중첩됩니다.\n\t+ 파란색 개요와 함께 노란색으로 작성되었습니다.\n\t+ 텍스트는 피사체의 얼굴과 중앙에있는 것으로 보입니다.\n\n전반적 으로이 이미지는 공식 또는 전문적인 환경, 아마도 인터뷰 또는 회의를 제안합니다.		https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/capture/70fff653-11a1-4b6e-b34e-e88af2f4a402.jpg	2	[-0.0933924,-0.2040873,0.1472455,0.23102827,-0.16853401,0.37538427,-0.18443811,0.46551594,0.08324447,-0.3756492,-0.16494048,0.23632929,-0.12806888,0.54985183,0.3557188,0.4658829,-0.27262574,0.20813146,0.20789555,-0.54554796,-0.3946848,0.24325696,0.41177452,0.35390773,0.08732053,-0.25420544,-0.00315685,0.3838966,0.15934664,0.111453526,0.15009874,-0.086203136,-0.16403836,0.5310967,0.16169605,0.57147443,-0.32313132,-0.17327817,0.22672558,-0.35546523,-0.1340834,0.42472294,0.34230036,0.03320886,0.11587921,-0.40081072,-0.08919609,0.27185088,-0.6813976,-0.11896725,0.090877004,-0.47878084,-0.19558018,-0.117960684,0.04976827,0.13898535,0.068413556,-0.31987238,-0.011444233,0.14812137,-0.14074606,-0.1989688,-0.28897285,-0.27230996,-0.45312035,0.046227507,0.106598854,-0.066412486,-0.16275556,-0.010745672,0.4900297,0.07397041,0.4876926,-0.25897187,0.23240902,0.17406943,-0.0629824,0.04330903,0.82945013,0.27581382,-0.33046865,-0.43523127,-0.14426482,-0.59521234,0.012622256,-0.39470753,0.26968068,0.079891875,-0.10420026,-0.12692979,-0.11109218,-0.6151614,-0.07317545,0.2996273,-0.019122869,-0.25047445,-0.079000816,-0.0015824083,-0.19165736,0.19151764,0.13031724,-0.29308024,0.05374335,0.6210725,0.26133588,-0.39480472,-0.10354714,0.19875309,0.5220688,0.3239524,0.28178