9ca4329f-123b-4944-81db-4505d2cf86e1	f7754c6f-c831-4a8f-8e90-4943dccfafc0	1	SjiAdzOZwbaDUujdBqKh9rG_GXnn9BbYYHmuKYrV4zg	4	[무한도전] GD가 그리워했던 그 케미...! 근데 이제 형도니 형에서 프콘이 형으로 갈아탐💦 GD의 NEW 데프콘 레전드 모음.zip | 무한도전⏱오분순삭 MBC110423방송	# 🥕 건강한 음식의 중요성\n- 당근과 시금치 등 몸에 좋은 음식을 거부하며 간헐적 단식을 하고 있다는 언급이 있다\n- 작업 중에도 부모에게 건강한 음식을 요구하며 효도하고 싶다는 다짐을 표현하고 있다\n- 대화 도중 화자의 작업 집중을 방해하는 상황이 발생하면서 주변의 팬에 대한 언급도 이루어졌다\n# 🎤 힙합과 방송의 조화\n- 연예인의 이미지로 바뀐 자신들의 팀에 대해 언급하며 힙합 마인드를 강조한다.\n- 팀원 간의 유대감을 나타내며, 막내가 대접을 받고 있다는 상황을 설명한다.\n- GD의 영향력을 언급하며, 자신의 취향이나 스타일을 표현하는 것에 대한 압박을 느낀다고 주장한다.\n- 힙합 트랩 비트에 대한 흥미를 드러내며, 유행하는 사운드에 대한 실험적인 접근이 필요하다고 강조한다.\n- 방송 분량을 고려한 대화를 통해 팀워크의 중요성을 다시 한 번 강조한다.\n# 🎭 동묘와 가로수길의 비교와 의상 촬영에 대한 이야기\n- 동묘는 **우리에게 가로수길**처럼 보이며, 예상치 못한 매력을 가진 장소라는 인식이 있다.\n- 동묘에서의 의상 촬영 시, 주의할 점은 **무리하게 꾸미지 말고 자연스럽게** 가는 것이며, 도매상으로 오인당할 수 있다는 점이다.\n- 촬영에 대해 **비밀스럽게 진행하려는** 계획이 있으며, 의상과 관련된 요소들을 더 추가할 필요성이 언급된다.\n- 다음 날의 촬영에 대한 긴장감이 있으며, **특별한 의상을 원한다는** 바람이 있다.\n- 촬영의 진행 상황에 대해 서로 의견을 교환하고 있으며, **스스로의 역할**을 조율하고 있는 모습이 보인다.\n# 🎉 케미와 점수에 대한 이야기\n- 서로의 **점수**를 매기며 의미를 되새기는 시간이 주어졌다.\n- 친구에 대한 **감정**이 깊어지며, 백점 만점에 그 이상의 의미를 느꼈다고 언급된다.\n- 상의를 탈의한 정형돈 씨를 두고, 그 **신체**를 매우 좋아한다는 표현이 나왔다.\n- 신체를 **비유**하여 우유와 아기 피부, 키우는 새와 같은 느낌으로 설명했다.\n# 🎤 GD의 어머니와의 유쾌한 소통\n- **어머니**가 데프콘에게 **포포라**를 쓰지 말라며 유머를 통해 소통하고 있다.\n- 대화 중에 **어머니**가 자신의 아들을 위해 걱정하는 모습을 보이며, 데프콘은 이를 자주 언급한다.\n- 프로그램이 관광을 바탕으로 진행되고 있으며, 데프콘은 **전북 전주**에 대한 이야기를 한다.\n- 여러 출연자들이 **고향**의 이야기를 통해 재미있는 상황을 만들어가고 있으며, 촬영하는 카메라 감독도 **전주** 출신임을 나타낸다.\n- 방송 마지막에는 무한도전을 향한 **칭찬**과 응원을 잊지 않으며 긍정적인 마무리를 지었다.\n# 🎤 방송 중 우울한 기분을 날리기 위한 방법\n- 대화 중 우울한 감정을 표현하며, "마음이 너무 울적하다"며 조언을 구하는 모습이 나타난다\n- 음악을 듣는 것이 우울한 기분을 해소하는 방법으로 제안되며, 신나는 음악이 기분을 좋게 만든다고 언급된다\n- 생방송에서의 긴장감을 느끼며 "이게 생방송이야"라고 여러 차례 강조하면서 긴장을 풀려는 노력이 보인다\n- 형이나 동생의 존재가 강조되며, 함께 섞여서 일하는 과정에서의 연대감도 느껴진다\n- 형이 상담자로서 동생에게 조언을 제공하는 장면에서 더 나은 사람을 만나는 것이 중요하다는 내용이 전달된다	오분순삭	zHcNqrLNlp4	11	[0.13061386,0.02731537,-0.08864161,-0.31887603,0.3859809,-0.02212095,-0.44333857,0.71809447,-0.30480814,-0.34978068,-0.12710465,-0