02780a19-26d5-4c2a-8200-e72b65fd5e53	7acbc363-1dbe-4aec-8a0d-5b935e0deb05	2	vvJZWemcO_Sbx4nmqqHm1n0HEhBAFX9cmuBIZRdfBzE	9	유튜버 침착맨을 탐구하고 알아보자. (feat. 작가 이말년 / 침소리)	# 침착맨과 이말년\n- 유튜버 침착맨은 본명이 이병건이며, 웹툰 작가 시절에는 '이말년'이라는 이름을 사용했습니다.\n- 침착맨의 이름 뜻: '침착한 자가 승리하는 하스스톤 게임에서 유래'\n- 유튜버로 활동하면서 본인은 침착맨과 이말년을 다른 사람이라고 주장하기도 했습니다.\n# 침착맨의 데뷔와 플랫폼\n- 처음 인터넷 방송은 다음팟에서 하스스톤을 했으며, 2015년 트위치로 플랫폼을 옮겼습니다.\n# 침착맨 주변 인물들\n- 친한 지인으로는 주호민, 김풍 등이 있으며, 그들과의 방송은 큰 인기를 얻었습니다.\n- 특히 주호민과의 논리대결 편들이 큰 인기를 끌었고, 김풍의 썰들도 많은 시청자들에게 호응을 얻었습니다.\n# 침착맨식 표현\n- 맛 평가가 특이하고, 때로는 풍부한 표현으로 셰프들을 놀라게 합니다.\n- 예를 들어 '고향 생각이 난다'와 같은 표현을 사용합니다.\n# 침착맨과 삼국지\n- 지독한 삼국지 오덕이며, 다양한 삼국지 관련 방송을 진행했습니다.\n- 유비를 '가오충'으로 평가하는 등 어처구니없는 비유도 자주 합니다.\n# 침착맨의 지각\n- 지각이 많은 편이며, 핑계를 대며 정당화합니다.\n- 매번 하는 변명은 방송 전에 잠은 깼지만 침대에서 바로 일어나는 건 예의가 아니다, 고양이가 귀여워서 늦었다 등 말도 안 되는 변명들입니다.\n# 침착맨 양아치\n- 과거 사진을 보면 뒤에서 웃으면서 분위기 양아치 리더 느낌이 난다는 이야기가 있습니다.\n- 하지만 본인이 말하길 평범한 학생이었다고 합니다.\n# 침착맨 닮은꼴\n- 울버린, 일본 아르바이트생, 중국 배우 부대룡 등과 닮았습니다.\n- 특히 부대룡의 드라마 '수당연'에서 침착맨을 소유하는 경우가 있었으며, 이로 인해 잠시나마 의문의 조회수 떡상을 하기도 했습니다.\n# 능력자 침착맨\n- 건국대 단과대 차석 입학, 네이버 웹툰 '이말년'으로 성공, 인터넷 방송인으로서도 성공하며 모든 일마다 성공을 이뤄냈습니다.\n- 하지만 대학교 입학은 수석이었지만 나올 땐 꼴등이고, 영화 '잠 은행'의 경우 많은 관심을 받지 못했습니다.\n# 어이없지만 현실적인 침 소리\n- 시간이 지나면 알아서 해결해 준다.\n- 인생사 새옹지마 기쁜 소식이 와도 마냥 좋아할 수도 나쁜 소식이 와도 마냥 슬퍼하지 않아도 된다.\n# 침착맨의 매력\n- 특유의 힘 없이 공허하고 나른한 눈빛으로 하는 말도 안 되는 헛소리(침 소리)가 매력적입니다.\n- 자극적인 방송과 달리 담백하면서 깔끔한 게 큰 매력입니다.	침착맨은 본명 이병건이며, 웹툰 작가 시절에는 '이말년'으로 활동했으며, 하스스톤을 시작으로 트위치에서 인기 유튜버로 성장했습니다. 그는 특이한 맛 평가와 담백한 방송 스타일로 많은 사랑을 받았습니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/191a2a3d-43a6-42c0-839b-9693b091b566.jpg	2	[-0.059678514,-0.07165873,0.58500105,-0.33532074,0.14180067,0.20701483,-0.11749321,0.36984736,-0.87036705,0.09728949,0.55822074,0.16242746,0.050843123,-0.25764665,0.27968138,0.09366909,0.13904643,-0.30026892,1.1066351,-0.45123142,-0.05476079,-0.21133284,0.42952257,-0.08022991,0.18677752,0.06662348,-0.19326249,-0.12301624,0.14647219,-0.039692815,0.041588586,-0.10638861,-0.4836983,0.492