134ff00e-6a9b-4870-b385-1121c00f6622	01adce44-ce13-4182-8347-b20199e99907	4	\N	9	ImageTitle	이미지는 온라인 마켓 플레이스 YouSibo에서 긴팔 셔츠에 대한 광고의 스크린 샷으로 보입니다.\n\n** 주요 요소 분석 **\n\n*** 주요 주제 : ** 이미지의 주요 주제는 베이지 색, 긴팔 셔츠 및 검은 색 레깅스를 착용 한 여성입니다. 그녀는 검은 머리카락이 포니 테일로 뒤로 당겨졌습니다.\n\t+ 여자의 신체 언어는 그녀가 발레 나 요가 포즈에 서 있다고 제안하고 오른쪽 다리가 그녀의 뒤에 구부러졌고 왼쪽 팔이 옆으로 뻗어 있다고 제안합니다.\n*** 지원 요소 : ** 목재 바레는 이미지의 아래쪽 부분을 가로 질러 달려있어 여자가 춤이나 운동 루틴을 연습하고있을 수 있음을 시사합니다.\n\t+ 이미지의 배경은 평범한 베이지 색으로, 그녀가 입고있는 여자와 셔츠에 집중하는 데 도움이됩니다.\n*** 요소 간의 관계 : ** 여성과 바레의 관계는 상호 작용과 균형 중 하나입니다. 여성의 신체 언어는 운동이나 댄스 루틴을 수행 할 때 Barre를 지원하고 있다고 제안합니다.\n\n** 텍스트 요소 **\n\n*** 텍스트의 내용 : ** 이미지 자체에는 텍스트가 없지만 화면 상단에는 탐색 링크 인 것처럼 보이는 여러 줄의 텍스트가 있습니다.\n\t+ 텍스트 "YouSibo"는 검색 창 및 쇼핑 카트 아이콘과 함께 화면 상단에 두드러지게 표시됩니다.\n*** 타이포그래피 및 글꼴 스타일 : ** 이미지에 사용 된 타이포그래피 및 글꼴 스타일은 깨끗하고 현대적이며 단순성과 가독성에 중점을 둡니다.\n\t+ 내비게이션 링크에 사용되는 글꼴은 SANS-SERIF이며 읽기 쉽지만 제품 이름에 사용되는 글꼴은 약간 크고 장식 적입니다.\n\n** 가독성 및 계층 **\n\n*** 가독성 : ** 명확하고 간단한 색 구성표를 사용하여 이미지의 전반적인 가독성이 좋습니다.\n\t+ 베이지 색 배경은 평온과 평온함을 만드는 데 도움이되며 검은 텍스트는 대비가 잘되고 읽기 쉽습니다.\n*** 계층 구조 : ** 이미지의 요소의 계층 구조는 균형이 잘 잡혀 있으며 주요 주제 (여성)가 중심 단계를 차지하고 지원 요소 (Barre 및 Background)가 맥락과 지원을 제공합니다.\n\n전반적으로, 이미지는 Yousibo에서 판매되는 긴팔 셔츠를 효과적으로 보여 주며 색상, 타이포그래피 및 구성을 사용하여 우아함과 정교함을 전달합니다.		https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/capture/3b4c1de1-9727-493d-98dd-67f3fa3fd43d.jpg	0	[0.3556288,-0.4417805,0.07042424,0.33834884,-0.122504145,-0.34692454,-0.23485905,0.287704,-0.16922428,-0.11856814,0.45945922,0.5393429,-0.24608564,0.76401067,0.01201042,0.039406393,-0.29334396,0.20219599,0.11598815,0.45208314,0.43021712,-0.10774635,-0.3170233,0.3398167,0.2478007,-0.48554668,-0.29948103,-0.35496354,0.1813313,0.4945928,-0.13648148,0.18981041,0.18286581,0.38826442,0.065217495,0.6383376,-0.78381634,-0.14253968,0.17225195,0.13523936,-0.13256103,0.12558244,0.25306123,0.44218403,0.09485978,-0.11633623,-0.29447794,0.05861132,-0.30420583,0.1457035,-0.06440617,-0.0642374,0.4317776,-0.17483217,-0.471299,0.08250622,0.6828412,-0.419