1f927fe0-c567-4bb4-bed3-a50b64544978	01adce44-ce13-4182-8347-b20199e99907	2	AH-_FpsHT8eY99O-TKkZFhf0VGf_Ddp5MSJNkg0k3ts	8	‘요요’가 오는 과학적 이유	# 비만의 기억: 지방 세포에서 분자 수준으로\n- 스위스 취리히 연방공대 연구진은 비만 생쥐와 다이어트를 통해 체중을 줄인 생쥐의 지방 세포를 비교 분석한 결과, 비만할 때 생긴 유전적 변화가 체중 감량 후에도 유지된다는 사실을 밝혀냈다.\n- 비만의 기억은 지방 세포에 새겨진다. 이 연구는 비만이 지방 세포 핵에서 후성유전적 변화를 초래한다는 것을 규명했다.\n- 비만의 기억은 평생 유지되는 것이 아니라, 짧게는 수년 길게는 수십 년 동안 유지된다. 하지만 단기간에 비만의 기억을 없애기는 쉽지 않다.\n- 이 연구는 지방 세포가 비만에 대한 후성유전적 기억을 가지고 있다는 것을 처음으로 보여줬으며, 향후 뇌, 혈관 그리고 기타 장기의 세포도 비만을 기억하는지 등을 규명하는 후속 연구를 진행할 계획이다.	비만 생쥐와 다이어트로 체중 줄인 생쥐의 지방 세포에서 비만 유전적 변화가 유지된다는 사실이 밝혀졌다. 이 연구는 지방 세포가 비만에 대한 후성유전적 기억을 가지고 있음을 처음으로 증명했다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/5c196780-5c42-4f31-b4e6-53038275924c.jpg	0	[0.3853594,-0.3463166,-0.70182955,0.28500554,-0.17482126,0.4389065,0.13542132,0.39633524,-0.537639,0.028551107,0.06943694,0.41347778,-0.14103623,-0.008241155,-0.4616803,0.27058306,0.46034524,0.31225172,0.10569538,-0.74714047,-0.5756048,-0.49550158,0.5095116,-0.1885976,0.16997394,-0.5713303,-0.1335296,0.09497565,0.064350575,-0.076687075,0.43575644,-0.38841882,0.037609726,0.256251,-0.28872287,-0.49622038,0.037998874,-0.31012595,-0.4987336,-0.38725728,-0.36050904,0.14149493,-0.27576712,-0.05994237,-0.014835899,-0.2868232,-0.09609106,0.5390253,-0.23143914,-0.20340894,0.2280401,-0.556772,-0.20039618,-0.55854595,-0.35863042,-0.26958418,-0.36598575,-0.07748288,0.031333987,0.19826716,-0.035340704,-0.70999604,-0.26050442,-0.62009484,-0.30715218,0.15242675,0.36271745,0.20423369,0.012617427,0.20526299,0.24110104,-0.19987735,0.21494046,0.23230904,0.17898515,0.10365061,0.22610588,-0.3157212,0.67794466,0.34875095,-0.18655527,0.0035405084,-0.8804138,-0.14582506,-0.2347263,0.3979342,0.27596128,-0.055408,0.06843151,0.44312823,-0.08054605,-0.31496105,-0.9673066,0.7810532,0.21134102,-0.24768452,-0.3370303,0.078151524,0.56521624,-0.22447823,0.32476348,0.031627923,-0.4498294,0.6714588,0.44454965,-0.3364867,-0.37538898,0.4960963,0.67160153,-0.0868