68fb24fe-d99f-4456-a5c1-639a3de236db	01adce44-ce13-4182-8347-b20199e99907	1	5Pvx4az0Txa75hLWnR046Z0b6JO5LEJC3Sru-w2rY3c	2	몸과 마음이 편안해지는 밤 요가 루틴(목 어깨 승모근 통증완화) | 숙면 스트레칭과 호흡 이완 명상 | 요가소년 543	# 🧘 편안한 몸과 마음을 위한 요가 루틴\n- 하루 종일 긴장 상태에 있었던 몸과 마음을 차분하게 가라앉히는 과정을 제공하며, 목, 어깨, 승모근을 편안하게 이끌어준다\n- 교차한 두 다리로 편안한 자세를 취하고, 가슴을 펴고 어깨를 내려주며 목을 길게 늘리는 자세를 강조한다\n- 호흡과 함께 고개를 오른쪽과 왼쪽으로 기울이며, 각 측면의 목과 승모근에 자극을 주어 점차 편안함을 느끼도록 안내한다\n# 🧘‍♀️ 요가 동작을 통한 상체 스트레칭\n- 호흡을 고르며 양팔을 양 옆으로 길게 뻗고, 손등이 천장을 향하도록 한다\n- 상체를 오른쪽으로 기울일 때, 오른손이 바닥에 닿도록 하며 왼쪽 엉덩이는 바닥에 고정한다\n- 들이마시는 숨에 왼팔을 천장 방향으로 뻗고, 내쉬는 숨에 왼손 끝이 정수리와 같은 방향을 가리키도록 한다\n- 동일한 방법으로 왼쪽으로 기울여 반대쪽도 진행하며 자세의 균형을 잡는다\n- 동작을 하는 동안 상체 측면의 늘어나는 느낌을 의식하고 호흡을 지속한다\n# 🧘‍♀️ 몸과 마음의 이완을 위한 요가 동작\n- **상체를 곧게 세우고 양팔을 길게 뻗은 후**, 내쉬는 숨에 두 손을 등 뒤로 가져간다.\n- 두 손바닥을 **등허리 부근**으로 이동시키고 손끝이 바닥을 향하도록 한다.\n- 가슴을 펴고 양팔꿈치를 가까이 하며 시선은 정면을 바라보며 **호흡을 이어간다**.\n- **귀와 어깨를 멀리 떨어뜨리고** 목이 길어지는 느낌을 유지한다.\n- 두 손으로 주먹을 쥐고 손등을 등허리에 대며 **호흡을 계속 한다**.\n- 깍지를 끼고 이를 등에서 떨어뜨린 후 **양팔을 곧게 펴고** 가슴을 활짝 여는 동작을 진행한다.\n- 고개를 **올려 천장을 바라보거나 위쪽 사선**을 바라보도록 한다.\n- 숨을 깊이 들이마시고 내쉬며 **턱을 당겨 시선을 정면으로** 고정한다.\n# 🧘‍♀️ 마음과 몸의 이완을 위한 호흡 \n- **목과 어깨, 승모근 주변을 부드럽게 풀어주면** 긴장된 상태의 몸을 편안하게 만들어준다\n- 두 눈을 감고 마음을 편하게 하며 **몸을 편안하게 만드는** 것이 중요하다\n- 코로 숨을 들이마시고 입으로 천천히 내쉬면서 **자신만의 소리를 낸다**\n- 숨을 내쉴 때 **근심과 걱정이 빠져나가는 것**을 느낀다\n- 자신의 호흡의 리듬을 유지하며 숨의 흐름을 **자각하는 것이 핵심**이다\n# 🧘‍♀️ 호흡을 통한 이완과 정화\n- **호흡을 자각하며** 의식을 미간에 두고, 호흡의 흐름을 느끼는 것이 중요하다.\n- 호흡이 **미간을 통해 들어오고 나간다고** 상상하며 주의를 기울인다.\n- **들어오는 숨이 머리 뒤쪽에 퍼진다고** 느끼고, 계속해서 호흡을 이어간다.\n- 몸과 마음이 긴장으로부터 이완되어 있는지를 **확인하며**, 평온함을 느낀다.\n- 숫자를 세며 호흡을 이어가는 것이 **이완을 돕고**, 마음을 안정시키는 방법으로 제안된다.	요가소년	dG7QtVW92cI	1	[0.21700455,-0.19106929,0.28408957,0.44028264,0.27702323,0.46160632,0.18396139,0.07426949,-0.106357366,0.19332159,0.49585748,-0.42029727,-0.18773955,-0.108588696,0.0037477612,0.1634602,0.50476146,0.51693356,0.4385118,-0.32639813,0.05246851,0.06472813,0.18691848,0.030156013,0.18777639,-0.355617,-0.089393534,-0.6499107,0.18818377,-0.5354897,0.319599,-1.0393337,0.3087756,0.55662