aef6b2f4-eebc-4319-b2fd-b583e323726b	5f69e8d3-0043-4caf-bbe2-7c0a13eb4b30	1	t3zWT9gnrXqKJKoJ2sZ_Lunno-ag_KZR-tUCHikUeaU	3	세계여행 대신 빡세게 국내여행 - 전라남도 해남으로 출발 01	# 🎒 여행 계획 및 기대감\n- 오늘의 영상은 전라남도 해남으로의 여행을 시작하는 내용을 담고 있다\n- 여행에 대한 기대와 물품 준비, 생일파티에 대한 언급이 포함되어 있어 개인적인 경험도 공유된다\n- 한국의 청정 지역 탐방과 배낭 여행의 느낌을 강조하며, 이번 여행이 설렘으로 가득 차 있다는 점을 표현한다\n# 🌍 해남 여행 계획 소개\n- 일행과 함께 할 때는 보통 **아무 계획 없이** 떠나는 것을 선호하는 편이다\n- 해남 방문 후 계획은, 내일 아침 일찍 **땅끝 마을**와 **보길도** 섬을 방문하는 것이다\n- 보길도는 돌아가신 할아버지의 **고향**으로, 어릴 적 방문할 때는 즐겁지 않았던 기억이 있다\n- 현재는 그 시절이 그리워져 **다시 가고 싶**다는 마음이 생겼다\n- 숙소와 식사에 대한 걱정이 있으며, 커피와 음식이 **고픈 상태**라고 전하고 있다\n# 🌍 여행의 기분과 경험\n- 여행의 궁극적인 목적은 **해방감**을 느끼기 위해서라는 점이 있다.\n- 동네에서 점심을 먹는 것은 여행의 즐거움을 더해주며, 긍정적인 감정을 유발한다.\n- 사람들은 특정한 목적 없이 다가오는 **여행의 느낌**에 집중하며 즐거움을 찾는 경향이 있다.\n- 여행 중에는 시간이 부족할 수 있어, 자신이 가고 싶은 장소를 다시 보여주고 싶어하는 마음이 나타난다.\n- 의사소통이나 정보 교환의 과정에서 순간적인 궁금증이 생기는 경우가 있다.\n# 🏨 모텔 예약과 여행 준비\n- 준비한 모텔 예약은 만 원 정도의 가격으로 아주 괜찮은 조건을 제시하고 있다\n- 특정 모텔에서는 **예약이 마감**되어 있다는 정보가 있으며, 4만 원에 1박하는 옵션도 있다\n- 여행을 위해 아침 일찍 서둘러 출발하려고 했지만, **버스 시간**이 7시, 11시, 4시로 한정되어 있어 선택이 어렵다\n- 여행 준비 중에 백수 생활이 한 달이 되어 게으름이 생겼다는 점이 언급되며, 여행에 대한 기대감이 있다\n- 라면을 먹고 갈 계획이며, 추가로 **야영**을 하고 싶다는 의사도 표명되고 있다\n# 🌍 국내여행의 이유와 준비 상황\n- 여행을 계획한 이유는 한국의 **추위가 심하지 않아서**라는 점이다\n- 오늘 날씨가 갑자기 추워졌으며, 짐 정리가 필요함을 언급한다\n- 현재 2일차 영상 편집이 완료되지 않았으며, 식사는 **김치찌개와 라면**으로 이루어졌음을 전한다\n- 여행 중 지역 음식이 맛있다고 하여,후에 꼭 먹어보겠다는 계획이 있다\n- 저녁 시간이 되었음에도 불구하고 **배고픔**을 느끼고 있다는 점을 강조한다\n# 🏖️ 여행계획 및 다짐\n- 오늘의 숙소와 시설이 **좋아서** 편안하게 쉬고 있으며, 내일의 여행 계획을 아직 정하지 못했다고 언급한다.\n- 10년 전의 보길도를 **기억**하며, 여러 장소를 둘러보면서 원하는 지역을 선택할 예정이라고 말한다.\n- 다양한 옵션을 고려하며 내일은 보길도로 가기로 **결정**했다고 전한다.\n- 바다와 섬 등 앞으로의 한국 여행을 **재미있게** 지켜봐 주기를 요청한다.\n- 구독과 좋아요를 눌러줄 것을 **부탁**하며 영상을 마무리한다.	곽튜브	r6hLMHIH1TI	7	[0.4182934,0.015178539,-0.18636979,0.27591282,0.4728853,0.0078159105,-0.4275943,0.27726847,-0.11265859,-0.20689431,-0.2904053,-0.07434541,-0.3007179,-0.08950282,0.23587683,0.32147694,0.29593408,0.48253787,0.48639917,-0.24016654,0.43729436,0.09505364,-0.02530795,-0.48155475,-0.41003245,-0.7616169,0.