9-4a1a-a6c3-e04cc380404e.jpg,https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/87084875-e141-462c-9b05-f2d7fd13d301.jpg,https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/323f7569-0bdd-4d45-9ffa-1383323cdb91.jpg}	f
ae8bccb6-2783-40a1-b5d2-933470cc5c94	01adce44-ce13-4182-8347-b20199e99907	4	\N	4	ImageTitle	이 이미지는 체중 감량 프로그램을위한 다이어트 계획 인 것으로 보입니다. 페이지 상단에있는 제목은 "15 일 동안 10kg 감량 다이어트 식단 식단"를 읽으며, 이는 "10kg 체중 감량에 대한 15 일식이 요법 계획"으로 변환됩니다. 제목 아래에는 매일 식사 계획을 설명하는 두 개의 텍스트와 이미지가 있습니다.\n\n** 1 일 2 일 **\n\n*** 아침 식사 ** : 빵 한 조각을 곁들인 우유 한 잔\n*** 점심 ** : 야채와 고기를 곁들인 수프 그릇\n*** 저녁 ** : 쌀을 곁들인 구운 닭고기 한 접시\n\n** 3-4 일 **\n\n*** 아침 ** : 야채가있는 오믈렛\n*** 점심 ** : 칠면조 가슴살과 치즈를 곁들인 샌드위치\n*** 저녁 ** : 두부와 함께 볶은 야채 한 그릇\n\n** 5-6 일 **\n\n*** 아침 ** : 과일이 들어간 오트밀 한 그릇\n*** 점심 ** : 구운 닭고기와 아보카도 샐러드\n*** 저녁 ** : 퀴 노아와 함께 구운 연어 한 접시\n\n다이어트 계획은 단백질, 건강한 지방 및 복잡한 탄수화물을 포함한 균형 잡힌 식사에 중점을 둡니다. 부분 크기는 중간 정도 인 것처럼 보이며 칼로리 섭취량은 하루에 약 1500-2000 칼로리 일 가능성이 높습니다.\n\n전반적 으로이 다이어트 계획은 체중 감량에 대한 포괄적이고 다재다능한 접근 방식 인 것 같습니다. 그러나 모든 사람의 영양 요구는 다르며 새로운 다이어트 프로그램을 시작하기 전에 항상 의료 전문가 또는 등록 된 영양사와 상담하는 것이 가장 좋습니다.		https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/capture/1fb3a80c-9e7c-445f-a18a-80f0ba28cd09.jpg	2	[0.05065963,-0.14146042,-0.038581613,-0.018147133,0.2579273,0.03356185,-0.3108049,0.056651067,-0.1723615,-0.17465687,0.1456775,0.36906165,-0.048451766,0.55563116,0.068612345,0.5920254,0.22976929,0.24263456,0.25142208,-0.32199305,0.023074351,-0.25234783,0.22424382,-0.31836727,0.05280593,-0.762988,-0.3627375,0.0948474,-0.102167144,0.2277605,0.5843383,-0.117254056,-0.08698791,-0.29658324,-0.0021819673,0.42388174,-0.18077725,-0.07848616,-0.60932684,0.16118148,-0.21023308,-0.011138814,0.52780867,0.41210768,0.095035784,0.039521985,-0.001826657,0.503428,-1.0075164,0.6521112,0.105902165,-0.39050484,0.20310304,0.1678622,0.12042093,0.0052382434,0.25179648,-0.087853625,-0.03893877,-0.291653,-0.17958531,-0.14925177,-0.3822081,-0.16124415,0.061159734,0.3344344,0.032274015,-0.045643605,-0.14489469,0.020589486,0.3157298,-0.11279696,0.4135434,-0.2674893,0.048825353,-0.36021203,0.017086599,-0.032515205,0.9222383,0.012089545,-0.35314497,0.09753589,-0.012190083,-1.230439,-0.035880566,-0.69224703,0.18177488,-0.0047743493,0.110