fe29ba58-7f02-47fc-8417-87ebe364c582	5f69e8d3-0043-4caf-bbe2-7c0a13eb4b30	2	awQ-bJlu3H3i4YwOyp3cMSMb2X11UvCGmw_pLnAAR7Y	3	태안 2박3일 국내여행 놀러갈만한곳 1일차 충남 펜션 추천 : 네이버 블로그	# 태안 여행 계획\n- 2024년 크리스마스 이브와 다음날을 보내고 연차를 써서 시흥에서 태안으로 2박3일 여행을 결정했다.\n- 첫날은 충남 더담은펜션에 머물며 편하게 시간을 보냈다.\n# 더담은펜션 소개\n- 태안의 이원면 음포해수욕장 바로 앞에 위치한 더담은펜션을 방문했다.\n- 15평형 2층 복층 구조로, 침대가 있는 2층으로는 계단이 내려올 때 경사가 있어 조심해야 한다.\n- 객실은 전부 오션뷰를 제공하며, 개별 바베큐도 가능하다.\n- 객실과 해변에서 힐링 효과를 느낄 수 있었다.\n# 펜션 내 체험\n- 객실 앞에 해먹이 마련되어 있어 파도소리가 선명하게 들렸다.\n- 간식과 고기를 구워 먹을 수 있었으며, 매점도 이용할 수 있다.\n# 추천 사항\n- 입실 시 미리 든든한 식량을 준비하는 것이 좋다.\n- 더담은펜션은 조용하고 편안한 펜션이라 연말이나 여유로운 여행을 찾는 사람들에게 적극 추천한다.	태안의 더담은펜션에서 2박3일 여행을 계획했으며, 펜션은 오션뷰와 바베큐가 가능한 조용한 곳이다. 입실 시 든든한 식량 준비를 추천한다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/802c555f-8391-4471-b1f8-b83cde00af7f.jpg	3	[0.2688774,0.024859529,0.32956672,0.10821053,0.32457465,0.2283437,-0.106868476,-0.23184057,0.13713342,0.103382446,0.19487101,0.03539792,-0.09809469,-0.058970816,0.46925914,0.3110246,0.17882846,0.3106649,0.31850398,-0.27861527,0.42474735,0.65426767,-0.03273572,-0.26751053,-0.20014472,0.2529084,-0.04790035,0.26802397,0.26724148,0.023714758,0.19787556,-0.6514877,-0.4784595,0.10036918,-0.048551776,-0.23932657,-0.4524546,0.0139555745,0.19148643,-0.11102642,-0.05765649,0.009283647,-0.09158136,0.18725741,0.19792688,-0.09778637,0.28915733,-0.26692262,0.1638787,-0.11715171,0.24477915,-0.087798044,-0.4760989,0.21657863,0.09045702,-0.11983946,0.059658613,-0.25221562,-0.2099279,-0.45369798,-0.080021635,-0.052092545,-0.082868464,0.3439883,-0.24096702,0.39701325,-0.056898903,0.55968916,-0.62209284,-0.058613762,0.6627586,-0.10125834,0.9012451,0.24128816,-0.13525891,-0.25686735,0.055083014,-0.2738595,0.36807364,-0.0032099592,-0.82973146,-0.07721934,0.011531375,-0.3787248,-0.014082742,-0.44160038,-0.31103468,-0.022549005,0.081582434,-0.38251334,-0.6191626,-0.03877244,-0.41326815,0.017795082,0.27191892,-0.25005895,0.02451061,-0.27216566,-0.00088100135,0.20221849,0.27599457,-0.01216221