e2834323-2867-4cae-884b-abea1ce8e4b1	7acbc363-1dbe-4aec-8a0d-5b935e0deb05	2	cBttoG0AnpH8lFE041HNYwCalc5Rn-tpJsOfvVkohlU	3	[생각] 인도 여행 유튜브, 삼시세끼, 침착맨 — 개천에서 용 찾기	# 유튜브와 여행 선택\n- 한 달 동안 고프로를 사용하며 유튜버로서의 삶을 고민했지만, 여행의 흐름에 맞는 방향성을 찾기 위해 유튜브보다는 여행을 선택했습니다.\n- 인도는 유명 유튜버들의 방문이 잦은 장소이며, 자극적인 여행 영상들이 인기를 얻고 있습니다.\n# 유튜브의 특징과 방향성\n- 자극적이지 않은 편안한 여행 영상을 만들려는 의도를 가지고 있으며, 이는 퇴근 후 집중하지 않아도 볼 수 있는 프로그램이 필요하다고 생각합니다.\n- 외삼촌의 말을 통해 나영석 PD가 사람들이 찾는 침착하고 편안한 방송 콘텐츠를 개발했다는 사실을 인식했습니다.\n# 유튜브와 방송의 차이\n- 침착맨은 5분 정도만 보더라도 괜찮은 영상을 만들려고 노력하고 있으며, 이는 유튜브가 단순히 자극적인 콘텐츠만을 제공하는 것이 아님을 시사합니다.	유튜버로서의 삶을 고민 끝에 인도 여행을 선택했으며, 침착하고 편안한 콘텐츠를 만들려는 의도로 자극적이지 않은 여행 영상을 제작할 계획입니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/logo/Blog.jpg	1	[0.109020345,0.037678614,-0.24301276,-0.20600572,-0.28906512,0.437544,-0.57039845,0.61059475,-0.821784,0.76843435,-0.02768759,0.28029668,0.058525577,-0.2990916,0.13639691,-0.013684994,0.20265862,0.3221343,0.63368714,-0.9799773,0.24835294,-0.18460289,0.13929942,-0.55443895,-0.3301605,-0.44974685,0.035361357,-0.035030812,0.013779187,0.012975379,-0.33120382,-0.18345015,0.069617726,0.4886384,0.07305491,0.40943447,-0.69264126,-0.620697,-0.41871727,0.28548288,-0.13769418,0.024979215,0.09627772,-0.6025849,0.063809566,0.3292297,-0.049773995,0.023296967,-0.9522587,-0.06931371,-0.46815625,-0.40902066,-0.24992666,-0.29962808,0.5461749,0.22263636,0.29975057,-0.017853124,0.09187412,-0.35875016,-0.081638336,-0.59065336,0.22795443,-0.9528916,-0.46987376,0.4873889,-0.27590644,0.29420274,-0.008940813,0.11047225,0.5253229,-0.03490768,0.34186512,0.2479408,-0.07681818,-0.00434089,-0.18218566,0.2901352,0.1956586,0.4592777,-0.7002861,-0.17356928,-0.10418877,0.37413102,0.13555452,-0.79296976,-0.19941972,0.08691651,-0.40516677,-0.058144808,-0.08419606,0.29303318,0.44334075,0.08470249,0.3349666,0.4631782,-0.038393706,0.33301473,0.0654186,0.38017803,0.24491933,0.4002474,-0.43285024,0.5886017,-0.21462236,-0.4769541,0.019650582,-0.45365828,0.13430852,-0.53873837,-0.3955425,-0.041741