6b918a96-3770-4c4c-9dab-a2ccafaa002e	01adce44-ce13-4182-8347-b20199e99907	1	mB5liOhuCrFOXnldRPPHOcjhse4ouIrkxfIyJ0JJOy4	2	허리 통증 완화를 위한 요가 스트레칭 | 15분 통증 완화 요가 | 요가소년 064	# 🧘‍♂️ 허리 통증 완화를 위한 요가 스트레칭\n- 허리 통증을 즉시 완화할 수 있는 방법은 없으며, 무리하면 오히려 악화될 수 있다\n- 허리 주변의 뭉친 근육을 부드럽게 풀어주는 것이 중요하며, 요가 스트랩이나 수건을 이용해 스트레칭을 진행한다\n- 다양한 동작을 통해 골반을 천천히 열어주며, 무릎과 다리의 위치를 조절하면서 호흡을 이어가는 요가 자세를 수행한다\n# 🧘‍♂️ 허리 통증 완화를 위한 요가 동작\n- 두 무릎을 벌리고 모으면서 호흡을 조절하고 요가 자세를 유지하는 동작이다\n- 양 팔꿈치를 굽혀 손을 머리 위로 넘기며, 무릎과 발의 넓이도 조절하는 동작이 포함된다\n- 오른쪽과 왼쪽 무릎을 교대로 엄지발가락 쪽으로 내려가게 하며 호흡을 동반하는 반복적인 동작이다\n- 꼬리뼈를 바닥에 밀착시키고, 들이마실 때마다 등을 아치 형태로 만들고 내쉴 때 바닥에 밀착시키는 것이 중요하다\n- 마지막으로 오른쪽 무릎을 굽히고 원을 그리는 동작으로, 상체가 흔들리지 않도록 주의하며 이어서 반대쪽으로 반복하는 것이 권장된다\n# 🧘‍♂️ 허리 통증 완화를 위한 요가 동작\n- 오른 무릎을 가슴 쪽으로 당긴 후, 준비한 **수건**을 오른발에 걸어 다리를 곧게 펴고 호흡한다.\n- 왼쪽 무릎을 살짝 굽혀도 되며, 오른발 끝을 당긴 후에는 수건을 풀고 반대 쪽으로 진행한다.\n- 왼쪽 무릎을 가슴 쪽으로 당긴 후, 수건을 통해 왼쪽 무릎으로 원을 그리며 움직임을 최소화한다.\n- 오른 무릎도 마찬가지로 곧게 펴고 반복하며, 필요 시 두 무릎을 굽혀주는 것도 가능하다.\n- 두 무릎을 굽히고 엉덩이 가까이 당긴 후, 양쪽 다리를 들어올리면서 복부의 움직임을 최소화한다.\n# 🧘‍♂️ 허리 통증 완화를 위한 요가 동작\n- 두 손을 **천장을 향해** 곧게 뻗으며 **호흡을 조절**한다.\n- **왼손과 오른손**을 번갈아 위아래로 뻗으며 긴장을 푼다.\n- 왼쪽 다리를 **무릎을 굽힌 채** 들어 올리고, 오른 다리는 곧게 뻗는다.\n- 왼손은 천장으로 뻗고 오른손은 왼쪽 무릎 위에 두어 **균형을 맞춘다**.\n- 두 손을 번갈아 바꿔 가며 다리와 팔을 **뻗으며** 스트레칭을 진행한다.\n# 🧘 허리 통증 완화를 위한 요가 스트레칭 동작\n- 양팔을 벌리고 오른발을 들어 오른쪽 발목을 왼쪽 무릎 위에 올려놓은 후, 오른쪽 무릎을 왼쪽 바닥으로 내려간다.\n- 자세를 유지하며 **호흡**을 다섯 번 반복한 후, 양팔을 매트에 내려놓거나 팔꿈치를 굽혀 어깨를 바닥에 고정시킨다.\n- 발을 바꿔서 왼발을 들어 왼쪽 발목을 오른쪽 무릎 위에 얹고, 왼쪽 무릎을 오른쪽 바닥 쪽으로 내린다.\n- 두 다리를 쭉 핀 상태로 들어올리고, 두 손을 깍지 껴서 무릎을 가슴 쪽으로 당긴 후, 내쉴 때 더 깊이 당긴다.\n- 마지막으로 몸을 굴려 일어나 앉고, 오늘의 수련을 마치며 즐거움을 느꼈다면 좋아요와 댓글을 남기도록 유도한다.	요가소년	pxe84igAXUk	2	[-0.21560872,0.10962684,0.28638542,0.44485205,0.22863424,0.28079847,0.17516533,0.2767858,-0.45578182,0.21752608,0.55066335,-0.6529004,-0.21941459,-0.100113705,-0.2963668,0.2150121,0.48650914,0.7346914,0.46474913,-0.36655793,0.06834956,0.10727,0.45822185,0.027995761,0.0064421967,-0.6829636,-0.20044824,-0.5141104,0.18185419,-0.5392057,0.22773328,-0.73374987,0.3610546,0.62189114,0