d5afe093-4ce1-45fa-89b3-e2b765340804	01adce44-ce13-4182-8347-b20199e99907	1	5eAVr-iyvPmRGfSiwDiYY88GHIE8PbNqIfOiJjfE2Pk	3	(요가은) 여행자를 위한 요가 / 매트없이하는요가, 출장요가, 여행요가	# 🌿 여행 중 손쉬운 요가 동작\n- 이번 콘텐츠는 매트 없이 야외나 여행 중에 간편하게 따라 할 수 있는 전신 운동으로 구성되어 있다.\n- 각 동작은 허리를 곧게 펴고 다양한 스트레칭을 통해 목과 어깨를 이완하는 데 중점을 둔다.\n- 호흡을 중요시하며, 깊게 마시고 길게 내쉬는 방식으로 진행하며 몸의 긴장을 풀어준다.\n# 🧘‍♀️ 요가 동작 및 호흡법\n- **숨을 멈춘** 후 양손을 머리 위로 올리고 왼쪽으로 기울이며 몸을 움직인다\n- 내쉬는 숨에 **옆구리**에 힘을 주며 중앙으로 돌아오고, 팔을 쭉 뻗으며 반복한다\n- 왼쪽과 오른쪽 옆구리에 힘을 주며 **상체를 흔들리지 않도록** 유지한다\n- 가슴을 하늘로 들어올리며, 팔꿈치를 **가깝게** 모은 후 팔을 내린다\n- 오른쪽 및 왼쪽 다리를 들어 올리고, **접었다 폈다** 하며 몸통의 정렬을 유지한다\n# 🧘‍♀️ 요가 자세와 스트레칭 방법\n- 오른 다리를 접어 들어 올리고, 왼손으로 오른 무릎을 잡으며 척추를 비틀어 중심을 잡는다\n- 오른손으로 오른발을 잡아 발을 엉덩이 가까이 가져오고, 허리를 꺾이지 않게 유지하면서 허벅지 앞쪽을 스트레칭한다\n- 스쿼트 자세로 앉아 양손을 가슴 앞에 모으고, 오른쪽으로 기울이며 오른쪽 옆구리에 자극을 느낀다\n- 왼 다리도 동일하게 들어 올리고, 중심을 잡아가며 왼팔을 뒤로 보내고 왼쪽으로 기울인다\n- 마지막으로 왼쪽 옆구리에 자극을 느끼며 서고, 몸을 가볍게 풀어준다\n# 🧘‍♀️ 요가 동작 안내\n- 숨을 들이쉬며 **무릎을 접고** 앉아 의자 자세를 취한 뒤 호흡을 조절한다\n- 무릎을 접은 상태에서 **양손을 가슴 앞에서 맞대고**, 오른쪽으로 척추를 비틀어 **내장기관을 마사지**한다\n- 왼쪽 팔뚝이 오른쪽 허벅지 바깥쪽에 닿도록 하며, **균형감각**을 유지하고 오른쪽 엉덩이를 활성화시킨다\n- 시선은 바닥을 바라보며 한쪽 발을 들어 올리고, 상체를 **비틀어주는 동작을** 이어간다\n- 마지막으로 양손을 머리 위로 올리며 숨을 마시고 내쉬며, 척추를 **늘렸다가 숙이는** 동작을 반복한다\n# 🧘‍♀️ 매트 없이 시행할 수 있는 요가의 이점\n- **매트 없이도 할 수 있는 요가**는 여행 중이나 출장 중에도 실행 가능하다.\n- 건강하고 행복한 하루를 보냈음에 감사를 표현하는 것이 요가의 일환으로 권장된다.\n- 양손을 가슴 앞에 모아 **합장**하는 자세는 요가의 중요한 요소 중 하나이다.\n- 요가 세션 후에는 사용자에게 좋아요 버튼을 눌러줄 것을 권장한다.\n- 다음 영상에 대한 기대감을 불러일으키며, 시청자와의 소통을 강조하고 있다.	요가은YoGaEun	9lwGRERj_A8	1	[0.3388595,-0.13240007,0.2660108,0.2818455,0.2456892,0.43092406,-0.1744228,0.3762374,-0.113288686,0.40710652,0.566993,-0.21747832,-0.14607704,-0.30982298,-0.12579337,0.03844701,0.28306141,0.552787,0.715762,-0.29871622,0.27665663,0.18055134,0.07734309,-0.124165796,0.057874467,-0.42173186,-0.29373527,-0.48412633,0.22736584,-0.14277583,0.19297765,-0.7648958,0.22512361,0.7243141,0.29217303,0.46459395,0.29305887,-0.28504273,-0.52041245,0.22090843,-0.24250741,0.058362868,0.30341256,0.22434948,-0.43326518,-