4c0a6283-9369-41e5-8708-b9eefed00928	5f69e8d3-0043-4caf-bbe2-7c0a13eb4b30	2	d1xqIZzDIkdJzdCoqm05v6ky2sYR9ny4DYZOvf69nHc	3	'해외 골프 여행지 순위' 3위 일본, 2위 중국, 1위는 바로... | 위키트리	# 해외 골프 여행지 순위\n- 일본이 3위, 중국이 2위를 차지하고, 1위는 베트남\n- 2024년 해외 골프 예약 인원이 전년 대비 62% 증가\n- 동남아 지역이 전체 예약의 62%를 차지하며 가장 인기 있는 골프 여행지로 자리 잡았고, 중국과 일본이 그 뒤를 이었다\n- 베트남은 전년 대비 예약 인원이 2배 이상 증가해 태국과 함께 대표적인 골프 여행지로 떠올랐다\n- 중국의 예약 비중이 급증하면서 골프 여행지로서의 입지를 강화\n- 제주 골프장 내장객은 2년 연속 감소세를 보였다\n- 항공료와 숙박비, 골프장 이용료 상승으로 해외 골프 여행지가 더 매력적인 대안으로 떠올랐다\n# 하나투어의 대응 방안\n- 2025년 첫 대회로 베트남 호찌민에서 열리는 '하나투어 글로벌 골프 챌린지' 기획\n- 올해 분기마다 개최될 예정, 3박 5일 일정으로 진행\n- 참가자들은 연습 및 친선 라운드와 본선 라운드를 포함해 총 3번의 라운드를 즐길 수 있다	1위는 베트남, 2위 중국, 3위 일본을 차지했으며, 2024년 해외 골프 예약이 전년 대비 62% 증가했다. 하나투어는 2025년 첫 대회로 베트남 호찌민에서 '하나투어 글로벌 골프 챌린지'를 기획했다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/3622dc21-67d4-4388-8171-7d5f4b599d0b.jpg	1	[-0.53069353,0.0035682758,-0.27091727,-0.093785204,0.01876868,0.079791516,-0.53176105,0.72071713,0.40606368,0.4833309,0.11883533,0.019701743,0.14794028,0.31784886,0.11323044,0.014992583,0.29498488,-0.29285967,-0.19326839,-0.35616302,-0.13605693,-0.023824535,-0.276304,-0.2060198,-0.03391922,-0.92100877,-0.2768501,-0.028339949,0.51366544,0.71484053,-0.089732,-0.38433588,-0.50462985,0.33362967,-0.14793563,0.136291,-0.60724795,-0.2666752,0.54578996,0.14968452,0.10305438,0.055863883,-0.11666735,-0.019051827,0.43093038,-0.16049471,0.8288218,-0.06646596,0.013673262,0.39884162,-0.0974426,-0.65576094,-0.97413826,-0.33583695,-0.21554354,0.1714131,-0.32906172,0.07791732,-0.0458984,0.038116693,-0.5898639,-0.4535232,0.16534977,-0.256023,-0.6983298,-0.010594415,-0.19546717,0.5963478,0.16490838,0.25264758,0.27285805,-0.26755318,0.3321883,0.6702205,-0.16338098,-0.13603613,-0.35703856,-0.028214809,0.5580346,0.11197637,-0.7239014,0.20006916,0.12406064,0.27712315,0.24100584,-0.833122,0.09121697,-0.24276862,0.35142982,-0.2217545,-0.009034737,-0.3655082,-0.59516776,0.0718431,-0.09226401,-0.19248325,-0.18311694,0.07019741,-0.27891