959d74b7-12ac-45f1-81dc-ac58bc8008a7	5f69e8d3-0043-4caf-bbe2-7c0a13eb4b30	1	lwR5hUk0k1TH8Y1L4_aRZ3lZQtzOcaatJHFta-fDPYI	3	도쿄의 고독한 대식가 - 일본(1)	# ✈️ 일본 여행의 시작과 준비과정 \n- 유튜버는 **일본 지사**에 초대를 받아 비자를 받아 일본 여행을 하게 되었다고 한다\n- 이번 여행은 약 일주일 정도의 짧은 일정으로 계획되었다\n- 유튜버는 과거에 우즈베키스탄을 방문한 기억을 떠올리며, 일본행 항공권이 더 저렴하다고 느낀다\n- 일본어 실력이 부족하여 애니메이션으로 배운 지식을 바탕으로 여행에 대한 추측이 많다고 한다\n# 🍽️ 도쿄의 다양한 음식 경험\n- 여행 중 다양한 일본 음식을 즐기기 위해 **1박** 계획을 세웠다.\n- 도쿄에서의 여행은 길고 즐거운 경험이지만, 음식의 **다양성**이 더 매력적이다.\n- 여행 준비 과정에서, 친구와의 **연락**을 통해 일본 여행 계획을 조율했다.\n- 일본의 도심은 별로 선호하지 않지만, 그럼에도 불구하고 **여행을 즐기기로** 했다.\n- 여행 일정이 짧아 결국 맛있는 음식과 사회생활을 **최대한 즐길 계획**이다.\n# 🍣 도쿄의 다양한 먹거리 경험\n- 붕어빵은 **1500원**으로 구매할 수 있으며, 고향 모찌의 식감을 느낄 수 있다\n- 생크림이 들어간 빵은 향기가 메론 같고, 생크림의 질감이 특별하다는 평가를 받는다\n- 일본의 음식 문화를 이해하기 위해 일본어로 스케줄 안내를 찍었으나, 부족한 부분이 있어 다시 시도할 필요성이 있다\n- 면의 **식감**은 특히 훌륭하며, 여러 번 먹을 시 더욱 기분이 좋게 만든다고 주장한다\n- 다양한 음식 경험이 있음을 언급하며, 이로 인해 즐거움이 배가된다고 설명한다\n# 🍽️ 도쿄에서의 맛있는 체험\n- 생수에서 **라벤더 향**이 나는 느낌을 언급하였고, 이는 특별한 체험으로서 기억된다\n- 1년 동안 맛있게 먹었던 경험이 있다\n- 부패에 대한 의지가 있으며, **한 군데만 바뀌는** 실험도 있어 나타나는 경향이 있다\n# 🎶 음악과 분위기\n- 음악이 배경으로 흐르며, **고독한 대식가**의 분위기를 형성한다.	곽튜브	49tjroGV8nk	2	[0.16004515,-0.08733362,0.14225394,-0.081433415,-0.16851228,0.80114454,-0.64673996,0.5276227,-0.97302103,0.24828024,0.29592156,0.67637265,-0.17281547,0.012259122,-0.074190095,0.066233665,0.41147965,-0.08910307,0.5918713,0.04391148,0.49925402,-0.31544012,0.14642423,-0.35442984,0.10356712,-0.7435467,0.23682,0.3747972,0.22653723,0.09913516,-0.4429916,-0.06477223,-0.017139783,0.031951044,0.04422106,0.28729957,-0.3989138,-0.23875836,-0.3509412,0.67374456,-0.022416765,0.060149595,0.08857939,-0.041225508,0.16270903,0.11408316,0.18482894,-0.06700423,-0.37459853,0.055396657,-0.43630058,-0.08468433,0.090325296,-0.1470927,0.19746347,0.24113856,-0.11492085,0.29734594,0.2927431,-0.43059105,0.034870245,-0.25609633,0.30555412,-0.33292726,-0.07185219,0.981901,-0.20265111,0.41598874,0.37084034,0.3768158,0.013502208,0.09798852,0.47732398,0.28940424,-0.0611782,-0.21699531,0.07577528,-0.053