a11028f6-ba16-48b5-a9aa-e394c21b4984	f7754c6f-c831-4a8f-8e90-4943dccfafc0	2	SMXZuSlUSduVR2mAiNIlWjOM9T2lv7O8c2rO2lh9wC4	7	‘굿데이’ 김태호 PD “‘무한도전’ 마지막 기자회견 장소 겹쳐, 삶의 중요한 포인트” < 연예 < 문화 < 기사본문 - 싱글리스트	# 김태호 PD의 새로운 프로그램 '굿데이' 론칭 소감\n- '무한도전' 마지막 기자회견 장소에서 진행된 제작발표회에 참석하여, 이곳이 삶에서 중요한 포인트였다고 언급.\n- 지드래곤과 함께 콘텐츠를 제작하며 많은 분들이 지켜봐주셔서 기뻐하고, 새로운 인물들과 만남을 통해 노래하는 내용으로 프로그램을 진행할 예정이라고 설명.\n- '굿데이'는 2월 16일 밤 9시 10분 첫 방송될 예정.	김태호 PD는 '무한도전' 마지막 기자회견 장소에서 '굿데이' 제작발표회를 진행하고, 지드래곤과 함께 노래 중심의 프로그램을 만들 계획임을 밝혔다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/4a1788d0-8d7d-47d4-ad05-b3f00ff500cc.jpg	9	[0.0033396268,-0.25760037,-0.05267316,0.048298076,0.7199562,-0.08017296,-0.03891681,0.351562,-0.24657747,0.4657364,0.016651105,0.2774066,-0.14533114,-0.18949811,-0.08455542,0.3610581,0.1387479,0.6179002,0.6372126,-0.4996033,-0.19968963,0.21946251,0.66082907,-0.65166485,-0.31215718,0.08534097,-0.11810352,-0.112728015,-0.39522904,-0.110356964,-0.04260022,0.14676555,-0.53945035,0.02199433,0.11692,0.17797308,-0.41634756,-0.28614905,-0.34099,0.67217875,-0.41996807,0.02159477,-0.11483463,-0.059278388,-0.20567039,0.055039708,-0.54623806,-0.0779688,-0.12407295,0.48620465,-0.22056058,0.2254443,0.0023850352,0.43067363,0.03319192,-0.5312731,0.38369167,-0.22942728,0.16495356,-0.23832764,0.18517877,-0.87566435,0.1180719,0.2721397,0.098997764,0.120751105,0.24513565,0.099313095,0.42112258,-0.33409068,0.7516459,0.4266217,0.8366106,-0.63034815,-0.3462007,0.018403402,0.2314817,-0.27759603,0.42285818,0.37517363,-0.78991187,0.44897908,-0.35945088,0.36961207,0.0018036017,-0.41899696,0.46827596,-0.30804068,-0.6656329,0.7768176,-0.2651315,-0.3136273,-0.2004917,-0.6020571,0.2510031,-0.3511205,-0.18422878,0.33247203,0.2423565,-0.114192866,-0.14278191,0.37312424,-0.6169294,0.7454411,0.23013626,-0.39564398,-0.31627604,0.29989737,0.17135984,-0.69742614,-0.20314214,-0.60220754,-0.16518177,0.031871695,0.31056333,0.4411468,0.11756156,-0.060319297,-0.2643858,0.058048956,0.25913465,0.22468497,-0.199913