d65f1ba9-e8db-4cbc-b7c3-260ebefbab4c	7acbc363-1dbe-4aec-8a0d-5b935e0deb05	1	zvnn6ZfvHFJtwFc2ZBrGYa6q39NsMpEZute1eG0TP1Y	4	대만 여행 브이로그 | 대만 경비 🇹🇼 | 대만 3박 4일 여행 | 가성비 해외여행지 | 22만원 환전 후회 🤦‍♀️	# 🏨 호텔과 초기 인상\n- 호텔은 **청량한 분위기**를 풍기며 음악이 흐르고 있다\n- 시설 사용에 한계가 있어 아쉬움을 느끼고 있다\n- 화장실은 깔끔하지만 도어가 모두 유리로 되어있다\n- 호텔의 제공_item이 그대로 유지되는 상황도 있고, 후추의 준비가 특히 많다\n# 🍧 대만의 맛있는 간식과 깨끗한 화장실\n- **우유 빙수**를 시식하며 그 차가움을 느끼는 장면이 있다.\n- 화장실은 전반적으로 **깨끗하다**는 언급이 세 번 이상 나오며, 유용한 정보로 제시된다.\n- **치킨**이 매우 맛있다고 언급되며, 아침식사로 추천한다.\n- 아침식사를 주문하고 음식이 **녹아내리는** 모습이 표현된다.\n- 음식의 조리 방법이 제시되며, 특정 재료를 넣는 과정이 소개된다.\n# 🍽️ 대만의 다양한 먹거리 경험\n- 참가자들은 다양한 음식을 **경험하고** 있으며, 특히 먹어보라는 제안이 존재한다.\n- 특정 장소에서 졸린 느낌을 **언급**하고, 방문할 장소를 고민하는 모습이 나타난다.\n- Rams이의 **목걸이를** 훔쳐온 상황이 언급되며, 흥미로운 에피소드가 포함되어 있다.\n- 영상 내내 다양한 대화가 오가며, 그들의 감정과 상황이 자연스럽게 **드러난다**.\n- "여기는 빠질 수가 없어"라는 표현으로 인해 특정 장소의 **중요성이 강조**된다.\n# 🍽️ 대만 음식 체험\n- 대만의 음식은 **뜨겁고** 맛있으며, 우유 맛의 조화가 느껴진다\n- 두부에 대한 반응이 긍정적이며, 음식이 금방 넘어간다는 점이 언급된다\n- 오늘의 옷차림이 이전보다 좋다고 평가되며, **최신식** 스타일을 반영하고 있다\n- 음식을 비비라는 제안이 있어, 더 맛있게 즐기라는 의미가 포함되어 있다\n# 🍴 대만의 음식 경험\n- 대만 여행 중 **초콜릿**을 먹어보면서 어떤 자리에 앉아 먹을지 고민하고 있다.\n- 영상 촬영을 하면서 음식의 **맛**을 표현해 주어야 할지를 고민한다.\n- 대만의 초콜릿 가격이 **150원**이며, 식빵 가격도 같은 수준임을 언급한다.\n- 식당과 같은 다양한 먹을 곳이 제공되어 있음을 확인한다.\n- 매주 일요일에 새로운 영상이 **업로드**된다고 공지된다.	돌파는 낙수	Menrrt3wldw	1	[-0.350456,0.17335758,-0.90492046,-0.013831452,0.0059994864,0.25897422,0.44104946,-0.25701064,0.30327356,0.2951799,-0.18219793,0.22666106,-0.039185777,-0.19763745,0.35565948,0.37213898,0.043149587,0.013400469,-0.12930855,-0.17667958,-0.08301696,0.28471854,0.3065274,0.15146205,0.2456789,0.062108234,-0.06269743,0.4334166,0.12871261,-0.033916578,0.5293436,0.14107367,-0.31725287,-0.04574556,0.042022392,0.045850914,-0.41263932,-0.39393735,-0.21053489,-0.34995878,-0.109411806,0.15160152,-0.078774035,-0.3186531,0.12158841,-0.28415567,0.26928726,0.09485821,-0.36932272,0.0009639445,0.020215094,-0.28896868,-0.13724779,0.23679721,0.1822814,-0.10876089,0.025005762,0.123944275,0.14874633,-0.2797888,0.05678138,-0.347199