2cc61972-825c-48d8-ba7a-b946885a8423	5f69e8d3-0043-4caf-bbe2-7c0a13eb4b30	2	4-duJeaCiCBYftgcMWvD9g0YW_kAaOQG3vPzGMzOe6k	3	경주여행 2박3일 일정 첨성대 대릉원 석굴암 천년숲공원 11월 국내여행 가볼만한 곳 : 네이버 블로그	# 경주 여행\n- 2024년 11월 경주 여행 일정과 추천 장소를 소개합니다.\n- 불국사, 석굴암, 대릉원 등 문화재 입장료가 무료로 변경되어 편리해졌습니다.\n- 불국사는 단풍 명소이며, 분황사와 황룡사지 역시 신라의 역사적 분위기를 즐길 수 있습니다.\n- 대릉원과 첨성대, 동궁과 월지는 필수 방문 장소입니다. 경주박물관은 시간이 부족하여 방문하지 못했습니다.\n- 황리단길 맛집 소옥, 고도커피, 교리김밥 본점 등 현지 음식을 즐길 수 있습니다.\n- 서후스테이와 고요스테이는 한옥펜션으로 편안한 숙박 경험을 할 수 있습니다.\n- 경북천년숲공원은 통일전과 가까워 함께 방문하기 좋습니다. 경주 먹거리로는 황남빵, 최영화빵, 단석가 찰보리빵이 추천됩니다.	불국사와 석굴암 등 문화재 입장료 무료 변경, 대릉원과 첨성대 등 필수 방문 장소를 즐길 수 있습니다. 현지 음식으로는 소옥과 고도커피가 인기입니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/6c76711e-3806-465d-9e43-de599c3b23b6.jpg	0	[0.15296796,-0.0384827,0.035603873,-0.20634621,0.6457367,-0.304797,-0.40551245,0.1328311,0.0870413,0.22535892,-0.11507283,-0.23434706,-0.2151526,-0.36183506,0.10837528,0.3769743,0.42527416,-0.32122493,0.042851515,-0.61248577,-0.23638076,-0.082136944,-0.17850824,0.08451169,0.22635052,-0.47796637,0.1415137,0.19375956,0.028225435,0.5546576,0.25657508,-0.06380578,-0.010388672,0.18496548,-0.02769603,-0.26571804,-0.28852335,-0.25672457,0.036636315,0.7623048,-0.2604187,-0.10339786,-0.19152702,-0.1320028,0.22169207,0.28328177,0.04039075,0.107760936,-0.45699465,-0.060778446,-0.037889764,-0.40574723,-0.5579262,0.04378438,-0.14549364,0.07937488,0.11108412,-0.63294816,-0.0771001,-0.31421822,0.24250126,0.08615898,-0.45352632,-0.16372487,-0.2434972,0.35308516,-0.15865014,0.3199865,-0.09178881,-0.27516025,0.10901585,-0.092950284,0.25114673,0.18776742,0.34993267,-0.13332447,0.0075770263,-0.19039235,0.3484307,0.5470507,-0.2893861,0.05466969,-0.057017732,0.7398709,0.25688517,-0.18879986,-0.21341911,-0.13238043,0.21168181,-0.86360383,-0.022237398,-0.2449952,-0.5802716,0.0049084364,0.49360126,0.4635,-0.6107285,-0.30990008,0.329817,0.24287033,0.45464614,0.3462394,-0.028309392,0.55382186,0.21492964,-0.122198574,0.18972017,0.003461394,0.30670917,-0.290484,0