1db852e6-8688-48f6-ada2-f5e9e898884e	b987706d-3f19-42c7-be0c-6c525ce591cc	1	eRfdKmp-_jFINRUoVyQ9LUIm283GtX7Pt_hPcMrYF4g	3	방콕 풀코스, 동남아 안 가본 곽튜브와 함께 【방콕】	# ✈️ 방콕 여행 준비와 기대\n- 방콕을 좋아하는 여행자들이 친구와 함께 2박 3일 계획으로 태국을 방문하기로 했다\n- 비행기를 예약했고, 비즈니스 클래스 경험을 하게 되며 기분이 좋다\n- 방콕에서는 마사지를 받고 편안하게 시간을 보낼 계획으로, 특별한 여행 계획 없이 여유롭게 즐기기를 원한다\n# 🍜 방콕에서의 음식과 여행 계획\n- 방콕에서 다양한 음식을 먹어보는 것이 기대되며, 선택지가 많아 **아쉬움**을 느낀다\n- 여행 중에 **밤에 비가 오고**, 화려한 분위기를 느끼는 것에 대한 **기대감**을 표현한다\n- **끈적국수**라는 음식이 유명하다는 이야기가 있으며, 이는 태국 여행에서 많은 크리에이터들에 의해 **추천**된다\n- 카오산로드에서의 경험이 처음 방문할 때는 실망스러웠으나, 낮에 보니 **흥미로운 모습**이 많다고 언급한다\n- 오뎅국수와 같은 전통적인 음식에 대한 **이야기**가 오가며, **국물의 맛**에 대한 기대감을 드러낸다\n# 🌆 방콕에서의 경험: 음식과 여행의 즐거움\n- 방콕에서는 낮보다는 밤에 더 재미있고, 그래서 낮에는 구경하기로 결정한 것이다\n- 유명한 후식으로 **땡모반**을 선택했으며, 기분을 내기 위해 술도 마신다고 언급했다\n- 땡모반의 맛은 특별히 맛있으며, 그 전설적인 맛은 특이하지 않다고 설명했다\n- 툭툭은 예전보다 적어졌지만, 외부의 환경을 느끼는 것이 좋은 점이라고 이야기했다\n- 마사지 경험에 대한 언급이 있으며, 태국에서 받은 마사지가 상당히 실망스러웠다고 언급했다\n# 🍜 방콕의 특별한 음식 경험\n- 최악의 마사지는 받는 사람이 **미안해**지는 경우라고 주장한다\n- 방콕의 유명한 야시장에서 **새로운 장소**를 발견하였다고 전한다\n- 예상과 달리 시설이 낡지 않았고, 음식도 다양하다고 강조한다\n- 음식의 맛을 평가하며, 일부 메뉴는 **간식으로 괜찮다**고 언급한다\n- 파인애플과 피자 가격이 **저렴하다는** 사실을 언급하며 긍정적인 반응을 보인다\n# 🍜 방콕 음식과 경험 총정리\n- 태국에서의 마지막 마사지를 받으며 여행을 마무리하려던 중, **태국인들이 생각하는 한국인의 이미지**를 언급했다\n- 다양한 음식들을 경험했으며, 특히 **바질과 돼지고기**가 매운 고추와 함께 섞인 요리가 맛있었다고 강조했다\n- 특히 **해방촌에서 먹어본 미슐랭 샐러드**와 비교할 때, 방콕의 고급 음식들도 매우 맛있다고 언급되었다\n- 방콕 여행 후 느낌은, **주말에 짧은 시간 동안 많은 것을 즐길 수 있었다**는 긍정적인 경험으로 표현되었다\n- 다음 여행에서는 **더 많은 곳을 방문하고 경험할 계획**임을 밝혔다	빠니보틀 Pani Bottle	F2utz6L76D0	1	[0.083648086,0.11403789,-0.3954104,0.021493753,-0.13063134,0.56847286,-0.39804202,0.15718666,-0.006974703,-0.26415125,-0.2423392,0.7097,0.20698494,0.31125987,0.14798233,-0.27003708,0.22178808,0.4850307,-0.016298829,-0.24259797,0.34728527,0.09365095,-0.2892411,-0.2835062,-0.22843444,-0.61461246,0.44677138,0.34735644,-0.05254522,0.070804745,-0.4306916,-0.42323753,0.06407712,-0.31634548,0.20855428,0.48289272,-0.22743943,0.023572035,-0.13783067,-0.10463474,-0.8415967,0.73086727,0.37930092,-0.1150011,0.033786286,