XAMmX8lGQ0CpftLsmewX0kRr6zcqTXVWdR-KCyI8jqQ	https://m.youtube.com/watch?v=ROub-Mr7ZoA&si=oGok9hbFFV5p4ueZ	1	2	땀 뚝뚝 40분 체지방 태우는 파워요가 | 살빠지는 스트레칭, 다이어트 요가, 전신 근력운동	# 🌟 파워 빈야사 요가 워밍업 및 수리아 나마스카라 B\n- **파워 빈야사 요가**를 통해 더욱 집중하며 체지방을 태우는 준비 단계를 시작한다\n- 손목과 손의 스트레칭을 통해 전신 준비 운동을 하고, **다운독** 자세로 본격적인 동작에 들어간다\n- **수리아 나마스카라 B**를 세 번 반복하여 전신 근력을 강화하며, 다양한 자세를 통해 유연성과 지구력을 기른다\n- 워리어 원, **하이플랭크**, 차투랑가, **업독** 그리고 **코브라** 자세를 통해 모든 근육을 동원하여 운동의 효과를 극대화한다\n- 자세 변화를 통해 체중을 분배하고, 정렬을 유지하면서 호흡과 집중력을 강화해 나간다\n# 🧘‍♀️ 체지방 태우는 파워요가 동작 설명\n- 왼 무릎을 접고 하이플랭크 자세를 취해 호흡을 진행하며 차투랑가, 업독(코브라), 다운독 자세를 반복한다.\n- 호흡을 다섯 번 진행한 후, 시선은 손 사이에 두고 다리를 앞으로 이동해 **척추를 길게** 뻗는다.\n- 체어포즈에서 발꿈치를 높이 들어 올리고, 몸을 오른쪽으로 비틀어 왼팔을 오른 무릎에 걸며 최대한 비틀어 본다.\n- 워리어 원 자세에서 몸을 앞으로 기울이면서 발을 바닥으로 **꾹 누르며** 호흡을 진행한다.\n- 다운독 자세에서 척추와 다리를 길게 뻗고, 차일드 포즈로 잠시 휴식을 취하면서 다시 다운독으로 돌아온다.\n# 🧘‍♀️ 파워 요가 동작 안내\n- **숨을 깊게 마시고 내쉬며** 다양한 자세로 몸의 긴장을 풀고, 체중을 바닥에 잘 누르는 것이 중요하다\n- 오른쪽과 왼쪽 엉덩이를 뒤로 빼며 **상체를 숙이고** 양손을 바닥에 놓고 몸을 비틀어주는 동작이 강조된다\n- **하이플랭크 자세**를 취하며 차투랑가, 업독 또는 코브라 자세로 연결해 복부에 힘을 주는 것이 필요하다\n- 오른손과 왼손으로 각각 반대 어깨를 터치하며 **균형과 힘**을 유지하도록 한다\n- **코브라 자세**를 통해 상체를 올리고, 느낌을 확인하며 반복적으로 움직여 팔과 등의 힘을 강화하는 것이 핵심이다\n# 🧘‍♀️ 파워 요가 동작 요약\n- **가슴을 활짝 열고 팔을 펴는 동작**으로 시작하며, 어깨를 내려 호흡에 집중하는 것이 중요하다.\n- **하이 플랭크와 다운독 자세**를 반복하며 코브라 자세로 상체를 늘리고 복부와 하체를 조절한다.\n- **트위스트 하이 런지와 트위스트 체어** 자세를 통해 코어 근육을 강화하고 몸을 비트는 동작을 수행한다.\n- **무릎을 가슴으로 끌어 올리는 반복 동작**을 통해 팔과 어깨에 자극을 주며 복부 힘을 유지한다.\n- 마지막 5초 동안 속도를 높여 **빠른 다운독 동작**으로 마무리하며 활동을 정리한다.\n# 🧘‍♀️ 요가 동작과 호흡 기술\n- **차일드 포즈**에서 무릎, 바닥, 엉덩이, 발꿈치로 체중을 지탱하며 심호흡을 통해 긴장을 완화하는 동작으로 시작한다\n- **브릿지 자세**에서는 무릎을 접고 팔꿈치로 바닥을 밀어내며 가슴을 들어 올리는 자세가 중요하며, 이때 엉덩이를 몸통 쪽으로 이동시켜야 한다\n- 오른다리와 왼다리를 하늘 높이 들어 올리는 동작은 골반을 높이며 발끝까지 **에너지를 유지**하는 데 집중해야 한다\n- **쟁기 자세**와 **해피 베이비 자세**에서는 허리를 잘 받치고 목에 무리가 가지 않도록 주의해야 하며, 몸의 긴장을 풀고 호흡을 깊게 이어가는 것이 중요하다\n- 마지막으로 **트위스트 자세**를 통해 허리와 엉덩이의 긴장을 풀며 마무리하며, 몸을 편안하게 휴식 상태로 가져가는 것이 좋다	에일린 mind yoga	ROub-Mr7ZoA	[-0.36563888,-0.0323854,-0.07707144,0.4630689,0.083442286,0.35270083,0.08308077,0.6266769,-0.34924