uTyMjHV2xOVi6U_iWiVPIjH0E9OFtL44CNp4nZ8jaPM	https://m.youtube.com/watch?v=7YRWo1lFUtQ&pp=ygUT7Kex6rWs64qUIOuqu-unkOugpA%3D%3D	1	4	짱구는 못말려 10기 한밤중에 이상한 요리를 만들어요	# 🍳 한밤중의 특이한 요리 상황\n- 샐러리맨은 다음 아침 회의 때문에 잠을 자지 못하고 있으며, 원룸에서 다섯 명이 함께 살아 돈을 벌어야 하는 현실을 반영하고 있다.\n- 야근으로 지친 짱구는 잠들었고, 아버지는 짱구를 깨워 함께 자길 원하고 있다.\n# 🍜 요리 실험과 감상\n- 짱구는 **우유에 간장을 뿌리는** 실험을 하며 그 맛에 대해 잠시 생각한다.\n- 부대찌개에 간장을 넣으면 **성게 맛**이 난다는 이야기가 언급되며, 짱구는 이 조합에 대해 호기심을 보인다.\n- 짱구는 집의 상태를 언급하며 느끼는 변화에 대해 이야기한다.\n- 목표와 월급에 대한 언급이 있으며, 짱구는 **열심히 일하는 것**의 의미를 되새긴다.\n- 짱구는 요리 도구가 부족하다고 언급하며 **포크가 없는 상황**을 설명한다.\n# 🍽️ 새로운 요리의 도전\n- 청국장 소스를 뿌린 **감자칩**은 청국장 냄새가 강하게 난다\n- 다양한 재료를 시도하며 새로운 맛을 더하는 것이 중요하다\n- 청국장에 **요거트**를 넣는 것은 두 발효식품의 궁합이 잘 맞기 때문이다\n- 남들이 하지 않는 요리를 시도하는 것이 도전의 의미로 강조된다\n- 새로운 조합으로 예를 들어 **설탕**을 넣거나 다른 재료를 추가해 보자는 제안이 있다\n# 🍽️ 이상한 요리 과정\n- **스테이크 소스**와 **소금**을 뿌려 간을 맞추고, 잘 저어서 혼합한다.\n- 마지막으로 **감자칩**을 솔솔 뿌린다.\n- 요리가 **완성**되었다고 강조하며, 이를 **구글 지식**이라고 언급한다.\n- 요리에 대한 자신감이 드러나고, 유용한 맛임을 언급한다.\n- 요리 결과에 대해 궁금증을 자아내며 반응이 더욱 호기심을 유발한다.\n# 🍽️ 이상한 요리의 재미와 경험\n- 다양한 요리 조합을 시도하는 것이 **재미있다**. 예를 들어, 오이 된장, 코코넛 짜장, 요구르트 김치 등을 혼합하여 즐겨 보는 것이 제안된다\n- 다이어트 중에도 **김치 무침**의 맛을 감안해 좀 더 신김치를 추가할 필요가 있다고 언급된다\n- 요리를 하던 중, 매운 맛을 **설탕**으로 조절하는 방식으로 실험이 이루어진다\n- 어젯밤의 요리 과정에서 발생한 혼란스러운 상황을 반추하며, 그 경험이 재밌게 회상된다	신짱구	7YRWo1lFUtQ	[-0.40636706,0.031317547,0.12340142,-0.056322053,0.21250872,0.05713547,-0.1206835,0.033918384,-0.20141299,-0.54047745,-0.69580746,0.4012077,0.24371229,-0.20837538,0.26383197,-0.19985044,0.00694484,0.2554646,0.15678945,-0.31531307,-0.14918241,-0.27233785,0.38241944,-0.038638882,0.10904639,0.053957846,0.2218771,0.2468811,-0.16813698,0.13029104,0.57978725,-0.3263284,-0.099847674,0.16196606,-0.10211539,0.06471662,-0.43835056,-0.28236455,-0.3663376,-0.4162652,-0.737273,0.26935363,0.087593906,0.11700024,-0.2830101,-0.27610472,-0.3255508,0.10655004,-0.49264172,-0.20164174,-0.007605216,-0.18486117,0.32859647,0.14820033,0.20902741,-0.055506855,-0.1341123,-0.1667678,-0.31804082,0.15456381,-0.29312032,0.0060787788,-0.4606146