rT36NhjZyOq7ClMjOvi8kgHGRiPr7K3KfaEOMTP1nE4	https://ggsd.tistory.com/m/154	2	2	스위치온 다이어트 식단, 후기	# 스위치온 다이어트의 개념\n- 체지방은 빼고 근육량을 늘리는 다이어트 방법입니다.\n- 건강한 식습관 형성에 초점을 맞추며 지속 가능한 생활 습관을 목표로 합니다.\n# 식단\n- 저탄수화물, 고단백, 고섬유질 식단으로 설계되었습니다.\n- 초기 2주 동안 저탄수화물 + 고단백 + 고섬유질 식단을 유지해야 합니다.\n- 단백질 쉐이크를 통해 일일 단백질 섭취량을 채울 수 있습니다.\n# 스위치온 다이어트의 단계\n- 초기 2주: 체지방 태우기 모드, 저탄수화물 + 고단백 + 고섬유질 식단을 유지합니다.\n- 지속 모드: 건강한 탄수화물을 추가할 수 있습니다.\n# 장점\n- 빠른 체지방 감량 효과가 있습니다.\n- 식단이 단순하고 직관적이라 실천하기 쉬워요.\n- 포만감 유지로 배고픔을 덜 느낍니다.\n- 요요가 오는 단기 다이어트가 아니므로, 다이어트 종료 후에도 유지하기 쉽습니다.\n# 단점\n- 초반 적응기가 힘들 수 있습니다.\n- 사회생활 시 외식 메뉴 선택이 제한될 수 있습니다.\n- 유지 단계에서 다시 살이 찌는 경우도 있을 수 있습니다.\n# 후기\n- 초반 2주 동안 눈에 띄는 체중 감소를 경험하는 사람들이 많습니다.\n- 단백질과 건강한 지방 덕분에 배고픔이 덜해요.\n# 실천 팁\n- 초반 3~5일은 힘들 수 있으니 충분한 수분 섭취가 필요합니다.\n- 단백질을 충분히 섭취해 공복감을 최소화하세요.	- 체지방 감소와 근육량 증가를 목표로 하는 저탄수화물, 고단백 식단의 다이어트 방법입니다.\n- 초기 2주 동안 빠른 체중 감소 후 지속 가능한 생활 습관을 유지할 수 있도록 설계되었습니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/28f86b94-4f12-40a2-915b-0570ac083d40.jpg	[0.12607834,0.04008256,0.08794681,0.28258103,0.19433041,0.0879474,0.28206426,0.14899224,-0.46211368,0.07130115,0.33874243,0.19982088,-0.1331656,0.3681478,-0.54700184,0.3979184,0.19958173,0.2084913,0.42086476,-0.36216104,0.4506871,-0.100010306,-0.18075976,-0.30856782,-0.24248862,-0.46268648,-0.4852817,0.019304402,-0.39642665,0.3613457,0.6634231,-0.36506575,0.3745163,-0.028072478,-0.11546925,0.34774005,0.2907477,-0.27142882,-0.31516188,0.45331496,-0.3379777,-0.018485542,0.63067806,0.35452652,-0.22842781,-0.85596657,-0.32120097,1.4844308,-0.30484772,0.28908253,-0.33013314,0.22708136,-0.26418,-0.032505855,0.19645667,-0.09569257,0.08601038,0.13934703,-0.6262141,-0.22536361,-0.46858415,-0.35755262,-0.38422513,-0.20610026,-0.17173243,0.2769476,-0.12092423,0.4363011,-0.17377767,0.28140777,0.45024455,0.21411279,0.18441597,0.26526424,0.5695479,-0.4487618,-0.042230364,-0.23661402,0.4992624,0.13963854,-0.6044462,0.1598871,0.088232905,-0.80322325,-0.12590013,-0.697875,-0.08551061,-0.22131169,