wM5ylD6aaL8ONqzqux3zNIsafXoKm2rAFVpkjolbhNg	https://together4enjoy.tistory.com/179	2	2	런데이 1주차 1일 : 위대한 첫 걸음, 러닝의 시작	# 러닝 준비물\n- 스마트워치, 러닝 암밴드, 러닝 벨트 등이 필요하다.\n- 운동화와 편한 옷도 필수적이다.\n# 러닝 앱 추천\n- 런데이(RunDay)는 달리기를 시작하는 사람들에게 적합하다.\n- 8주 동안 30분의 달리기를 할 수 있도록 도와준다.\n# 달리기 장소\n- 집 주변이나 트랙, 산책로, 공원 등 어디든 좋다.\n# 러닝 첫 도전\n- '30분 달리기 도전'은 초보 러너를 위한 훈련 프로그램이다.\n- 1일차에는 준비 걷기와 마무리 걷기가 5분씩, 천천히 달리기 1분에 천천히 걷기 2분이 1세트로 구성된다.\n# 러닝 앱 장점\n- 운동 시작 버튼을 누르면 실시간으로 달리고 걷는 타이밍을 알려준다.\n- 달리기를 하면서 도움이 되는 조언을 많이 해준다.\n# 러닝 벨트 후기\n- 허리에 맞춘 러닝 벨트는 휴대폰을 넣고 뛰어도 안정감 있게 러닝할 수 있도록 도와준다.\n# 러닝 첫날 후기\n- 달리기 첫 날 성취감이 상당했다.\n- 아침 달리기는 상쾌했고, 하루의 에너지를 공급해주는 듯하다.	러닝 앱 '런데이'는 8주 동안 초보자를 위한 달리기 훈련을 지원하며, 첫 날에는 준비 걷기와 달리기를 포함한 단계적 훈련이 진행된다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/426afb24-1373-4877-a046-555616bd0167.jpg	[0.11916536,-0.057079814,-0.2546466,-0.3283347,0.5723444,0.23279367,0.09273941,0.68888736,-0.0046991897,-0.082326464,0.04685082,0.27461216,-0.39161253,0.16566393,-0.42101216,0.09083079,0.22160542,-0.09563577,0.19798343,-0.3254987,0.24095857,0.46533912,-0.1380511,-0.17233041,0.054260515,-0.37105563,-0.626351,-0.06936161,-0.35968113,0.2780194,-0.32933164,-0.29390478,-0.15525988,0.105288655,-0.07535003,0.7045108,-0.0050767567,-0.00020008814,-0.16529223,0.3004582,-0.57393503,0.2579683,0.2870352,0.37280956,0.19122091,0.40358552,0.42525,0.58330667,-0.16168141,-0.07109478,-0.1410496,-0.2982235,-0.3506539,0.0068148463,0.28714886,0.090130225,0.35031933,-0.3283025,0.2083924,-0.12664565,0.08679441,-0.11853369,-0.056131165,-0.16723128,-0.4216984,-0.14930353,-0.021127354,0.038231954,-0.28328294,0.6002238,0.3090906,-0.028148364,-0.029358048,-0.52898145,0.29840314,0.05950336,-0.069915555,0.13367566,0.3574074,0.71026415,-0.64855826,-0.0012576347,0.32460663,0.10227014,0.40812802,-0.8764508,-0.4161299,-0.11570402,-0.15767707,0.0027429257,-0.068534106,0.021451341,0.0036395174,-0.3120812,0.500349,0.18593337,-0.15788308,-0.048719652,0.4115842,0.34808522,0.43502265,0.019392623,-0.91278