3h2yCz8-rumW2SdJPUozyqNLAMgO9xOFKsC_TEIA7H8	https://m.youtube.com/watch?v=TsoOlCjZCG0&pp=ygUT67mg64uI67O07YuAIOuztO2ZgA%3D%3D	1	3	3박4일 보홀 패키지 여행 가이드가 되다 【필리핀5】	# ✈️ 보홀 패키지 여행의 시작과 참가자 소개\n- 두마게티에서 보홀까지 배로 약 1시간 이동한다\n- 필리핀 여행의 이유는 **여기어때**와의 협업을 통한 버킷 리스트 체험이다\n- 참가자 모집은 **여기어때** 구독자 중 10명을 선정하여 진행되었으며, 지원자 수가 천명이 넘었다\n- 이번 여행은 필리핀의 아름다운 바다와 다이빙의 매력을 소개하기 위한 것이다\n- 참가자들은 나이와 배경이 다채로우며, 새로운 경험과 즐거움을 기대하고 있다\n# 🏝️ 보홀 패키지 여행 준비 과정\n- 버스가 새것으로 보이며, 스텝들이 일을 잘하는 모습을 나타낸다\n- 참가자들은 서로의 키와 사연을 나누며, 크루 내의 유대감을 형성하고 있다\n- 도착 후, 팀에 대한 환영 선물로 다양한 여행 용품이 배포된다\n- 참가자들은 닉네임을 사용하며, 간단한 자기소개 자리를 마련한다\n- 첫 일정은 수영장에서 연습을 하며 물에 대한 공포를 해소하는 과정으로, 바다에 들어가기 전 중요한 절차임을 강조한다\n# 🌊 다이빙 및 바다 놀이 경험\n- 다이빙을 마치고 수중 훈련에서 **물 채우기**와 빼기를 연습했으며, 다소 힘든 경험이었음이 언급된다\n- 오후에는 바다에서 진행할 **수업**이 예정되어 있으며, 빠른 진행이 필요하다고 강조한다\n- **보물 찾기 게임**이 진행되며, 숨겨진 보물을 찾아야 하는 미션이 주어진다\n- 게임의 결과에 따라 팀의 점수가 평가되며, 경품이 제공된다\n- 개인적으로 몸 상태가 좋지 않아 잠시 **휴식을 취**하기로 결정하며, 이후 저녁에 다시 참여할 계획이다\n# 🏖️ 보홀 여행의 다양한 경험들\n- 여행 중 바다에서 **독성 바다뱀**을 발견했으며, 모든 사람들이 긴장한 분위기였다\n- 필리핀식 **오징어**와 꼬치를 맛보며, 음식의 맛이 어린이 취향이라는 평가가 있었다\n- 마지막 다이빙을 마치고 체력이 고갈되었지만 참여자들은 **파이팅**을 외치며 힘을 내었다\n- 다이빙 후 **술자리**에서 친구들과 함께 한잔하며 즐거운 시간을 보냈고, 다양한 **여행 계획**에 대한 언급이 있었다\n- 참가자들은 즐거운 여행 경험을 바탕으로 **질문**과 대화가 활발하게 이루어졌으며, 추억을 남기기 위한 사진을 가져오라고 했다\n# 🌊 보홀의 자연과 여행의 즐거움\n- 보홀은 **나무가 없는** 산호로 이루어진 지역으로, 산호가 자생의 양분이 되기 때문에 나무가 자라지 않는다\n- 이곳은 단순한 바닷가 외에도 다양한 **관광 자원**이 있으며, 특히 산과 바위가 어우러져 있다는 점이 매력적이다\n- 안경원숭이는 **작은 몸집**과 함께 큰 눈을 가진 특이한 원숭이로, 동물 관찰의 재미를 더한다\n- 여행 마지막 날, 여행자들은 **서로의 편지**를 작성하며 우정을 나누고 소중한 순간을 공유하는 시간을 가졌다\n- 여행 내내 추진 및 지원을 아끼지 않은 촬영팀과 관계자들에게 감사의 뜻을 전하며, 모두가 즐거운 시간을 보냈음을 강조했다	빠니보틀 Pani Bottle	TsoOlCjZCG0	[-0.17000385,-0.104674496,-0.22150204,0.40839642,0.062030375,0.16203353,0.038013898,0.3676563,0.3951215,0.1846588,0.05807098,0.30990535,-0.07119729,0.10400535,-0.06666164,0.18932635,0.20503739,0.0006731879,0.28351402,-0.038315296,0.15152799,0.13797149,-0.27795163,-0.29967573,-0.34903923,-0.23550463,-0.29507276,0.079245634,0.4596529,-0.110273935,-0.32740122,0.3213148,-