VI1MQ4tX1S50_6Bpm7vvMiMh3r8qBXkXLbHJAKHXm68	https://n.news.naver.com/article/346/0000087056?sid=103	3	2	“아침에 마시면 좋은 음료 ‘4가지’”… 전문가들 추천 뭔지 봤더니?	# 아침에 마시기 좋은 음료\n- 다양한 분야의 건강 전문가들이 아침에 먹기 좋은 음료를 소개했다.\n- 녹차는 염증 완화와 신체 이완을 촉진하며, 카테킨 성분이 체내 활성산소 제거와 심혈관질환 예방에 도움을 준다. 하지만 위가 좋지 않은 사람은 식사 후 마시는 것이 좋다.\n- 물은 체내 수분 보충과 노폐물 배출에 효과적이고, 아침 운동 전에는 미지근하거나 따뜻한 물을 마신다.\n- 허브티는 달콤함과 다양한 건강 효능이 있으며, 페퍼민트차와 로즈힙차가 대표적이다. 섭취 전 성분 확인은 필수다.\n- 커피는 집중력 높이고 장 건강에 도움을 주지만, 기상 직후 공복 상태에서는 위험하므로 1~2시간 후나 식사 후 마신다.	아침에 먹기 좋은 음료로는 녹차와 물이 추천되며, 커피는 식사 후 섭취하는 것이 좋습니다. 허브티의 경우 성분 확인 후 섭취해야 합니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/d7aadec6-4130-4092-9b1c-860dc8aa803a.jpg	[-0.13852525,-0.4905266,0.11815739,0.76135623,0.07765122,0.13799438,-0.20503351,-0.038568437,-0.254959,0.11870709,-0.19742864,-0.1558678,0.2902329,-0.26225862,-0.109577514,-0.031333033,0.6401615,-0.60870695,-0.015847798,-0.34183973,-0.039716702,0.2688536,0.10764486,-0.354671,0.17246202,0.21561645,-0.4187976,0.09967685,-0.053059485,0.3060004,0.6634278,-0.45359728,0.10855262,-0.0702962,0.03737812,0.4462151,-0.20482779,-0.21836552,0.05917035,0.066429324,-0.30342293,0.14506829,0.12811652,0.31667775,0.09548576,-0.592385,-0.48145512,0.25878525,-0.46703142,-0.12073234,-0.47163785,-0.52552515,-0.23196596,0.5611559,0.2918691,-0.08222392,-0.98972106,-0.40091753,0.036347732,0.09597645,-0.36084566,0.006349198,0.08673194,-0.38220078,-0.37568206,0.105757974,-0.5619895,0.13794309,0.17169315,-0.0018123426,0.39677733,0.13057178,-0.062603846,0.4440173,-0.022614138,0.040485345,-0.5059301,-0.046641756,0.39251816,0.255147,-0.931819,-0.3678769,0.113824226,-0.73890287,0.43641573,-0.9779273,0.20468068,-0.32596803,-0.439971,-0.2781815,-0.23743924,-0.012539424,-0.19460899,-0.07801801,0.36000675,-0.0878585,-0.3585921,0.19559291,0.083809495,-0.038735818,0.351891,-0.38093895,-0.24569875,0.341635,-0.58713937,0.3369404,0.3087416,-0.42772466,0.33142984,-0.41867185,-0.20337643,-0.97029495,-0.02663635,0.68515444,0.027241698,-0.1267333