HZ8-QCAxCJsmBPrwXjCdrlxsU3d54fHRIs72FbP68LM	https://m.youtube.com/watch?v=UzH_L0wX5FE&pp=ygUM66y07ZWc64-E7KCE	1	9	[무도] 🎵바로 내가! 정 총무!🧑🏻‍💼 정신없이 매점 터는 멤버들과 전자두뇌 풀가동하는 정준하의 대결🥸 '정총무가 쏜다' 1편 MBC110108방송	# 🎭 현장 녹화 준비와 아이디어 논의\n- 급작스러운 변동 상황으로 인해 녹화 준비가 어려워졌고, 이에 대한 대체 아이디어가 필요하다.\n- 스튜디오 대체가 불가능하고, 연말 시상식으로 인해 일반적인 방송 환경이 조성되지 않고 있다.\n- '맨땅 헤딩' 특집으로 즉흥적인 녹화를 시작하자는 제안이 나오고, 참가자는 자유로운 형태로 활동할 예정이다.\n# 🎉 정총무의 기습 쇼핑 대작전\n- 정준하가 **재밌다**, **웃긴다**는 반응을 보이며 즐거운 분위기를 조성하고 있다\n- '내가 바로 정총무야!'라는 제목을 정하고, 정준하가 총무 역할을 맡아 진행한다\n- 정준하는 **기습 공격**처럼 물건을 사는 재미를 강조하며, 다양한 아이템을 구입하는 것을 목표로 한다\n- **정총무 패키지**를 통해 특별한 할인을 제공하고, 가격 범위를 설정하여 쇼핑을 관리한다\n- 만약 설정된 금액을 초과하면 정준하가 모든 비용을 부담하게 된다\n# 🎭 정총무 대결의 준비 과정\n- 정총무는 80만 원을 목표로 하는 한 판 대결을 준비하고 있으며, 현재 금액은 76만 원이다\n- 대결을 위한 의상으로 고전 사극 복장, 주판, 빨간 타이 등을 고려하고 있다\n- 재밌는 요소를 추가하기 위해 특색 있는 의상과 함께 멜빵, 팔토시 착용을 계획 중이다\n- 형의 표정이 웃음을 줄 것이라는 아이디어도 제안되었으며, 얼굴 표현이 재미를 더할 것으로 보인다\n- 최종적으로 금액 범위를 마이너스 5%와 플러스 5%로 설정하기로 결정했다\n# 🧑🏻‍💼 정준하의 고민과 선택\n- 프로그램 진행에 대한 **불안감**이 표현되고 있으며, MC의 역할이 흔들리고 있는 상황이다\n- 형의 마음에 따라 진행 여부를 결정할 수 있다는 점이 강조되고 있다\n- 롤러코스터와 같은 시청자 기대감이 존재하지만, 그에 따른 부담감도 느껴진다\n- 다음 컷에서 잘 진행되면 정상으로 보일 것이지만, 실패하면 문제가 발생할 것으로 보인다\n- 현재 상황이 어떤 방향으로 흘러갈지에 대한 **불확실성**이 언급되고 있다\n# 🎯 정총무의 작전과 위기 관리\n- **정총무의 위기일발 작전**이 시작되었으며, 이는 D-day와 동일한 중요성을 가진다\n- 박명수 씨의 한마디에서 **이 위기일발 특집**이 마련되었다는 점이 강조된다\n- 참가자들은 출발 전 **워밍업**을 하기로 하였고, 매점으로 향하는 목표를 세웠다\n- 지갑을 갖고 온 정총무는 자원을 확보한 상태로 간단한 **작전 준비**를 마쳤다고 언급했다\n- 매점에서 신속하고 정확한 작전을 통해 **경쟁자를 섬멸할 것**이라고 다짐하였다\n# 🏃‍♂️ 정총무의 첫 번째 연습 작전\n- 정준하는 **첫 번째 연습 작전**으로 멤버들이 자유롭게 의사소통할 수 있는 환경을 조성한다\n- 멤버들은 **구강청결제나 시약**과 같은 특정 물품에 대한 규정을 논의하며, 자유롭게 필요한 것들을 선택할 수 있음이 언급된다\n- 정준하는 멤버들에게 **양치**를 하거나 필요한 물건을 가져오기 위해 빠르게 움직일 것을 지시한다\n- 멤버들은 음료수나 간식 등 **비싼 것**을 요구하며, 필요한 물건이 없어 고민하는 모습이 나타난다\n- 긴박한 상황 속에서 시간이 얼마 남지 않음을 알리며, 멤버들은 **긴급 대피**를 준비해야 함을 강조한다\n# 🎉 정총무의 계산 대결\n- 정총무는 **화장실에 가는 상황**에서도 녹화 중임을 강조하며, 긴급하게 계산해야 한다고 알린다\n- 총무는 첫 번째 선택으로 **소다**를 선택하고 가격은 **8만 3천 원**이라고 발표한다\n- 계산 중 총액이 **6만 9백 원**에 이르며, 사용된 상품들의 가격이 점차 적립되기 시작한다\n- 정총무는 계산에서 **양말**을 포함한 상품을 정확히 챙기지 않아 혼선을 일으킨다\n- 결국 최종 청구 금액은 **7,850원**으로 확인되며, 정총무는 성공적으로 대결을 마무리한다\n# 🎭 정총무의 계산 대결\n- 정준하는 물건 가격을 **87,150원**으로 추정하고, 잘 맞추지 못해 당황한다\n- 정준하는 자영업 경험을 언급하며 계산의 어려움을 토로한다\n- 아쉬운 결과에 대해 자신이 화장실에 다녀온 것 때문이라고 이야기한다\n- 참가자들은 **더치페이** 방식으로 자기 물건을 선택하겠다고 한다\n- 정준하는 계산을 직접 하겠다고 하며 계산을 담당한다\n# 🎯 정총무의 도전과 성과\n- 매점을 20년 동안 운영한 사장님은 처음에 **7만 원**은 절대 안 된다고 주장했다.\n- 결과적으로, 정총무가 제시한 가격은 **400원** 틀렸다는 사실이 밝혀졌다.\n- 정총무가 쏜다는 선언 후, 그의 성과에 대한 인정이 있었다.\n- 정총무는 형님에게 거품을 닦고 오라고 요청하며, 즐거운 분위기를 연출했다.\n- 그는 "마음의 양식"을 강조하며 추가적인 요구를 하는 등 적극적인 모습이었다.	올끌 (All of MBClassic)	UzH_L0wX5FE	[-0.44494107,0.4442196,0.18637389,-0.5194512,0.25834376,-0.12737894,-0.15540852,0.4700104,-0.42421186,0.13422221,0.060804892,0.3616718,-0.38670057,0.048974574,0.06152568,-0.05348701,-0.4116758,0.36346275,0.43708828,0.25259548,0.41074574,0.7153315,0.20525599,0.13339657,0.0062732412,-0.2006914,0.25995043,0.21855736,-0.09699789,0.49789077,0.26786622,0.5001963,-0.43794283,0.53824687,0.17804998,0.3182954,-0.6431431,-0.1060776,-0.24252415,0.81820357,-0.6117836,0.4516995,-0.16675958,0.1353904,-0.09451559,0.19321164,-0.05232616,0.024121135,-0.44186485,0.33970913,-0.40712047,-0.35879368,0.217164,0.38510805,0.17081541,-0.0349074,0.23681638,-0.2938332,-0.22898608,0.18977432,0.004246358,-0.32916087,0.3729442,0.03367846,-0.1653389,0.31526017,-0.21515897,0.3750626,0.043782786,-0.015028066,0.47674847,0.06861782,0.75466275,-0.40145648,0.3190647,0.4237669,-0.21981043,0.031407617,0.26985645,0.6184373,-0.4134272,-0.4032509,-0.2407134,0.11481222,-0.089531034,0.008676485,-0.27090403,-0.38365817,-0.33451366,0.2882207,-0.040083446,-0.022167124,0.6215397,0.080255896,0.13556519,0.14937103,0.29866266,0.060913473,0.49225098,0.20971183,-0.07814969,0.55535513,-0.17583983,0.45422012,-0.14973822,-0.65509707,0.4521984,0.35816306,0.38792992,-0.052725248,0.2106607,-0.49428838,-0.2871632,0.39007652,-0.15819323,0.039837606,0.117079794,0.11450872,-0.29834962,0.38268396,-0.1183585,0.14947107,0.35938928,-0.030578468,-0.10965529,-0.187903