kPxguYFAzztmD-nby49vm6UzEPngxpiXJuLNN6_Z-Xo	https://m.youtube.com/watch?v=BcKus0Krm4o&pp=ygUT7Jes7ZaJIOu4jOydtOuhnOq3uA%3D%3D	1	3	🇦🇺일주일 연차 갈기고 떠난 호주 시드니 여행 vlog❤️| 호주 이렇게 좋아버리면 나보고 어뜩하라고⋯ | 프로계획러의 시드니 찐추천 맛집, 명소, 꿀팁 쌉P들은 이대로만 하실게💭	# 🌧️ 감정의 소용돌이\n- 사랑의 고통 속에서도 아름다움이 존재하며, 이별의 평화가 있음을 이야기한다.\n- 불안이 나를 변화시켰고, 모든 것이 변할 수 있음을 인식하게 되었다는 고백이 있다.\n- 자신이 원하는 것을 이룰 때까지 열심히 노력할 것이라는 결의를 표명하며, 비 오는 날을 맞이할 준비를 한다.\n# 🍽️ 시드니의 유명한 한식당 소개\n- 'Kampung'이라는 이름의 장소가 여러 번 언급되며, 이는 인기 있는 여행지로 알려져 있다\n- 이곳은 **아이스크림**을 즐길 수 있는 공간으로, **여행을 즐기는 분위기**가 조성되어 있다\n- 특정 장소는 **한국의 대중교통 시설**이 건설되었던 곳으로 언급된다\n- 다양한 **한식당**이 있어, 시드니 내에서 한식의 맛을 즐길 수 있는 곳으로 보인다\n- 이 장소들은 시드니에서 사람들이 많이 찾는 **유명한 명소**로 평가된다\n# 🌊 시드니 여행의 주요 활동 소개\n- 여행 중 가장 많이 언급된 활동은 **해변**에 가는 것이며, 이는 총 10회 반복되었다.\n- **공원 산책**도 주요 활동으로, 총 7회 언급되었다.\n- 여러 **상점**을 방문할 계획이 있으며, 이는 다수의 반복된 표현을 통해 강조되었다.\n- 여행 중 **밥을 많이 먹겠다**고 예고하였고, 이는 2회 언급되었다.\n- 아이스크림이 매우 **맛있어서** 사왔다고 언급하여, 음식에 대한 기대감을 표현하였다.\n- 한국의 유명한 **대중교통기구**와 **식당**이 여행지에서 소개되었는데, 이 역시 여러 차례 강조되어 지역적 특징을 드러냈다.\n# 🌊 시드니의 주요 활동\n- **공원 산책**을 자주 계획하고 있으며, 이 활동을 반복적으로 언급한다.\n- 여러 차례 **카페 방문**에 대한 언급이 있으며, 다양한 카페에 갈 예정임을 보여준다.\n- **해변 탐방**에 대한 계획이 많으며, 해변 활동이 핵심적인 일정을 차지하고 있는 것으로 보인다.\n- **식사 계획**으로 **밥**을 많이 먹겠다는 언급이 있다.\n- 콘텐츠 마지막에 시청자에 대한 **감사의 말**을 전한다.\n# 🍔 시드니 여행 중 식사 계획 및 장소 소개\n- 여행 중 **식사 계획**에 대해 여러 번 언급되고 있으며, 잦은 외식과 간편한 식사를 하기로 결정한 것으로 보인다.\n- 건강을 위해 **헬스장**을 가기로 하며, 운동을 반복적으로 강조하고 있다.\n- 슈퍼마켓에 가서 음식을 구매할 예정이며, 이와 관련된 내용이 지속적으로 설명된다.\n- 식사를 할 때 **치킨**을 시도할 계획이 있으며, 이를 여러 번 강조하여 맛에 대한 기대감을 나타내고 있다.\n- 여행 중 아름다운 **바다**를 언급하며 해변 방문도 계획하고 있는 것 같다.	시오 sio	BcKus0Krm4o	[-0.67130125,-0.34531102,-0.49879643,0.044895694,0.3392021,0.23754492,0.07336467,-0.02013148,0.27154976,-0.1324241,0.24019666,-0.08820616,-0.351883,0.014649964,0.19784313,0.05212292,-0.102005295,0.040510718,0.3548441,-0.2631415,0.23221372,0.071184516,0.33585384,-0.15311229,-0.02050907,-0.5202542,-0.07585527,0.02943085,0.20541072,-0.20624235,-0.016343033,-0.5687553,-0.38376117,-0.1668791,0.18118475,0.03340132,-0.52969