6Rm6RfVA6zEStW30vH2ubGM4p-TInm8aTEgyhpItB-g	https://generallylucky.tistory.com/m/754	2	7	#85. 무라카미 하루키: "실용적이어야만 한다."	# 무라카미 하루키의 인생과 작가로서의 길\n- 무라카미는 부모의 기대를 무시하고 재즈바를 열고 글을 쓰기 시작했다.\n- 1Q84는 3년 동안 쓴 장편 소설로, 히로인 아오마메가 주인공이다.\n- 무라카미는 매일 아침 일어나 글을 쓰고, 루틴을 통해 창작 활동에 임한다.\n- 그의 작품은 현실과 초현실주의를 혼합한 복잡한 구조를 가진다.\n# 무라카미의 작가로서의 성공\n- 1Q84는 출간 첫 달에 일본에서 백만부가 팔렸다.\n- 무라카미는 자신의 작품을 통해 일본 사회와 문화에 큰 영향을 미쳤다.\n# 무라카미의 창작 과정과 특징\n- 무라카미는 계획 없이 본능에 따라 글을 쓴다.\n- 그의 작품은 인위적인 부분들이 있지만, 그의 진지한 톤은 독자들에게 감동을 준다.\n# 무라카미의 개인 생활\n- 무라카미는 아내와 함께 재즈바를 운영했으며, 그녀가 첫 번째 독자였다.\n- 무라카미는 자신이 뭘 좋아하는지 알고 있다는 것이 자신감을 주었다.\n# 무라카미의 사회적 영향\n- 무라카미는 일본에서 지식인으로서 상당한 인기를 얻었고, 국가적 차원의 토론에 참여한다.\n- 그는 95년도 도쿄 지하철 사린 사건과 관련된 소설을 집필했다.\n# 무라카미의 미래와 현재\n- 무라카미는 자신의 성공에 대해 부모에게 행복했기를 바랐지만, 확신은 들지 않는다.\n- 그는 하와이의 러닝클럽에 가입하여 매일 달리고 글을 쓴다.	무라카미는 부모의 기대를 무시하고 글쓰기 시작했으며, 1Q84는 출간 첫 달에 백만부가 팔린 작품이다. 그의 작품은 현실과 초현실주의를 혼합한 복잡한 구조를 가진다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/9f886860-d91d-4f37-a8c2-48082146a09a.jpg	[-0.7251643,0.055230755,-0.0707456,0.264858,0.049447816,0.5908085,-0.05627703,0.16002518,-0.5908928,0.10682035,0.1786717,-0.14949948,-0.21258591,-0.60536736,0.023214418,0.47419846,0.19655116,-0.032835074,1.2550344,0.07154283,-0.532026,-0.0077058445,-0.12381678,-0.024302792,-0.32714805,0.20971444,0.25895804,-0.5421731,0.3140133,0.0055113574,-0.13871214,-0.2910161,-0.11012972,0.3208351,0.18177414,0.036339495,0.14573729,-0.91790295,0.4320115,0.20013659,-0.35217047,0.17182127,0.09886299,-0.1314471,-0.10605114,-0.45518184,0.6700337,0.22993073,-0.028166907,-0.016190663,-0.26229703,0.04322515,0.10308014,0.027561646,-0.033953752,-0.046733532,0.1740106,0.022579234,0.4795252,-0.07650922,-0.06006679,-0.39470592,-0.4291691,-0.04183461,-0.17962843,-0.15907088,-0.1741535,0.3477051,0.044793863,-0.18891843,0.10257007,-0.17409103,0.22973074,-0.47700167,-0.44204116,-0.22231962,-0.13720296,-0.46775526,0.9054281,0.1343959,-0.41358748,-0.3320784,0.48314577,-0.15996775,0.5390238,0.12994567,0.157123,0.