oaZeA789aeZghnR3YXyWz0xrgNOtgF5NUMYJYyrh39M	https://link.naver.com/bridge?url=https%3A%2F%2Fm.post.naver.com%2Fviewer%2FpostView.naver%3FvolumeNo%3D49544974%26memberNo%3D6132524%26vType%3DVERTICAL&dst=naversearchapp%3A%2F%2Finappbrowser%3Furl%3Dhttps%253A%252F%252Fm.post.naver.com%252Fviewer%252FpostView.naver%253FvolumeNo%253D49544974%2526memberNo%253D6132524%2526vType%253DVERTICAL%26version%3D10%26sourceReferer%3Dshare	2	9	"스케일이 다르네" 유재석의 '86억 펜트하우스' 브라이튼 N40 : 네이버 포스트	# 유재석의 86억 펜트하우스 매입\n- 유재석이 서울 강남구 논현동 '브라이튼 N40' 최고급 펜트하우스를 86억6570만 원에 매입했다.\n- 매입한 펜트하우스는 전용면적 199㎡형으로, 현금으로 구입했으며 등록 주소지 변경을 통해 실제 거주 중인 것으로 보인다.\n# 브라이튼 N40의 특징\n- '브라이튼 N40'은 교통·생활·학군이 우수한 고급 아파트 단지로, 5개 동에 걸쳐 총 148가구를 보유하고 있다.\n- 각 가구당 주차 공간이 2대 이상 제공되며, 강남 핵심 지역에 위치해 다양한 인프라를 쉽게 이용할 수 있다.\n- 우수한 교육 환경과 철저한 보안 시스템 덕분에 연예인 및 정·재계 인사들의 주거지로 각광받고 있다.	유재석이 86억6570만 원에 서울 강남구 논현동 '브라이튼 N40' 펜트하우스를 매입, 실제 거주 중인 것으로 보인다. 이 단지는 교통·생활·학군이 우수하며, 연예인 및 정·재계 인사들의 주거지로 알려져 있다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/65e9f81b-413c-4593-a3ef-45281b0a0bd1.jpg	[0.014653575,-0.05245569,0.43543378,-0.6484782,0.52996916,0.090176105,-0.33323753,0.2666415,-0.029246448,0.17071044,-0.18801928,-0.4416588,-0.29945746,-0.07624066,0.020871684,0.48394054,0.30568448,0.03528044,0.4679593,-0.38528204,0.10633696,0.26102817,0.21755047,-0.46529543,-0.3465317,0.4255845,0.29169357,-0.3978058,0.10335165,0.5050503,0.41065758,-0.07111964,-0.6549995,0.041882128,0.046474013,-0.16880023,-0.60522234,-0.09574281,-0.21158767,0.271783,-0.18998875,-0.19486263,-0.43386966,-0.05800985,0.3087725,-0.10228748,0.5760905,0.34076902,0.41233462,0.31108215,0.71004647,-0.5364957,-0.2909989,-0.14933702,-0.91270185,-0.5442585,0.4744849,-0.7253131,-0.4791832,-0.3068868,-0.038008433,-0.120910995,-0.6502459,0.33257967,-0.16078736,-0.3813492,0.25240088,0.37357634,-0.23209052,-0.43473646,-0.109174795,0.13908091,0.89131594,-0.14782281,0.31828272,0.07493889,0.36635107,2.128072e-05,0.71999043,0.29882094,-0.23818853,-0.18674155,-0.205