gDMDynDcOq-9TuMk2t1_NIQTsMvhRhBEtAVgQf4ovps	https://m.youtube.com/watch?v=OZO66FOKVNQ&pp=ygUM66y07ZWc64-E7KCE	1	9	[무한도전] 🎉경 존버당 축🎉 박명수 = 자칭 커피 마니아☕ 믹스부터 원두까지 장르를 가리지 않는 명수옹의 커피 사랑ㅋㅋㅋ | 무한도전⏱오분순삭 MBC061202방송	# ☕ 커피에 대한 열정\n- 박명수는 다양한 커피를 즐기며 자신만의 커피 사랑을 표현한다.\n- 대화 중 커피를 마시며 즐거운 분위기를 전달하고, 재미있는 상황을 연출한다.\n- 그는 주변 사람들에게 감사의 인사를 전하고, 함께하는 시간을 소중히 여기고 있다.\n# ☕ 박명수의 커피 주문과 혼잡한 상황\n- 현재 손님이 많지 않아, 유자차와 **율무** 등 음료를 준비하는 것이 좋다고 제안된다\n- 손님이 도착하자 밀크 커피를 주문하고, 잠시 기다리라는 안내가 이어진다\n- 커피 주문 중 손님이 돈을 넣지 않았다는 언급이 있으며, 주문 상황이 다소 혼란스럽게 진행된다\n- 참석한 인원이 수다를 떠는 사이, **빙상계의 거물**인 박명수 선생님에 대한 소개가 있다\n- 커피를 준비하는 도중 긴장감을 풀라는 조언이 나오며, 분위기를 밝히려는 시도가 있다\n# ☕ 박명수의 커피 사랑과 일상\n- 박명수는 아침에 양치질을 하지 않은 채 커피를 마시는 것에 대한 대화를 나누며 커피의 중요성을 언급한다\n- 방송 스케줄로 인해 멤버들이 약간씩 부상을 입었고, 평균 연령이 39세로 박명수가 가장 좋은 컨디션이라고 밝혔다\n- 박명수는 스켈레톤과 같은 **동계 올림픽 종목**에 대한 관심과 운동의 활성화를 바란다\n- 커피를 여러 종류로 주문하는 장면에서 박명수는 아메리카노, 카푸치노 등 다양한 커피를 언급하며 커피에 대한 애정을 드러낸다\n- 방송 중 박명수는 커피 맛에 대해 다른 출연자들과 이야기하며 커피에 대한 개인적인 경험을 공유하고 있다	오분순삭	OZO66FOKVNQ	[-0.5740489,0.19984251,0.1175105,0.13377869,0.2392794,0.2726192,-0.21165621,0.7256756,-0.24953184,0.33532912,-0.32613698,-0.096303225,-0.36140317,-0.034820706,0.54309005,0.05163504,0.045084495,-0.49875838,0.4789642,-0.06260811,-0.28142464,0.33143365,0.3694554,0.4057915,0.026142184,0.04954609,0.54930747,-0.0028549307,0.20574912,-0.13272278,0.3999936,0.5619825,-0.23422343,-0.06393788,-0.23916832,0.12349166,-0.32398552,-0.27891612,-0.47420424,-0.0631749,-0.364622,0.42151478,0.11340107,0.486358,0.086515054,-0.83857477,-0.050722912,-0.23237497,-0.57371914,-0.40036157,-0.29585665,-0.20967615,0.24069548,0.48363346,-0.08292904,0.3366281,0.15662456,-0.049752615,0.112243466,-0.062920466,0.25120968,-0.04385165,-0.025272038,0.3786868,0.0011072792,-0.07308026,-0.41230744,0.14625461,-0.10883235,0.12165245,0.15902963,0.5248855,0.36281705,-0.1453255,0.09844655,0.33953834,-0.5014096,-0.13305047,1.0137445,-0.089060195,-0.9150611,-0.6089679,-0.38032255,0.11756955,0.170862,-0.5014236,0.60439074,-0.1342215,-0.14578402,0.427