A4pPj_rZ5ETWcmL7Na6Nsm-35pZ_Ui0VG2sFXJsEURM	https://m.youtube.com/watch?v=a1UcEDu38p8&pp=ygUM66y07ZWc64-E7KCE	1	9	[무한도전] 이게 이렇게 이어진다고? ㅋㅋㅋ 씽크빅 좀 해본 무도 멤버들의 기상천외한 말장난 모음.zip | 무한도전⏱오분순삭 MBC061230방송	# 🎤 무한도전의 기상천외한 상상력\n- 무한도전 멤버들은 각자의 방식으로 상을 받고 싶다는 열망을 드러냈으며, 특히 '연구 대상'이라는 유머러스한 제안을 했다.\n- 대화 중 다양한 음식과 다이어트에 대한 언급이 있었고, 3D와 관련된 엉뚱한 발상도 나왔다.\n- 멤버들은 노래방 기기를 활용해 서로의 공연을 기대하며 유쾌한 분위기를 만들고 있었다.\n# 🎤 인터뷰와 기상천외한 대화\n- 인터뷰가 간단하게 진행되며, 사는 지역과 개인 소개가 이어진다.\n- 여의도에 거주하고 있으며, 전세 집의 평수에 대한 언급이 있어 79평이 아닌 **45평**이라고 정정된다.\n- 지역난방에 대한 언급도 있으며, 특정한 주거 형태인 "팬티하우스"가 아닌 "타운하우스"라는 표현이 등장한다.\n- 박 씨는 무한도전 방송에서 노래를 하게 되며, 글로벌한 아티스트들이 언급되면서 준비에 대한 이야기가 이어진다.\n- 박 씨는 요즘 비수기라며 행사 수가 적음을 언급하지만, 가을에는 행사가 많을 것이라고 기대감을 내비친다.\n# 😂 기발한 말장난과 유머\n- **박명수**는 "생일 축하합니다!"라며 유쾌하게 생일 파티를 진행하였다\n- "쌈밥"이라는 단어가 반복적으로 등장하며, 멤버들이 **쌈밥**을 먹겠다고 크게 외쳤다\n- 멤버들은 **명품 고무신**에 대해 joking으로 언급하며 재치 있는 대화를 나누었다\n- **절도범**이라는 표현이 사용되면서, 유머러스한 상황을 만들었다\n- 이상한 아이디어와 **다양한 음식**에 대한 발언이 잇따르며 분위기를 고조시켰다\n# 😂 기상천외한 말장난과 마늘 사랑\n- 대화 중 실크의 **흡수력**에 대한 질문이 오갔지만, 실크와 세탁에 대한 의견이 부족한 것으로 보인다\n- "실크 조크"와 관련된 발언으로, **입어봐야** 하는 것이라는 주장이 제기된다\n- 마늘에 대한 사랑을 언급하며, 대화의 갈등이나 방어적인 태도가 잘 드러난다\n- 마늘이 주제가 되어 여러 차례 반복 언급되며, "마늘짱"과 같은 표현이 등장한다\n- 대화 중 "그것은 **운명이었다**"라는 표현을 통해 마늘과의 관계를 운명적으로 강조하고 있다\n# 🎭 무도 멤버들의 유머와 감상 표현\n- 박선생이 유머러스한 표현을 사용하며 멤버들에게 장난치는 모습을 보이고 있다\n- 하와이 해변가의 **아름다움**을 강조하며 모험을 떠나는 분위기를 나타낸다\n- 패러글라이딩을 언급하며 현재 상황에 대한 **남다른 느낌**이 있다고 언급한다\n- 아름다움을 칭찬하는 가운데 "오바"라는 표현으로 감정을 과장하며 유머를 더한다\n- 결국 아름다움이 디플(일종의 대칭적 개념)이라는 논리적 접근도 시도한다	오분순삭	a1UcEDu38p8	[-0.11332046,0.029922863,0.35185647,-0.15376975,0.16289498,0.16257109,-0.2506051,0.31870466,-0.57950103,0.010212787,-0.26669055,0.3470448,-0.5277072,-0.41855043,0.02522223,0.3800049,-0.044318642,0.052412394,0.41326874,-0.3453514,-0.2959581,0.2590039,0.1651577,-0.23073444,0.08835229,-0.10138258,0.32845983,-0.12155531,-0.4091969,0.019245269,0.27174902,0.032036934,-0.5441168,0.23019475,0.081422746,0.14549655,-0.5337174,0.037492722,-0.6110748,0.062244162,-0.8475934,0.4560272,-0.17256175,-0.011