h0Z8Mh0NwD85ms_lN_mYIZ1gEUNbQxB7EvK8MnyZs0c	https://datasciencebeehive.tistory.com/240#google_vignette	2	5	딥시크 사용법 DeepSeek R-1, 로컬 설치와 활용법 🌟 당신만의 AI 비서 만들기!	# DeepSeek R-1 소개\n- DeepSeek R-1은 오픈소스 AI 언어 모델로, GPT와 견줄 만하거나 더 뛰어나다고 평가받으며 무료로 사용할 수 있습니다.\n- 모델은 DeepSeek-V3에서 시작해 SFT와 RL을 통해 훈련되었습니다.\n# DeepSeek R-1의 특징\n- 복잡한 질문에 대한 추론 과정을 투명하게 보여줍니다.\n- 대화 중 코드 생성이 가능합니다.\n- 정교한 프롬프트 처리 능력이 있습니다.\n# DeepSeek R-1 설치 및 실행 방법\n- Ollama 도구를 사용하여 DeepSeek R-1을 로컬에서 실행할 수 있습니다.\n- macOS, Linux, Windows 모두 지원됩니다.\n- 모델 다운로드 후 8B 모델(8GB VRAM 필요)을 실행하려면 'ollama run deepseek-8b' 명령어를 사용합니다.\n# DeepSeek R-1 사용 예시\n- 프롬프트: 'What is DeepSeek R-1?' 응답: 'DeepSeek-1은 다양한 주제에 대한 도움을 제공하는 AI 어시스턴트입니다.'\n- 프롬프트: 'What's the latest price of AAPL?' 응답: 'Apple Inc.의 최신 주가는 제공할 수 없습니다.'\n# 로컬 실행 고려 사항\n- 프라이버시 보장: 데이터가 내 컴퓨터 안에만 저장됩니다.\n- 오프라인 사용 가능: 인터넷 연결 없이도 AI 모델을 사용할 수 있습니다.\n- 비용 절감: 현재 무료지만, 미래에는 유료화될 가능성이 있으므로 로컬 실행으로 제한을 피할 수 있습니다.\n- 유연성: 모델을 Fine- Tuning하거나 다른 도구와 통합해 나만의 인터페이스를 구축할 수 있습니다.	DeepSeek R-1은 오픈소스 AI 언어 모델로, 복잡한 질문에 대한 추론 과정을 투명하게 보여주며 대화 중 코드 생성이 가능합니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/5c7a8f44-61d4-46c2-9f08-a4d293dddb7f.jpg	[-0.29382622,0.3311758,-0.011291264,-0.30183434,-0.19766495,0.15235177,-0.15557551,0.31122595,-0.45725727,0.16033733,0.42374727,-0.042474043,-0.09831111,0.36407417,-0.21372688,0.63181496,0.16158992,-0.078436255,0.039979156,-0.32664412,-0.10100906,0.7736374,0.078281224,0.42498913,-0.16079932,0.34234083,0.08611607,0.0016065938,0.10518794,0.5707072,0.65509516,-0.4888265,-0.60357016,0.47985125,0.184839,-0.03385154,0.30198053,0.31299758,-0.48385972,-0.522139,-0.15307704,0.012505606,-0.029408796,0.008416243,0.4142916,0.077410534,0.4628228,0.40896773,-0.15214238,-0.012993474,0.09152132,0.2256298,0.06546741,-0.3681314,-0.35306162,-0.13677807,-0.1383296,-0.1594356,-0.36852735,0.021123001,-0.40113848,-0.4094473,-0.18937786,-0.10195837,-0.08810209,0.09079654,0.276326,0.36570367,0.38546917,0.42673656,0.12257683,-0.66555935,