0kimvf2ABkPlrUXpk4o1R1xN-PJVNZ8BpKgp9bobDfU	https://link.naver.com/bridge?url=https%3A%2F%2Fm.blog.naver.com%2Fseasun16%2F223727652036&dst=naversearchapp%3A%2F%2Finappbrowser%3Furl%3Dhttps%253A%252F%252Fm.blog.naver.com%252Fseasun16%252F223727652036%26version%3D10%26sourceReferer%3Dshare	2	9	박명수 낭비벽 당근 명품거래가 왜? 할명수 어록 : 네이버 블로그	# 박명수의 당근 거래 이야기\n- 박명수는 55세 연예인 중 재미있는 인물로 평가받으며, 나이가 들어도 젊은 세대와 자연스럽게 소통하는 모습이 부러움을 주고 있다.\n- 당근 앱에서 명품 거래가 가능하다는 사실을 밝히며, 50% 이상 할인된 미개봉 상품에 대한 충동적인 반응을 보였다.\n- 하지만 사기 경험이 있어 판매자 전화번호 확인과 안심결제를 통해 거래를 진행해야 한다고 조언한다.\n- 박명수는 명품 거래를 계속 하지만, 다시 팔지 못하는 상황이 많아 걱정을 표현하며, 당근 거래에 대한 솔직한 의견을 드러냈다.	박명수는 나이가 들어도 젊은 세대와 자연스럽게 소통하며 인기 있다. 명품을 저렴하게 구매하려고 당근 앱에서 사기를 경계하며 거래한다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/beecb4da-a3c8-4abc-90d3-9194bb3b65ea.jpg	[-0.323829,0.064414814,0.8569452,-0.11373642,0.28007495,-0.16282958,0.07648596,0.2784628,-0.32212675,-0.11722615,0.35573632,0.10332619,-0.57579577,0.031397887,0.14831097,-0.3825732,-0.10702372,-0.32140425,0.30159262,-0.758127,-0.4594166,0.08247481,-0.17494169,0.40887648,-0.17005248,-0.10645379,0.42522293,-0.21670298,0.5361348,0.3500393,0.7635683,0.3377787,-0.60563815,-0.17299628,-0.2278221,0.26214755,-0.782678,-0.58983785,-0.5442185,0.011964055,-0.6282276,0.02320399,-0.03326494,0.14907703,0.05249863,-0.31898212,0.23174444,-0.2668296,-0.17812997,-0.1780808,-0.43073612,-0.3626476,0.10636441,0.16287091,-0.18315399,0.48702177,0.6933499,-0.03304555,-0.17766139,-0.3308255,0.5058097,-0.013921178,-0.07229206,0.096170254,0.3300142,-0.15532967,0.14724767,0.95743704,-0.24627545,-0.4438742,0.0039011056,-0.16941553,0.32040918,0.106083184,0.12719005,0.52697897,-0.069588795,-0.059626926,0.7220676,-0.095797256,-0.1949004,-0.8352864,-0.28898966,0.08123695,0.13878134,-0.417121,0.18569933,0.15397424,-0.0705443,0.15886326,0.03209897,0.34002328,-0.052356374,0.094195455,-0.298405,0.3570661,-0.25318024,0.0037328298,0.6163028,0.068933055,0.10407269,0.4893871,-0.7392633,0.9333799,0.313639,0.078359865