BgcWZq7OB-gPyZrVPFciY53HKG4kCiw7NHRwHfi6LXc	https://m.youtube.com/watch?v=XHqhjohqgD0&si=bZzl2okFn4791dpX	1	9	한겨울의 추위를 녹이는 1시간 빈야사 요가 풀시퀀스 | 요가소년 542	# ❄️ 겨울철 따뜻함을 느끼는 빈야사 요가\n- 요가는 겨울의 추위 속에서도 내면의 에너지를 통해 몸과 마음을 따뜻하게 해준다. 특히, 요가 수련을 통해 따뜻한 숨결로 자신을 감싸안는 경험을 할 수 있다\n- 천천히 자신만의 리듬을 찾아가는 요가 수련은 주의 깊은 호흡과 동작의 조화를 통해 진행되며, 각 동작이 내 안의 따뜻한 불씨를 밝히는 과정이 된다\n- 다양한 요가 자세(아사나)를 통해 몸을 부드럽게 풀어주고, 상체의 회전 및 긴장감을 발휘하며 유연성을 높여 나간다\n# 🧘‍♀️ 요가 시퀀스 설명\n- **두 손을 머리 위에서 합장**하고 시선은 손끝을 향한 상태에서 시작한다.\n- **다운독 자세**를 취한 후, 엉덩이를 낮추고 상체를 일으킨다.\n- **우카타아사나(의자 자세)**를 통해 상체를 곧게 세우고 양팔을 뻗는다.\n- **비라바드라사나(전사 1번 자세)**를 취하며, 양팔을 높이 뻗고 엉덩이 위치를 조정한다.\n- 마지막에는 **상체를 비틀어 회전**하면서 손끝을 다양한 방향으로 향하게 하고 호흡을 이어간다.\n# 🧘‍♀️ 요가 시퀀스 동작 설명\n- 초기 동작으로 두 손을 등 뒤에서 잡고 가슴을 열어 시선을 정면으로 향하게 한다\n- 들이마시는 숨에 양팔을 뻗고 내쉬는 숨에 손을 매트에 짚으면서 플랭크 자세로 이어간다\n- 다양한 자세를 취하면서 엉덩이 높이를 맞추고 몸통을 옆으로 비틀어 호흡을 유지해야 한다\n- 전사 1번과 2번 자세를 통해 골반과 팔을 조정하며 시선을 손끝이나 바닥으로 향하게 한다\n- 마지막에는 나무자세를 취하면서 오른발을 왼다리 안쪽에 밀착하고 균형을 유지하며 호흡을 이어간다\n# 🧘 요가 자세 및 호흡법\n- 오른발과 왼발의 방향을 조정하고, 두 다리를 어깨 너비의 1.5배 정도 벌려 골반 정렬을 해주어야 한다\n- 삼각 자세(트리코나아사나)에서 상체를 오른쪽으로 기울여 오른손을 다리에 짚은 후 왼팔을 천장으로 뻗는다\n- 왼쪽 엉덩이 아래에 오른쪽 엉덩이를 놓고 서로의 높이를 맞추어 자세를 안정적으로 유지해야 한다\n- 다이빙 자세를 통해 상체를 숙이고, 팔꿈치를 펴면서 척추를 늘여 시선을 정면으로 유지해야 한다\n- **고무카아사나(소머리 자세)**를 통해 두 팔을 등 뒤에서 연결하는 동작으로 가슴을 활짝 열고 호흡을 이어가야 한다\n# 🧘‍♂️ 빈야사 요가의 흐름과 이완\n- 고무카아사나에서 왼다리를 오른다리에 꼬아 허리를 곧게 세우고, 양팔을 적절히 위치시킨 후 호흡을 지속하는 동작이다.\n- 코나아사나(나비 자세)에서는 양발바닥을 붙이고, 무릎을 편안하게 바닥으로 향하도록 하여 쉬는 시간을 가진다.\n- 브리지 자세(세투반다 사르방가사나)에서 무릎을 굽혀 엉덩이를 들어올려 골반을 천장 쪽으로 들어올리는 동작이 이루어진다.\n- 위를 향한 활 자세(우르드바 다누라아사나)에서는 손바닥으로 바닥을 밀어내며 몸을 아치 형태로 유지하면서 호흡을 이어간다.\n- 마지막으로 바 사나 자세로 자연스러운 호흡을 하며 몸과 마음의 이완을 시작한다.	요가소년	XHqhjohqgD0	[-0.12107268,-0.30482376,0.2951796,0.5364049,0.03243986,0.64606535,-0.25383532,0.21165597,-0.15366575,0.22018456,0.2647698,-0.5579273,0.12014854,-0.23625252,0.081437595,0.6707387,0.17984565,0.18532717,0.79408544,-0.0967643,0.113353044,0.13198973,-0.28171995,0.12526542,0.006018561,-0.24377915,-0.30707487,-0.2656696,0.023951024,-0.34403467,-0.5874987,-0.814677