cJDBkQ6vqzP21rbK71te4X3OJlDC8Iv78Se0VRu_yDQ	https://www.youtube.com/watch?v=NBvSvbwQhck&si=3qplW6PT0zeSWpyl	1	3	일본인 아이돌 💫츠키💫도 처음인 일본 소도시 여행｜#곽준빈의세계기사식당	# 🦀 일본 소도시 여행의 시작과 저녁 계획\n- 시장 방문은 곽준빈과 츠키에게 새로운 경험으로, 회사 근처 시장은 처음이라고 언급된다\n- 저녁에 머물 민박집은 할머니가 운영하며, 재료를 사 가면 요리를 대접할 수 있을 것으로 추정된다\n- '대게'라는 단어의 중의적인 의미에 대해 대화를 나누며, 할머니들이 대체로 대게를 좋아한다\n- 대게는 겨울철에 맛있어, 특히 연말에 카니나베 등으로 즐긴다고 나와 있다\n- 이러한 여정은 일본 소도시 여행의 시작으로, 다양한 경험을 할 것을 암시한다\n# 🍣 일본 해산물 시장의 특징\n- 일본 해산물 시장에서는 **아침에 잡은 해산물**을 그대로 판매하는 시스템이 존재한다\n- 해산물은 수족관이 아닌 깔끔하게 정돈된 상태로 판매되며, 신선도를 강조하지 않는다\n- 해산물의 가격은 저렴하여, 예를 들어 다리 하나 없는 해산물이 만 원도 안 되는 경우가 있다\n- 가격이 비싼 해산물 대신, 다리가 하나 없는 해산물을 선택하는 것이 **경제적**일 수 있다\n- 일본 시장의 특성과 가격대를 통해 한국의 해산물 구매 문화와 차별점을 느낄 수 있다\n# 🍣 일본 소도시에서의 경험 \n- 총 20만 원의 비용으로 다양한 먹거리를 경험할 수 있는 기회가 생겼다\n- 자세가 좋다는 언급이 있으며, 이는 식사 준비나 계산 과정과 관련이 있다\n- 카이센동을 주문하며 식사의 즐거움을 표현하고, 가격은 10,000원으로 확인되었다\n- 서비스에 관한 언급도 있으며, 스모 서비스가 원래 유료라는 정보가 제공된다\n- 매우 맛있는 음식을 기대하며 긍정적인 반응을 보이는 장면이 담겨 있다\n# 🍣 일본식 식사 문화와 재료에 대한 이야기\n- 일본에서는 **숟가락 대신 젓가락**을 주로 사용하며, 이는 편리함 때문인 것으로 추정된다\n- 일본식 회는 **달고 비싼 재료**들로 구성되어 있으며, 에비(단새우)와 우니(성게) 등이 자주 사용된다\n- 일본인들은 식사 시 간장을 부어 먹는 것을 선호하며, 이는 보편적인 식사 습관으로 보인다\n- 출신 국가와 **문화적 차이**에 대해 이야기하며, 다른 나라에서 일하고 사는 경험에 대해 흥미를 느끼는 모습이 보인다\n- 식사 문화에 대한 질문과 대화는 일본에서의 경험을 더욱 풍부하게 만든다\n# 🍚 일본식 식사 예절과 음식 양\n- 일본에서는 **밥을 들고 먹는** 것이 예의이며, 한국에서는 밥을 두고 먹는 형태가 일반적이다\n- 일본식으로 음식을 먹는 방식에 대해 언급하며, 젓가락 사용 시 주의해야 할 점도 있다\n- 식사 중 **음식의 양이 너무 많아 남기는** 경우가 발생할 수 있으며, 분배를 잘 고려해야 한다\n- 음식의 맛에 대한 의견도 나누어졌으며, 특정 음식이 **맛있었다**는 언급이 있다\n- 한국식과 일본식 식사 문화의 차이에 대한 이해와 경험을 공유하였다\n# 🍜 음식을 먹는 예절과 여행 계획\n- 음식을 먹을 때 **쩝쩝** 소리를 내면 안 되는 규칙이 있지만, 면을 먹을 때는 소리를 내는 것이 허용된다.\n- 면 소리를 내는 것이 맛있게 먹는 것과 연관이 있는 것으로 보인다.\n- 그러나 면과 밥의 차이에 대해서는 이해하지 못하는 사람도 많다.\n- 또한, 이 지역은 **설산**으로 유명하다고 알려져 있다.\n- 마지막으로 밥을 먹고 겨울 여행을 즐기자는 제안이 있다.	EBS	NBvSvbwQhck	[0.0534713,-0.18405703,-0.47644728,0.15669645,0.064817704,0.38387126,-0.6147758,0.14656726,-0.5191003,-0.36249438,-0.074433416,0.2539211,-0.4904817,-0.2596966,-0.126086,0.5372908,-0.122579664,-0.49745107,0.302797