DFs-kyA92jQTF939OVS_r-dXEzEgRGKkpH9tpYMolXk	https://ddaraddare.tistory.com/m/4	2	4	[후기] 침착맨 말년킹피자 가격, 맛 후기	# 말년킹 피자 소개\n- 말년킹 피자는 고피자의 협업 메뉴로, 킹 받는 피자라는 타이틀을 가지고 있다.\n- 피자의 패키지는 심플하고 강렬한 색감으로 감성을 자극한다.\n# 고피자 감자튀김\n- 감자튀기는 고피자의 메뉴로, 맛이 롯데리아와 비슷하다.\n- 맥도날드의 감자튀김과는 다른 맛을 느낄 수 있다.\n# 사이드 디쉬\n- 샐러드 4종류가 들어있는 4구 샐러드로, 피자와 잘 어울린다.\n# 고피자 크기 및 가격\n- 크기는 성인 여성 2인이 곁들여 먹기 적당한 양이다.\n- 가격은 10,900원으로, 누텔라 덕분에 비싸게 느껴진다.\n# 맛 후기\n- 첫 입 먹었을 때는 맛있다고 느꼈지만, 먹을수록 독특한 맛이 느껴진다.\n- 누텔라와 페퍼로니의 조합으로 매콤하고 쫀득한 맛을 느낄 수 있다.	말년킹 피자는 고피자의 협업 메뉴로, 심플하면서 강렬한 패키지 디자인을 가지고 있다. 첫 입에는 독특한 매콤함과 쫀득함이 느껴진다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/67d48ae4-29de-47a8-bfbe-b033f3b248cd.jpg	[-0.21474019,0.15500602,-0.09419608,0.087328896,-0.17929009,0.13386996,0.17188832,0.028938761,0.085122034,-0.09679644,0.521554,-0.119160265,-0.18791851,-0.24939394,-0.014547596,0.31760147,0.24622324,-0.35162148,0.23073602,-0.35759586,-0.22663955,-0.52751976,0.015073627,-0.292242,0.40374893,-0.36907965,-0.08511406,-0.07138607,-0.25279382,0.1331568,0.88989353,-0.35204205,0.2404328,-0.42583203,-0.35533533,0.36999905,-0.27886748,-0.60174394,-0.13810417,-0.24557033,-0.026882023,-0.033755153,0.0026711836,0.31056136,-0.28516608,-0.38972557,0.030188674,-0.20145276,-0.06688133,0.11078659,0.16967058,0.15748622,0.1526424,-0.05506657,-0.5576823,-0.084465876,-0.082827866,-0.12933433,0.1623446,-0.44361722,-0.043031007,0.17668942,-0.39495772,-0.616447,-0.6630971,0.073783174,0.2312491,-0.052624915,-0.18757711,-0.60983306,0.015628444,0.35070658,0.5628842,0.21614578,-0.035561547,-0.0010777023,-0.14140259,-0.31059128,0.66676724,-0.15457064,-0.70692974,0.027902935,-0.5977242,-0.7745424,0.07366091,-0.2361218,0.5796416,-0.06110905,-0.2644866,0.31315625,0.53870004,-0.8163432,0.33180323,-0.08995961,0.36575148,-0.030909322,0.3883115,0.013811499,-0.041311417,0.08904617,-0.5355692,-0.14997776,-0.051225588,0.4938254,0.22293158,-0.27930677,-0.20354916,-0.13634548,0.41123968,0.06940071,-0.09347719,-0.3432061,-0.15162078,0.03