umfgCyZ5sE2Dx15k7cb5pR0AIXv4K8tchZc1oh1DGTM	https://www.youtube.com/watch?v=Je06pbZAvtE&si=lw_8_t0V_dX-WlW6	1	3	빈집인줄 알았던 할아버지댁에 처음보는 조선족이 살고있다 - 한국여행, 전라남도 보길도 02	# 🏡 할아버지 댁과 여행의 감상\n- 아침에 담배 냄새로 인해 불편함을 느끼며 여행 준비를 하고 있다\n- 다양한 갈등과 생각을 하며 여행이 진행 중임을 암시하고 있으며, 특히 할아버지와 아버지의 고향 이야기가 나온다\n- 땅끝과 보길도를 언급하며 여행의 목적지를 혼란스럽게 표현하고 있다\n# 🏡 할아버지 댁 방문 계획\n- 아버지가 20살 때 부산으로 올라오셨고, 아들은 고향인 보길도를 혼자 여행 중이다.\n- 할아버지와 할머니는 돌아가셔서 그 집은 비어 있을 것으로 추정되며, 가서 확인할 계획이다.\n- 집에는 **전기와 물**이 없다고 알려져 있지만, 가로등은 있다고 한다.\n- 만약 집이 괜찮으면, **흙집**을 세울 계획이다.\n- 50대 정도의 할아버지가 살던 집이 있으며, 과거의 기억을 되새기고 싶다고 언급한다.\n# 🏡 할아버지 집의 새로운 거주자\n- 해당 장소는 **원래 할아버지**가 거주하던 집으로, 이제는 **중국인**이 살고 있다.\n- 거주자는 할아버지의 **손자**로, 이곳에 거주한 지 **일 년**이 되었다고 말한다.\n- 한국어를 유창하게 구사하며, 거주자가 한국에서의 생활에 대해 긍정적으로 언급한다.\n- 방문자는 이 집이 **펜션**으로 운영되는 것인지에 대해 질문하였으나, 정확한 정보는 명시되지 않았다.\n- 장소의 분위기는 **조용하고 평화롭**하며, 주변에는 아무도 없는 것으로 언급된다.\n# 🏠 할아버지 집의 새로운 세입자\n- 할아버지의 집이 **비어있다는 소리**를 듣고, 현재 두 명의 조선족이 거주하고 있다고 전해진다.\n- 조선족 세입자는 **연길에서 온** 분들로, 이 지역에서 잘 지내고 있다고 언급되었다.\n- 화자는 이들이 자신의 **생활권을 침범한 것** 같아 마음이 불편하다고 느끼고 있다.\n- 화자는 **여행을 계속 하기 위해** 다른 섬으로 이동할 계획을 세우고 있다.\n- 상황 설명 후, 장비 점검을 하면서 여행 준비를 하고 있는 모습이다.\n# 🏡 할아버지댁의 의외의 발견\n- 집에서 생각보다 아무것도 없었던 상황이다\n- 4명으로 구성된 가족이 그 집에 살고 있었다고 언급된다\n- 친구가 집을 치우고 월세를 내고 살고 있었다는 사실이 뒤늦게 알려졌다\n- 오래된 집은 방문객이 적어 실제로 사람들이 거주하는지 모르는 경우가 많다\n- 겨울 바다에서 한 명도 없는 풍경은 낭만적인 데이트에 적합하다	곽튜브	Je06pbZAvtE	[0.021988496,-0.22849356,-0.1603667,0.14457339,0.53102136,0.16784027,-0.78953874,0.48415938,0.011007494,-0.14352624,0.021373477,0.20610446,-0.21621126,-0.6183176,0.044622082,-0.22550821,0.0120240655,-0.14879954,0.5502688,-0.51351064,-0.1526702,-0.7436293,0.4103828,-0.73727155,-0.14347902,-0.55037624,-0.036124844,0.22457686,-0.12452144,-0.2579297,-0.22177842,-0.32502288,-0.07315633,-0.021133356,0.14830396,-0.51220965,-0.4249643,-0.5039005,-0.33191139,-0.385279,-0.22259769,-0.037555523,0.6618726,0.14818276,0.121982984,0.13372631,0.11094399,-0.23296148,-0.600742,-0.1205229,-0.20531233,-0.13832961,0.15551129,-0.1694739,0.5791575,0.053846493,-0.1