h64zjmzHwE9r3QWYMr6WKL7L4KGZ2v4Mp1oXhwcU2B4	https://tdfy.tistory.com/entry/%EC%B9%A8%EC%B0%A9%EB%A7%A8%EC%9D%98-%ED%8C%8C%EA%B8%89%ED%9A%A8%EA%B3%BC%EC%99%80-%EC%B9%A8%EA%B5%AC%EC%AD%88	2	3	침착맨의 파급효과와 침구쭈	# 침착맨의 광고 효과\n- 침착맨의 광고는 저에게 큰 영향을 미쳤다.\n- 카트라이더, 킹뚜껑, 포카칩, 트러플맛, 스파이더맨, 오펜하이머 등 다양한 제품을 알게 되었다.\n- 짐빔하이볼도 마셔보고 싶어졌다.\n# 침착맨의 굿즈\n- 침착맨 굿즈를 구매하고, 침순이인 것을 자랑스럽게 생각한다.\n- 침착맨 티셔츠와 아수라 티셔츠를 구매했다.\n- 침착맨 레몬의 효능 장패드는 예쁘지만 아직 구매하지 못했다.\n# 감상 후기\n- 침착맨의 굿즈와 제품은 저에게 큰 영향을 미쳤다.\n- 타지에 가서도 침착맨의 제품들을 활용하고 싶어졌다.	침착맨 광고로 다양한 제품과 굿즈를 알게 되었으며, 구매하고자 하는 욕구가 생겼다. 이를 통해 침착맨 제품들의 중요성을 깨달았다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/27f6eecc-b9e2-429f-be26-191907f0bfe1.jpg	[0.24417129,0.18729192,-0.16199702,0.34474686,-0.17125934,0.059051253,-0.17274801,-0.039146814,-0.13396291,0.10701146,-0.17825745,0.27788797,-0.2929993,0.02707377,0.49055496,-0.17323124,0.3146427,0.37343997,0.4953634,-0.5097761,-0.57368004,-0.19028696,-0.43048376,0.038888812,0.12410273,0.2896487,-0.0068348553,0.294145,0.1199287,0.053120643,0.58864486,-0.23787624,-0.43181673,0.10887988,-0.051170353,0.3495555,-0.54387856,-0.42800024,-0.6187048,0.47109866,0.04442887,0.026801374,-0.18208656,0.02330545,-0.11995369,-0.39948934,-0.4680822,-0.07081101,0.194891,-0.029890802,-0.45257443,-0.5681472,0.08346373,0.09854904,0.29426086,0.22850493,0.15024284,-0.5751754,0.18511425,-0.36111116,-0.024063861,-0.4125577,-0.25548208,-0.04734787,-0.32128328,0.2802931,0.48230654,0.15140343,-0.16050313,-0.15400848,0.491607,0.2641008,0.56575704,-0.42282593,0.25445262,0.10531877,-0.13615015,-0.15538354,0.85650593,-0.18821798,-0.35096723,-0.32012513,-0.66790557,-0.0017812802,0.25408128,-0.17072156,0.41501558,-0.6862657,0.0482763,0.19305246,0.11378085,-0.13248841,-0.27098998,0.18458769,0.1722373,0.41954324,-0.38906017,-0.04708853,0.83553946,0.24758202,-0.26535136,0.95986354,-0.77069366,0.30822346,-0.12107945,-0.44822806,0.2958985,0.19031425,0.7042778,-0.25547135,-0.38183486,-0.66916263,-0.058168653,0.23767555,-0.2913791,