hsj6D51a1kVdDHnxaX9dHMqr9L0u2Dl3i87b8VnbABs	https://m.businesspost.co.kr/BP?command=mobile_view&idxno=375926	2	4	스타벅스 조선호텔 협업 상품 내놔, 스탠리 텀블러도 재출시	# 스타벅스 버디위크 행사를 소개\n- SCK컴퍼니는 10일부터 19일까지 올해 가장 인기 있는 상품에 할인 혜택을 제공하는 '버디위크' 행사를 진행한다.\n- 호텔 스타벅스 컬렉션 상품도 앱 온라인 스토어에서 판매된다. 조선호텔과의 협업으로 출시된 상품들이 포함되어 있다.\n- 스타벅스 멀티빅테리백, 로브베어리스타키체인, 고블렛 잔세트 등 다양한 제품이 선보이며, 구매 고객에게 별 5개 추가 적립 혜택과 룸슈즈 증정이 있다.\n- 올해 여름 인기 상품인 핑크, 페블그린, 그레이 색상의 스탠리 켄처텀블러도 재출시된다. 10% 할인 혜택을 제공하는 상품도 있다.	스타벅스는 10일부터 19일까지 인기 상품에 대한 할인 행사를 진행하며, 호텔 스타벅스 컬렉션도 판매한다. 다양한 제품과 함께 별 5개 추가 적립 혜택이 있다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/logo/Defalut.jpg	[-0.48505685,0.6268836,-0.30323577,0.69968307,-0.14513758,0.3290491,-0.021310043,0.2756273,0.056396436,0.53918195,0.3122967,-0.04097533,0.32990205,0.46888906,0.24958229,0.9054132,-0.21739323,-0.15375717,-0.17919369,-0.25212324,0.06557269,0.1029039,-0.08328265,0.07398812,0.023858372,0.17136598,-0.14783174,0.028841745,0.35048157,0.6996794,0.22376394,-0.31480104,-0.23604435,-0.5428182,0.18075255,0.37819692,-0.29345387,-0.24029557,-0.08959013,0.2126476,-0.36695904,0.43971044,-0.41901356,0.07224254,0.45127767,-0.7232669,0.7394169,-0.2849199,-0.64294815,0.07644674,-0.34066194,-0.37546042,-0.30080646,-0.15914147,-0.3615684,-0.3681349,0.3302873,-0.55560434,-0.28542775,0.264643,0.2582653,-0.05645836,-0.724469,0.19152677,-0.5041972,-0.43200985,-0.36634678,0.48943245,-0.078254074,-0.14797837,0.04387796,-0.16630748,0.601247,0.12539345,0.27089888,0.4668302,-0.28428832,0.0036114235,0.8051534,-0.16936319,-0.544687,-0.15367302,-0.22694863,-0.19440283,0.6135669,-0.78175473,0.04081756,0.06297797,-0.0470194,-0.23133893,0.4066574,0.20652199,-0.2561823,-0.25822726,0.5951663,-0.0041598384,0.030475821,-0.27923346,0.48238438,0.010660192,-0.03463539,0.7509651,0.10930993,0.21032333,-0.019384604,0.17201778,0.5052963,0.063456416,0.96660435,-0.36432332,-0.25519058,-0.23902357,-0.072540075,0.17547315,-0.30461198,-0.15746692,0.26473105,-0.29950753,-0.093059085,0.68089455,0.3836816