Us6vNvsZopyvCIZmLdDNG97Ub65rE9cFG6hu4MyNNRo	https://n.news.naver.com/article/015/0005092962?sid=103	3	2	공복 커피, 다이어트에 도움 될까 [건강!톡]	# 커피의 건강 효과\n- 한국의 1인당 연간 커피 소비량은 405잔으로, 카페인이 함유되어 피로와 졸음을 쫓고 활력을 줄 뿐만 아니라 항산화 물질을 함유해 암과 당뇨 예방에도 도움이 된다.\n- 카페인은 신진대사를 가속화시켜 칼로리를 더 많이 소모시키며, 식욕 억제 효과도 있어 체중 감량에 도움이 될 수 있다.\n# 커피와 체중 관리\n- 2020년 연구에 따르면 매일 커피 4잔을 마신 사람들은 투여받지 않은 사람들보다 지방량이 약간 감소한 것으로 나타났다.\n- 하지만 과도한 커피 섭취는 수면 장애와 두통 등 부작용을 일으키며, 특히 공복 상태에서는 위장질환을 유발할 수 있다.\n# 커피와 다이어트\n- 공복에 커피를 마시면 위염, 위궤양, 과민성 대장질환 등 위장질환을 유발할 수 있으며, 식사 후 커피는 유익한 영양분을 빠져나갈 수 있다.\n- 백지연은 커피를 마시지 않으면 밀가루와 디저트 생각이 줄어들었다고 전했다.\n# 커피와 운동\n- 카페인은 근지구력, 근력, 혐기성 힘, 유산소 지구력을 향상시키는 데 도움이 되며, 3~6mg/kg의 카페인 섭취가 효과적이다.\n- 운동 전에 커피를 마시면 운동 능력과 에너지 증가에 도움을 줄 수 있지만, 개인의 유전적 구성 등 다양한 요인이 신체 반응에 영향을 미칠 수 있다.\n# 커피 과다 섭취의 위험\n- 카페인 과다 섭취는 체내 칼슘 흡수 방해와 위산 분비 촉진으로 인한 위장 장애를 일으킬 수 있으며, 중독될 경우 집중력 감소와 신경 예민성을 초래할 수 있다.	- 커피는 카페인과 항산화 물질을 함유해 피로 해소, 체중 관리, 암 및 당뇨 예방에 도움이 되지만 과다 섭취는 위장 문제와 두통 등을 일으킬 수 있다.\n- 운동 전 커피는 에너지 증가와 운동 능력 향상에 효과적이나 개인의 유전적 구성 등 다양한 요인이 신체 반응에 영향을 미칠 수 있다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/logo/News.jpg	[-0.19354415,-0.08689345,0.012650892,0.18977642,0.03645087,0.2853722,-0.16764057,0.22981343,-0.12803206,0.3224285,-0.3525645,-0.053783342,-0.068927824,0.13843265,-0.16441278,0.17519493,0.55272865,-0.34315148,0.017279672,-0.24917838,-0.59274644,-0.1392721,-0.14405823,-0.019961651,-0.36786303,-0.19178936,-0.411531,-0.33776885,0.0801381,0.95743144,0.5853034,-0.054558035,0.15231812,-0.1612682,-0.16767336,0.078937404,-0.075460434,-0.025533017,0.030318536,0.2699976,-0.060493194,0.27675295,0.28171265,0.42289513,-0.4704694,-0.8947075,-0.5527543,0.73425186,-0.53928596,0.04244867,-0.16933222,-0.44061905,-0.2459848,-0.030905493,0.26382023,0.010175294,-0.7500926,0.29944065,-0.3114493,-0.08594177,-0.2868331,-0.34936744,-0.13039686,0.09022832,-0.78147066,0.294333,-0.40771657,0.06499975,0.10028059,-0.21892768,0.30301037,0.13290906,-0.043015428,0.6649646,0.2587729,-0.1751337,-0.5257003,-0.260