qcZj5946tb1q4BcwOqh04Ltv5UIBFqaE13TnGxPOnSc	https://chosa77.tistory.com/entry/%EC%B9%A8%EC%B0%A9%EB%A7%A8%EC%97%90-%EB%8C%80%ED%95%B4-%EC%95%8C%EC%95%84%EB%B3%B4%EC%9E%90	2	9	침착맨에 대해 알아보자	# 침착맨의 배경과 활동\n- 침착맨은 아프리카 방송국에서 하스스톤을 하면서 침착한 자가 승리한다는 의미로 '침착맨'이라는 별명을 얻었다.\n- 만화가였던 침착맨은 서유기가 끝난 후 스트리머로 전향하여 다양한 게임을 진행하며 인기를 얻었다.\n# 인기 요인\n- 관찰력이 뛰어나며, 주제에 집중하고 틀을 깨는 능력을 보여준다.\n- 언어의 묘사력이 뛰어나서 다양한 시각에서 의견을 제시하고 표현한다.\n- 상황 대처 능력이 뛰어나며, 논란을 피하기 위해 적절한 행동을 취한다.\n# 아쉬운 점\n- 리니지W 광고 사건에서 민심을 잘 파악하지 못했다는 비판이 있었다.\n- 게임 이슈에 대해 충분히 이해하고 있지 못한 점에서 아쉬움을 느꼈다.	침착맨은 아프리카 방송국에서 하스스톤을 통해 '침착맨'이라는 별명을 얻고, 서유기 후 스트리머로 전향하여 인기를 얻었다.\n\n관찰력과 언어의 묘사력으로 주목받으며, 상황 대처 능력이 뛰어나지만 리니지W 광고 사건에서 민심을 잘 파악하지 못했다는 비판이 있었다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/d40ad691-1b48-4ec8-9619-0d80261b598f.jpg	[-0.42969623,0.43658513,0.44562036,-0.22821644,0.1949324,0.58754015,-0.46252495,0.4482729,-0.5856243,0.1330582,0.19643882,-0.24916928,-0.08269052,-0.32128257,0.22887464,-0.063601494,-0.23578039,-0.37187743,0.5791938,-0.12556258,-0.10809396,0.21841638,0.03357846,0.15686433,-0.09292821,0.32408527,-0.29468262,-0.12486371,-0.044918746,-0.0507895,0.51159537,-0.35507527,-0.62556624,0.6357334,0.042722188,0.05203623,-0.48368979,-0.23551618,0.28007615,0.3553017,-0.53367007,-0.23744285,0.06443847,0.33348015,-0.09474847,-0.5799525,-0.18903182,-0.15892085,-0.052341416,0.09866519,-0.41489893,-0.49895048,0.5232574,0.21531175,0.2690717,-0.13124643,0.08975221,0.13375974,0.03135505,0.013319919,0.21587178,-0.76862717,-0.028755398,0.32666907,-0.18245265,0.3599426,0.12640062,0.15988576,-0.09291357,0.40493834,0.45878124,-0.083234355,0.32700685,-0.30404794,-0.17206903,-0.0687658,-0.2298278,-0.296856,0.38142198,-0.21988863,-0.37944674,-0.4901148,-0.74351716,0.0039229495,-0.6652937,-0.07567272,0.20051174,-0.47307676,-0.21392617,0.60637754,-0.68572223,0.036518153,-0.0067307707,-0.12523475,0.009285512,-0.33397695,-0.20687607,0.39875698,0.3609168,0.032198984,-0.096099034,0.7045407,0.41650707,0.66482663,-0.