-gnVzDFgWIhfPaBAVAaX_iV52O_116eTcgPdwlJ1KaE	https://www.youtube.com/watch?v=XZUB5Vhyh8c&si=eKt3oNyadhOEIeui	1	3	초가성비 휴양지 코타키나발루 여행 가이드 🇲🇾 추천호텔, 맛집모음, 섬투어, 쇼핑리스트, 가볼만한곳, 꿀팁	# 🌅 코타키나발루: 동남아의 아름다운 휴양지\n- 코타키나발루는 독특한 문화와 다양한 해양 액티비티를 체험할 수 있으며, 여러 인종이 조화롭게 어우러진 다양한 음식과 열대 과일을 저렴하게 즐길 수 있다\n- 이 도시는 동말레이시아 사바주의 최대 도시로, 인천과 김해에서 직항으로 5시간에 도착 가능하며, 영국의 식민지 역사 덕분에 영어 소통이 편리하다\n- 에어아시아와 같은 저비용 항공사를 이용하면 비용을 절감할 수 있을 뿐만 아니라, 기내식과 핫 시트 이용으로 더욱 편리한 여행이 가능하다\n# 🍽️ 코타키나발루의 맛집 소개\n- 코타키나발루에는 '케다이 코피' 또는 '코피티암'이라는 이름을 가진 식당들이 많아 **식사 메뉴와 커피**를 함께 제공한다.\n- 아침 인기 메뉴인 **카야 토스트**는 구운 빵에 카야잼과 버터를 바르고 반숙 계란과 함께 먹는 것이 정석이다.\n- '코피 핑'은 깔끔한 분위기로 아침부터 많은 로컬들이 찾는 인기 식당이다.\n- '올드타운 화이트 커피'는 말레이시아 대표 체인으로, **생 버터**를 넣어 만든 카야 토스트가 인상적이다.\n- 말레이시아의 대표 음식으로는 **바쿠테**, **락사**가 있으며, 특히 **락사는 관광객과 로컬들 모두에게 인기** 있는 맛집에서 제공된다.\n# 🌴 코타키나발루의 매력적인 여행지와 활동\n- **가야 스트리트**는 100년 이상 운영된 가게들이 있으며, 유명 맛집들이 모여 있어 여행 중 반드시 방문해야 하는 곳이다.\n- 주말에는 **야시장**이 열려 다양하고 맛있는 먹거리들로 가득 차 있으며, 활기찬 분위기 속에서 여유로운 시간을 즐길 수 있다.\n- **구 사바 주청사**는 독특한 외관이 특징이며, 건물의 기울어짐으로 인해 피사의 사탑처럼 유명한 포토스팟으로 알려져 있다.\n- **리카스 모스크**는 코타키나발루에서 가장 큰 규모의 이슬람 사원으로, 여행객들이 꼭 방문해야 할 아름다운 장소이다.\n- **툰구 압둘라만 해양 공원**에서는 스노클링과 해양 액티비티를 즐길 수 있는 다섯 개의 섬이 있으며, 예약은 하루 이틀 전에 미리 하는 것이 좋다.\n# 🏨 코타키나발루 호텔과 편의시설\n- 코타키나발루에는 많은 호텔과 리조트가 있으며, 숙박 요금이 **저렴**하여 여행 만족도를 높인다\n- 첫 번째 호텔인 하얏트 센트릭은 2022년에 오픈했으며, 주요 관광지에 **가까운** 위치에 있다\n- 하얏트 센트릭의 비수기 1박 요금은 15만 5,000원으로, **가성비**가 뛰어난 호텔이다\n- 두 번째 호텔인 코타키나발루 메리어트 호텔은 **오션뷰**가 장점이며, 비슷한 가격대에서 **아늑한** 숙소를 제공한다\n- 이마고몰과 수리아 사바 같은 대형 쇼핑몰이 있어 **편리한** 쇼핑이 가능하며, 대나무 춤 등의 문화적 볼거리도 제공된다\n# 🛍️ 코타키나발루 쇼핑 필수템\n- **코타키나발루** 마트에서는 사바 지역 제품과 태국 등 인근 국가의 물건들을 구매할 수 있다\n- 필수 쇼핑템으로는 **카야잼**, **화이트커피**, **멸치스낵**, **미고랭 라면**, **사바 야생 건망고** 등이 추천된다\n- **유레카 팝콘**은 반드시 사야 하며, 시식하는 것도 권장된다\n- **오트밀 제품**과 함께 중독성 있는 **카야잼 쿠키**도 인기가 높다\n- **그랩** 앱을 미리 설치하면 저렴하고 편리하게 이동할 수 있으며, 코타키나발루에서 유심 구매가 용이하다	아일랜드 트래블러	XZUB5Vhyh8c	[0.5216029,0.014262489,-0.5391217,0.4432621,-0.12496191,0.79889715,-0.03972307,0.36573046,0.2642701,0.34831208,0.12685022,-0.0255591,0.