BmaKqVCHsCYOnuAusQuTM0MO5KLKUgm6aSR9Sx9wVOc	https://m.youtube.com/watch?v=5wm7Ts_JJco&si=KS7q2Da2HoltS1TK	1	3	인천 → 오사카	# ✈️ 비행기 탑승 경험\n- 비행기에서는 좌석에 대한 혼동이 발생하고, 창가 자리와 관련된 대화가 오간다\n- 비즈니스 클래스의 좋은 시설에 대한 언급과 동료의 탑승에 대한 이야기가 이어진다\n- 승무원의 안내에 따라 안전벨트를 착용하라는 요청이 있었고, 탑승 후 비행 일정과 연락에 관한 정보가 전해진다\n# ✈️ 일본 여행 준비와 숙소 정보\n- 여행이 오사카로 가는 **메타항공 101편** 비행기로 진행되며, 일본의 매력을 느끼고 있다.\n- 숙소에 도착 후 **체크인**을 먼저 해야 하며, 예약 상황에 대해 의문이 제기된다.\n- 숙소는 **초특가**로 30만 원에 항공권과 숙소를 포함했으며, 할인은 **야놀자**를 통해 이루어졌다.\n- 예약된 숙소는 미니 더블 형태로, 침대가 두 개 제공되는 것으로 확인되었다.\n- 일본 여행 중의 구매 계획으로 **도쿄 바나나** 같은 특산물을 사기로 했다.\n# ✈️ 오사카 여행 계획과 비행 중 안전 안내\n- 체크인 시간 전에 오사카에서 **오코노미야키**를 먹기로 계획하고 있다\n- 다음으로 **다이마루 백화점**의 **포켓몬 센터**를 구경할 예정이다\n- 비행 중에는 안전 장비 사용법에 대한 안내가 있으며, **벨트** 착용 방법과 **산소 마스크** 사용법이 설명된다\n- **구명복** 사용 설명도 포함되어 있으며, 부풀리기 위한 방법이 안내된다\n- 비행기 탑승 중 안전띠 표시등이 꺼지면 항상 좌석벨트를 착용하라는 주의사항이 있다\n# ✈️ 비행 중의 에피소드\n- 비행기 안에서의 대화와 행동이 마치 **친한 사이**처럼 편안하게 이루어진다.\n- 신분증 검사를 언급하며, 동생 같은 승객에게 말 놓기를 제안하고, **편하게** 대화를 나누려 한다.\n- 음료 선택과 관련된 대화로, 맥주를 요청하며 아이스크림 맛에 대한 이야기를 하며 **즐거운 분위기를** 유지하고 있다.\n- 헤드셋을 쓰고 조수석에 있으며, 영화나 기타 오락을 찾아보는 등 비행 중의 **여유로운 시간**을 즐기고 있다.\n- 어느 순간 예상치 못한 상황에 놀라는 반응을 보이며, **작고 재밌는 순간**들을 공유한다.\n# ✈️ 비행기에서의 소통과 만남\n- 비행 중 **불안정한 기분**과 공기압으로 인해 신체적 반응이 다소 불편함을 느낀 상태이다\n- 문자 메시지가 많이 와 있었으며, 특히 어머니에게 여러 통의 **콜백**이 있었다\n- 비행기에서 오랜만에 만난 사람들과의 반가운 **인사**와 대화가 나뉘었고, 서로의 외모 변화에 대한 칭찬이 오갔다\n- 친구 사이에서 **연애**에 대한 질문과 궁금증이 표현되었으며, 서로의 나이를 언급하였다	숏박스	5wm7Ts_JJco	[0.022140278,-0.10405518,0.16308637,0.49338424,0.54266495,0.42647618,-0.49922037,0.596372,-0.14029361,0.34192136,-0.21407993,0.059247144,-0.24342825,0.11624528,-0.24709116,0.3469925,-0.12983087,-0.07533378,0.6401329,0.7202822,0.21935591,0.41982073,0.116988674,0.041932523,0.28170937,-0.5179642,0.2807213,0.27194214,0.15667543,-0.3547102,-0.49572697,-0.14546095,-0.28875732,0.0060942657,0.14742368,0.08807129,-0.39136767,0.34527528,-0.36469936,0.25558895,-0.2823105,0.31053728,-0.0350957,0.24282676,0.36789745,-0.24470389,0.18529613,-0.27415377,-0.35730815,-0.18405409,-0.234