arJt3zFzowugDJSX3fv-49rwefQ-JxOdUzSXTB5xyTI	https://www.youtube.com/watch?v=tdKZpgSeO8E&si=pEYHZH4i9rlzJ59k	1	3	홋카이도 vlog.❄️ 1인칭 시점 나홀로 해외여행 | 삿포로, 오타루, 비에이 겨울여행 브이로그	# 📸 찍고, 사는 일상\n- 새로운 빛을 느끼며 다양한 사진을 찍고 싶어한다.\n- 여러 가지 물건을 사기 위해 상점을 방문한다.\n- 공원에서 산책하며 맛있는 음식을 즐기고자 한다.\n# ☕️ 카페 방문과 식사 계획\n- **공원**에서 산책을 계획하고 있다고 언급된다.\n- 카페에 가서 음료를 사는 계획이 세워져 있다.\n- **많은 밥**을 먹겠다는 의지를 여러 번 강조한다.\n- 일본어로 반복된 부분에서 가고 싶은 **집**이나 인기 있는 가게에 관한 내용이 포함되어 있다.\n- **해변**에서 신선한 공기를 마시러 가는 계획이 있다.\n# ☕ 카페 방문 및 장소 소개\n- 카페에 도착하였으며, 사진을 촬영할 계획이다\n- 해당 장소는 **한창의 한가운데**에 위치하고 있다\n- 여기에는 전통적인 **공원**이 있으며, 이곳이 몇 번씩 언급되었다\n- 바다로 이동할 예정이며, 여러 번 **비치**에 가겠다고 언급하였다\n# 🏖️ 해변과 식사 계획\n- 해변에 가는 계획이 여러 번 언급되며, **여행**의 주요 목적 중 하나로 보인다\n- 많은 음식을 주문했지만 **배가 부른** 상태를 반복적으로 표현하여 과식을 시사한다\n- 자신이 먹을 양을 강조하며 쌀을 많이 먹을 계획임을 여러 번 언급한다\n- 다음 **역으로 이동**할 계획을 여러 번 명확하게 전달하며, **교통 수단** 이용이 중요함을 나타낸다\n- 공원에서의 **산책** 계획도 언급되어 이 여행에서의 **여유로운 활동**에 대해 암시한다\n# 🏞️ 홋카이도 여행의 일상\n- 해변에 가는 계획이 있다.\n- 공원에서 걷기를 여러 번 언급하고 있다.\n- 카페에 도착해 많은 음식을 먹으려는 의도이다.\n- 여러 번 가게에 간 내용을 전달하고 있다.\n- 소스와 함께 볶음밥을 주문할 예정이다.\n- 다음 역으로 이동할 계획이 있다.\n- 다시 한번 많은 음식을 먹고자 하는 의지가 드러난다.\n- 공원에서 다시 걷기를 하려고 한다.\n- 간단하고 맛있는 요리를 만들고자 하는 목표가 있다.	Oh!군석	tdKZpgSeO8E	[-0.30663314,-0.22671995,0.058993015,-0.034019213,0.30341476,-0.026277788,-0.0023130542,0.24395035,-0.13934614,-0.5758678,0.31450203,0.002365796,-0.22840972,-0.081514016,0.23956814,0.35801065,0.044357486,0.12298031,0.045170024,-0.03123095,0.164295,-0.045833882,-0.010424638,0.035251565,-0.32456934,-0.44369525,-0.17426875,0.15920722,0.37901664,0.06653093,-0.2608301,-0.15157995,0.07743571,0.052263275,0.215974,0.53836346,-0.50908613,-0.31911942,-0.2052894,0.40821216,0.095639676,0.1782159,0.34798354,0.11632549,0.27770376,-0.07184263,0.117635995,0.15783279,-1.3479093,0.12900954,-0.27185008,-0.27447858,0.16017412,0.23814358,0.13202462,0.40208158,0.17964338,0.029091055,0.015491009,-0.454121,0.3136282,-0.11191859,-0.29949835,-0.4145878,-0.46368086,0.2271799,-0.08060234,0.0874868,-0.17393741,0.033766944,-0.12218007,0.3