1Cxv3iN5OgQP91uhu0lQAoqukstnQbvqIIV6frtlf5I	https://n.news.naver.com/article/629/0000365636?sid=102	3	2	부천시, 해외여행 후 발열 시 ‘모기매개감염병 신속 검사’ 당부	# 해외 감염병 예방수칙\n- 모기 기피제 사용, 긴 옷 착용 등 예방수칙 강조\n- 말라리아와 뎅기열의 증상과 예방법 안내\n- 발열, 오한, 발진 등의 증상을 보이는 시민은 부천시·소사·오정보건소 진료실에서 무료 검사를 받을 수 있음\n- 말라리아 치료는 확인 진단 후 치료제 복용으로 가능\n- 부천시 내 말라리아 진료 가능한 의료기관 목록 제공\n- 뎅기열은 백신과 치료제가 없어 모기에 물리는 것을 최대한 피해야 함\n- 해외 여행 후 귀국 시 큐-코드 제출 및 검역소에서 신속진단키트검사를 받을 수 있음\n# 예방수칙\n- 모기 기피제 사용, 야간활동 자제, 밝은색 긴 옷 착용, 야외활동 후 샤워, 가정용 살충제 사용 및 방충망 정비 등 예방수칙 철저히 준수해야 함\n- 김은옥 부천시보건소장의 조기진단 및 치료 중요성 강조	- 모기 기피제 사용, 긴 옷 착용 등 예방수칙 강조.\n- 발열 등 증상이 있으면 무료 검사를 받고, 뎅기열은 모기에 물리는 것을 피해야 함.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/logo/News.jpg	[-0.16716966,-0.104124494,-0.15314406,-0.1774317,0.1486359,0.48595297,0.19806471,0.43296158,0.1346693,0.14586627,0.019693892,-0.18960384,0.16409078,0.36783844,-0.659148,-0.12988332,-0.052219566,-0.39223495,-0.45768097,-0.53555584,0.034363385,0.2756672,0.1418139,0.21748433,0.21030578,-0.41773152,-0.2412225,0.04584653,-0.20491517,-0.114765115,0.017218776,-0.14538604,-0.22372185,0.1279406,-0.05838141,0.019918617,0.25552696,-0.5146841,-0.4254328,0.2204712,-0.43706894,-0.115995295,-0.25595415,0.18294883,0.17759071,-0.34539616,0.38082913,0.090659976,-0.4855108,-0.18553975,-0.3689288,-0.97072995,-0.0073597766,0.04255058,-0.04651786,0.51488924,0.44417977,0.4066947,-0.42161062,-0.34658468,0.1931628,-0.21562767,-0.4118594,-0.3343396,0.09280689,0.0050215954,0.43937463,0.4077853,-0.28048545,-0.027317371,0.08049425,0.09505128,0.066906705,0.7615971,-0.31455752,0.13452256,0.013304595,0.34144244,0.6505761,-0.05444089,-0.03322071,-0.04954746,0.08724108,0.014287278,0.09591792,-0.46763507,0.062800564,-0.36894086,0.1442707,-0.38938886,-0.7285539,0.12927867,0.12040755,0.036287326,-0.21661162,0.16706392,-0.25981525,-0.16287357,0.23372453,-0.09785255,0.44837707,0.30633616,-0.6718753,0.19708008,-0.3103649,0.43258,0.10917252,0.3199867,0.19099995,-0.15581596,-0.25334656,-0.116297625,0.487918,0.07965