Vxs_q8XMjWoQWahClPP97DinS7yqrhaNv0aUW_psAGA	https://m.blog.naver.com/taekwon4820/223668916675	2	3	가을 부모님과 국내여행 가볼만한곳 고흥 레인보우교 녹동항 바다정원 팔영산 편백나무 : 네이버 블로그	# 가을 부모님과 국내 여행\n- 전라남도 고흥의 레인보우교, 녹동항 바다정원, 팔영산 편백나무 등 여러 장소를 방문하여 다양한 활동을 즐겼습니다.\n- 레인보우교는 국내 최장 연륙 인도교로, 오션뷰와 함께하는 여행지입니다.\n- 녹동항의 바다정원은 작은 규모이지만 아름다운 오션뷰와 다양한 조형물들이 특징입니다.\n- 팔영산 편백나무숲은 피톤치드 가득한 산림욕 장소로, 가족과 함께 즐길 수 있습니다.\n- 나로우주센터는 우주과학관으로, 아이들과 함께 방문하면 유익하고 재미있는 체험을 할 수 있습니다.	가을에 전라남도 고흥에서 레인보우교와 바다정원, 편백나무숲 등을 방문하여 다양한 활동을 즐겼습니다. 나로우주센터에서도 유익한 체험을 할 수 있었습니다.	https://a805bucket.s3.ap-northeast-2.amazonaws.com/images/blogPost/93644b88-ab9d-4d95-be93-1d33934c35ee.jpg	[-0.044907786,-0.43973005,-0.15764129,0.31243604,0.30323684,0.084004164,0.11398533,0.4844272,0.3089236,-0.31110623,0.06678988,-0.30843705,0.06437801,-0.37933478,0.39164722,0.33270305,0.2791655,0.109363824,0.14894263,-0.6848383,-0.09069078,0.11522759,-0.11984239,-0.5661885,-0.23398922,0.1825712,-0.36277926,-0.04617157,0.09248993,0.37885925,0.10414954,-0.40323824,-0.12852952,0.290686,-0.27043104,-0.10581696,0.01219826,-0.26128048,-0.047860708,-0.117711134,-0.2936015,-0.053454027,0.39057493,-0.30611408,-0.056327596,-0.5007987,0.4846413,-0.05836159,-0.28762096,-0.24572945,0.35073298,-0.13150544,-0.6192638,0.25918907,0.15331554,0.2940208,0.20324618,-0.15920646,-0.2524619,-0.3446781,-0.056679286,-0.036227338,-0.6069639,-0.66112405,-0.24769475,0.23202373,-0.2607617,0.36603618,-0.8368314,-0.56179166,0.714434,-0.20509373,0.38251576,0.3926898,0.19991055,-0.055699393,-0.19661194,-0.16529094,0.31886536,0.9463089,-1.0824368,0.29302508,0.3088205,0.34849814,0.10561898,-0.4549579,-0.6202073,-0.24060917,0.11370912,-0.25389615,0.2711572,-0.74069977,-0.6092442,0.13125193,0.14596993,0.41972584,-0.15563002,0.0028879382,0.16694249,0.31100065,0.1330918,0.028652959,-0.33049035,0.74720764,0.2020354,0.5426528,0.40104827,4.177587e-05,0.27509892,-0.3333293,0.083734885,0.06316969,-0.21264511,0.122543566,0.33113638,0.24458182,0.07556519,-0.025090635,-0.10763742,0.23858777,0.095